INSERT INTO `about_us` VALUES (1,'<p class=\"MsoNormal\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span style=\"font-weight: bolder;\"><span segoe=\"\" ui\",=\"\" \"sans-serif\";\"=\"\" style=\"font-size: 12pt;\"><font color=\"#000000\">Welcome to Choudhary Yatra Company Private Limited<o:p></o:p></font></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\"><font color=\"#000000\"><span segoe=\"\" ui\",=\"\" \"sans-serif\";=\"\" background:=\"\" rgb(248,=\"\" 248,=\"\" 248);\"=\"\">Service Provider of International and Domestic Tour and Travel. The company was incorporated in 1994 at Nashik. We have Received National Tourism Award. Budget friendly packages, Utmost comfort and friendly treatment make us the first choice of our clients. We offer exclusive range of services like Dwarka Rajasthan, Maharashtra and Goa Tours. Our Kashmir, Kulu and Manali tours are in huge demand across the global markets. We offer Amarnath, Badrinath and Kedarnath tours that are available at industry leading prices. Gangasagar, Kashi and Alahabaad offered by us are a class apart. Along with that we offer Domestic Packages, Dehradun and Masuri tours that are best in the industry amongst others. We also provide Hill Stations, Andaman and Portblair that are one of the best in the market.</span><span times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:=\"\" \"times=\"\" roman\";mso-fareast-language:en-in\"=\"\"><br><br><o:p></o:p></span></font></p><p class=\"MsoNormal\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span style=\"font-weight: bolder;\"><span segoe=\"\" ui\",=\"\" \"sans-serif\";\"=\"\" style=\"font-size: 12pt;\"><font color=\"#000000\">Choudhary Yatra Company Private Limited<o:p></o:p></font></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\"><font color=\"#000000\"><span segoe=\"\" ui\",=\"\" \"sans-serif\";=\"\" color:=\"\" rgb(68,=\"\" 68,=\"\" 68);=\"\" letter-spacing:=\"\" 0.45pt;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\">Established in the year 1994, we, Choudhary Yatra Company Private Limited, are one of the distinguished service providers of International and Domestic Tour & Travel. The proposed tour packages comprise of Ashtavinayak Darshan, Maharashtra & Goa Tours and Dwarka Rajasthan Tours. Because of impressive work in this field, we have achieved National Award from Tourism Ministry and National Tourism Award. We are well known in the market for providing unforgettable experience through our packages and lay huge emphasis on the safety, comfort and fulfillment of the varied needs of our valued clients. Owing to our reliable and flexible services, we have earned a large number of customers across the nation.<br>To manage and execute the services with utmost perfection, we have recruited experienced and knowledgeable professionals. We are concerned with the comfort and safety of our travelers and carry out our plans keeping in mind the constraints of time and budget. Our customers place immense trust in our capabilities and rely on us for offering organized tours with optimum comfort and personalized attention. We have earned a large number of clients in the past as a result of our unmatched quality of service and an impressive & friendly treatment.<br></span><span segoe=\"\" ui\",=\"\" \"sans-serif\";=\"\" color:=\"\" rgb(0,=\"\" 32,=\"\" 96);=\"\" letter-spacing:=\"\" 0.45pt;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\">We are a Private Limited Company under the capable leadership of Mr. Ravindra Barde. Our company is enjoying an unbeatable reputation under the consistent guidance and motivation of Mr. Premchand Bajranglal Choudhary, Mr. Chaturbhuj Bajranglal Choudhary, Mr. Mahendrapal Bajranglal Choudhary and Mr. Brijmohan Bajranglal Choudhary.</span><span times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:=\"\" \"times=\"\" roman\";mso-fareast-language:en-in\"=\"\"><br><br><o:p></o:p></span></font></p><p class=\"MsoNormal\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span style=\"font-weight: bolder;\"><span segoe=\"\" ui\",=\"\" \"sans-serif\";\"=\"\" style=\"font-size: 12pt;\"><font color=\"#000000\">Service Portfolio<o:p></o:p></font></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\"><font color=\"#000000\"><span segoe=\"\" ui\",=\"\" \"sans-serif\";=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\">Our firm is engaged in arranging a wide range of Domestic Tours services to the clients. Recently we have started organizing International Tours mentioned below. Designed by keeping in mind the budgetary, time and other constraints, our services are acknowledged for planned execution, utmost comfort, friendly treatment. From pilgrims, religious tours, historical tours and many hill station tours is speciality. Our professionals design the packages so as to provide memorable experience as per the preferences of the clients.</span><span segoe=\"\" ui\",=\"\" \"sans-serif\";\"=\"\"><br><br></span><span times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:=\"\" \"times=\"\" roman\";mso-fareast-language:en-in\"=\"\"><o:p></o:p></span></font></p><p class=\"MsoNormal\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span style=\"font-weight: bolder;\"><span segoe=\"\" ui\",=\"\" \"sans-serif\";\"=\"\" style=\"font-size: 12pt;\"><font color=\"#000000\">Regularly tour services organized by us are mentioned below:<o:p></o:p></font></span></span></p><ul><li style=\"margin-bottom: 0.0001pt; line-height: normal;\"><font color=\"#000000\">Ashtavinayak Tours</font></li><li style=\"margin-bottom: 0.0001pt; line-height: normal;\"><font color=\"#000000\">Maharashtra Darshan</font></li><li style=\"margin-bottom: 0.0001pt; line-height: normal;\"><font color=\"#000000\">Goa - Konkan Tours</font></li><li style=\"margin-bottom: 0.0001pt; line-height: normal;\"><font color=\"#000000\">Kashmir Vaishnodevi Tour</font></li><li style=\"margin-bottom: 0.0001pt; line-height: normal;\"><font color=\"#000000\">Kullu Manali Shimla Tour</font></li><li style=\"margin-bottom: 0.0001pt; line-height: normal;\"><font color=\"#000000\">Badrinath Kedarnath Tours</font></li><li style=\"margin-bottom: 0.0001pt; line-height: normal;\"><font color=\"#000000\">Amarnath Tour</font></li><li style=\"margin-bottom: 0.0001pt; line-height: normal;\"><font color=\"#000000\">Gujrat Rajasthan Tours</font></li><li style=\"margin-bottom: 0.0001pt; line-height: normal;\"><font color=\"#000000\">Nepal Darjeeling Gangtok Pokhara Tour</font></li><li style=\"margin-bottom: 0.0001pt; line-height: normal;\"><font color=\"#000000\">Gangasagar Puri Rameshwaram</font></li><li style=\"margin-bottom: 0.000