INSERT INTO `citywise_other_add_more` VALUES (1,'96','18','Ozer Ganpati','05:00:00','23:00:00','1,2,3,4,5,6,7','','50','','50','','150','30','33,32,13,12','55','55','No','main.jpeg','The Vigneshwara Temple or Vighnahar Ganapati Temple of Ozar (also spelt as Ojhar or Ojzar) is a Hindu temple dedicated to Ganesha, the elephant-headed god of wisdom. The temple is one of the Ashtavinayaka, the eight revered shrines of Ganesha in Maharasht','ओझरचे विघ्नेश्वर मंदिर किंवा विघ्नहर गणपती मंदिर (ओझर किंवा ओझर म्हणून देखील शब्दलेखन केले जाते) हे बुद्धीचे हत्तीच्या डोक्याच्या देवता गणेशाला समर्पित हिंदू मंदिर आहे. हे मंदिर महाराष्ट्रातील गणेशाच्या आठ पूज्य देवस्थानांपैकी एक अष्टविनायक आहे.','ओजर का विघ्नेश्वर मंदिर या विघ्नहर गणपति मंदिर (जिसे ओझर या ओज्जर भी कहा जाता है) एक हिंदू मंदिर है जो ज्ञान के देवता गणेश को समर्पित है। यह मंदिर महाराष्ट्र में गणेश के आठ पूजनीय मंदिरों में से एक है।','https://www.youtube.com/watch?v=BkyJkb_B4ew','','No','Yes','No','Yes','No','Yes','No','No','50','','no','yes','2024-10-24 05:39:49'),(2,'96','20','Bhimashankar','06:00:00','22:00:00','1,2,3,4,5,6,7','','50','','50','','200','60','33,32,13,12','55','55','No','main1.jpeg','Jyotirlingas are sacred shrines of Lord Shiva; it is believed that Lord Shiva himself visited these places and hence they have a special place in the hearts of devotees. There are 12 of them in India.\r\n\r\nJyotirlinga means ‘column or pillar of light’. The ','ज्योतिर्लिंगे ही भगवान शिवाची पवित्र तीर्थक्षेत्रे आहेत; असे मानले जाते की भगवान शिव यांनी स्वतः या स्थानांना भेट दिली होती आणि म्हणूनच त्यांचे भक्तांच्या हृदयात विशेष स्थान आहे. त्यापैकी 12 भारतात आहेत.\r\n\r\nज्योतिर्लिंग म्हणजे ‘स्तंभ किंवा प्रकाश स्तंभ’. ','ज्योतिर्लिंग भगवान शिव के पवित्र मंदिर हैं; ऐसा माना जाता है कि भगवान शिव स्वयं इन स्थानों पर आए थे और इसलिए भक्तों के दिलों में इनका विशेष स्थान है। भारत में इनकी संख्या 12 है।\r\n\r\nज्योतिर्लिंग का अर्थ है ‘प्रकाश का स्तंभ या स्तंभ’। ‘स्तंभ’ प्रतीक दर्शाता','https://www.youtube.com/watch?v=lhX7ss054iQ','','No','No','No','Yes','No','Yes','No','No','50','','no','yes','2024-10-24 05:55:19'),(3,'96','25','Ranjangaon Ganpati','06:00:00','22:00:00','1,2,3,4,5,6,7','','50','','50','','200','60','33','55','55','No','main2.jpeg','Ranjangaon Ganpati also known as Shri Mahaganpati Temple is a Hindu temple dedicated to Lord Ganesha, one of the most revered deities in Hinduism. Situated in the village of Ranjangaon within the Shirur taluka of Pune district, Maharashtra, India.\r\n','\r\n248 / 5,000\r\nरांजणगाव गणपती हे श्री महागणपती मंदिर म्हणूनही ओळखले जाते, हे हिंदू धर्मातील सर्वात आदरणीय देवतांपैकी एक, भगवान गणेशाला समर्पित हिंदू मंदिर आहे. महाराष्ट्र, भारताच्या पुणे जिल्ह्यातील शिरूर तालुक्यातील रांजणगाव गावात वसलेले आहे.','\r\n248 / 5,000\r\nरांजणगाव गणपती हे श्री महागणपती मंदिर म्हणूनही ओळखले जाते, हे हिंदू धर्मातील सर्वात आदरणीय देवतांपैकी एक, भगवान गणेशाला समर्पित हिंदू मंदिर आहे. महाराष्ट्र, भारताच्या रंजनगांव गणपति जिसे श्री महागणपति मंदिर के नाम से भी जाना जाता है, भगवान ','https://www.youtube.com/watch?v=9LLZ4nNmz2I','','No','No','No','No','No','Yes','No','No','50','','no','yes','2024-10-24 06:11:04'),(4,'96','21','Alandi','05:00:00','23:00:00','1,2,3,4,5,6,7','','50','','50','','2500','60','33,32,13,12','55','55','No','main3.jpeg','Alandi is a well known place of pilgrimage for Hindu Marathi people because of the town\'s association with Dnyaneshwar. His devotees believe that he is still alive. A temple complex was built at Dnyaneshwar\'s samadhi and is visited by pilgrims, especially','ज्ञानेश्वरांच्या सहवासामुळे आळंदी हे हिंदू मराठी लोकांसाठी प्रसिद्ध तीर्थक्षेत्र आहे. तो अजूनही जिवंत असल्याची त्याच्या भक्तांची श्रद्धा आहे. ज्ञानेश्वरांच्या समाधीवर एक मंदिर परिसर बांधण्यात आला होता आणि यात्रेकरू, विशेषत: वारकरी पंथाचे लोक त्याला भेट दे','आलंदी हिंदू मराठी लोगों के लिए तीर्थस्थल के रूप में प्रसिद्ध है, क्योंकि इस शहर का संबंध ज्ञानेश्वर से है। उनके भक्तों का मानना ​​है कि वे अभी भी जीवित हैं। ज्ञानेश्वर की समाधि पर एक मंदिर परिसर बनाया गया था और यहाँ तीर्थयात्री आते 