CREATE TABLE `packages` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `academic_year` int DEFAULT NULL,
  `tour_number` varchar(50) DEFAULT NULL,
  `tour_title` text,
  `package_type` varchar(32) NOT NULL,
  `main_tour_id` varchar(255) NOT NULL,
  `tour_type` varchar(255) NOT NULL,
  `destinations` text,
  `rating` int NOT NULL,
  `cost` int DEFAULT NULL,
  `twin_sharing_per_seat` varchar(50) NOT NULL,
  `three_or_four_sharing_per_seat` varchar(50) NOT NULL,
  `tour_number_of_days` varchar(255) DEFAULT NULL,
  `image_name` varchar(255) DEFAULT NULL,
  `pdf_name` varchar(255) DEFAULT NULL,
  `short_description` text,
  `full_description` text,
  `iternary` text,
  `inclusion` text,
  `terms_conditions` text,
  `contact_us` text,
  `package_full_image` varchar(255) NOT NULL,
  `inclusion_img` varchar(255) NOT NULL,
  `tc_img` varchar(255) NOT NULL,
  `tour_dates` varchar(255) NOT NULL,
  `boarding_office` varchar(255) NOT NULL,
  `hotel_type` varchar(255) NOT NULL,
  `zone_name` varchar(255) NOT NULL,
  `from_date` date DEFAULT NULL,
  `to_date` date DEFAULT NULL,
  `instraction_status` enum('yes','no') NOT NULL DEFAULT 'no',
  `cust_instraction_status` enum('yes','no') NOT NULL DEFAULT 'no',
  `is_deleted` enum('no','yes') NOT NULL DEFAULT 'no',
  `is_active` enum('no','yes') NOT NULL DEFAULT 'yes',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=165 DEFAULT CHARSET=utf8mb3;
