INSERT INTO `packages` VALUES (1,18,'01','Ashtavinayak Darshan, Alandi, Jejuri','1','','1','Ozar, Laynyadri, Bhimashankar, Alandi, Dehu, Mahad, Pali, Ranjangaon, Theur, Jejuri, Morgaon, Sidhhtek.',5,3161,'','','03','chaudhary_yatra1674106447T1.jpg','chaudhary_yatra1676885306T1-41-81.pdf','अष्टविनायकाचा शाब्दिक अर्थ संस्कृतमध्ये “आठ गणेश” असा होतो. गणेश हा हिंदू एकता, समृद्धी आणि शिक्षणाचा देव आहे. आठ हा शब्द गणेशाला सूचित करतो. अष्टविनायक यात्रीप्रीत हा महाराष्ट्र राज्यातील आठ हिंदू मंदिरांच्या यात्रेचा संदर्भ आहे, ज्यात पूर्वनियोजित क्रमाने गणेशाच्या आठ वेगवेगळ्या मूर्ती आहेत.','<p class=\"MsoNormal\"><span lang=\"HI\" style=\"font-family:\"Mangal\",serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">अष्टविनायकाची\r\nतीर्थयात्रा म्हणजे पुणे आणि त्याच्या आजूबाजूच्या क्षेत्रात वसलेल्या आठ प्राचीन\r\nपवित्र गणपतींच्या मंदिराचे दर्शन घेणे होय. या प्रत्येक मंदिरांचा स्वतःचा असा एक\r\nस्वतंत्र इतिहास आणि त्यासोबत जोडलेली स्वतःची आख्यायिका आहे. आणि ही सर्व माहिती\r\nतितकीच अद्वितीय आहे जितक्या प्रत्येक मंदिरातील गणपतीच्या मुर्त्या विलक्षण आहेत.\r\nया प्रत्येक मंदिरातील गणेश मूर्तीचे रूप आणि गणपतीच्या सोंडेची ठेवण ही\r\nएकमेकांपासून भिन्न आहे. असे म्हटले जाते की ही यात्रा पूर्णत्वास नेण्याकरिता\r\nसर्व आठ गणपतींचे दर्शन घेतल्यावर पुन्हा पहिल्या गणपतीचे दर्शन घ्यावे. या\r\nप्रत्येक आठही देवळातील प्रत्येक गणपती हा स्वयंभू असून अतिशय जागृत आहे असे मानले\r\nजाते. या विविध देवळांमध्ये मोरश्वर</span>, <span lang=\"HI\" style=\"font-family:\r\n\"Mangal\",serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nmso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:\r\nHI\">महागणपती</span>, <span lang=\"HI\" style=\"font-family:\"Mangal\",serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">चिंतामणी</span>,\r\n<span lang=\"HI\" style=\"font-family:\"Mangal\",serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-language:HI\">गिरिजात्मक</span>, <span lang=\"HI\" style=\"font-family:\"Mangal\",serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-language:HI\">विघ्नेश्वर</span>, <span lang=\"HI\" style=\"font-family:\"Mangal\",serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">सिद्धिविनायक</span>,\r\n<span lang=\"HI\" style=\"font-family:\"Mangal\",serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-language:HI\">बल्लाळेश्वर आणि वरद विनायक अशी गणपतीची\r\nवेगवेगळी नांवे आहेत.</span><o:p></o:p></p>',NULL,'chaudhary_yatra1687064773New_Inclusion_Image_one_sevennine.jpg','','','chaudhary_yatra1674202880T1_px1920x605.jpg','chaudhary_yatra1674106448T1.jpg','chaudhary_yatra1677669892ct.jpg','','4','1','4','0000-00-00','0000-00-00','no','no','no','yes','2023-01-19 05:34:07'),(2,6,'16','Kashmir, Vaishnodevi, Agra, Delhi, Pahelgam','','','','Mathura, Vrindavan, Agra, Delhi, Kurukshetra, Amritsar, Wagaborder, Katra (Vaishnodevi),  Srinagar, Sonmarg, Gulmarg,  Pahelgam.',5,36921,'','','15','chaudhary_yatra1674196769T16.jpg','chaudhary_yatra167419676916.pdf','काश्मीर हे एक उत्तम निसर्गाचे वरदान लाभलेले ठिकाण आहे. काश्मीर हे एक उत्तम ठिकाण आहे. येथे तुम्हाला वर्षभरात वेगवेगळ्या वेळी वेगवेगळी सुंदर दृश्ये पाहायला मिळतात.','<p class=\"MsoNormal\"><span lang=\"HI\" style=\"font-family:\"Mangal\",serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">भव्य ट्यूलिप\r\nगार्डन्ससाठी पूर्ण बहरण्यासाठी मार्च आणि एप्रिल उन्हाळ्याच्या महिन्यांमध्ये\r\nसर्वोत्तम वेळ आहे. काश्मीरमध्ये सर्वत्र हिरवीगार भूमी आहे</span>, <span lang=\"HI\" style=\"font-family:\r\n\"Mangal\",serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nmso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:\r\nHI\">उंच पर्वत मुख्यतः बर्फाने आच्छादलेले आहेत आणि निसर्गाच्या इतर अद्भुत\r\nसौंदर्याचा आनंद घेता येतो. पर्वतांच्या बर्फ आणि सौंदर्याचा आनंद घेण्यासाठी\r\nऑक्टोबर ते मार्च हे महिने सर्वोत्तम आहेत.</span><span lang=\"HI\"> </span><span lang=\"HI\" style=\"font-family:\"Mangal\",serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">श्रीनगर हे\r\nकाश्मीरमधील सर्वात प्रसिद्ध आणि सुंदर ठिकाणांपैकी एक आहे. पर्यटकांना येथे\r\nहिरवाईने नटलेले पर्वत दिसतात. दाल सरोवर हे श्रीनगरचे मुख्य आकर्षण आहे.</span><span lang=\"HI\"> </span><span lang=\"HI\" style=\"font-family:\"Mangal\",serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-language:HI\">गुलमर्ग हे पीर पंजाल रेंजच्या हिमालयीन\r\nखोऱ्यात आहे. प्रसिद्ध हिल स्टेशन असण्याव्यतिरिक्त</span>, <span lang=\"HI\" style=\"font-family:\"Mangal\",serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">गुलमर्ग हे एक अद्भुत\r\nस्कीइंग डेस्टिनेशन आहे. आपण येथे फुलांच्या शेतांचा आनंद घेऊ शकता.</span><span lang=\"HI\"> </span><span lang=\"HI\" style=\"font-family:\"Mangal\",serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-language:HI\">सोनमर्गमध्ये भेट देण्यासाठी सर्वोत्तम ठिकाण\r\nआहे. अॅडव्हेंचरचे शौकिन असलेल्यांसाठी हे ठिकाण नंदनवन आहे कारण येथे अनेक\r\nप्रकारचे ट्रेकिंग स्पॉट्स आहेत. येथे आपण ट्रेकिंग</span>, <span lang=\"HI\" style=\"font-family:\"Mangal\",serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-language:HI\">वॉटर रिव्हर राफ्टिंग करू शकता.</span><span lang=\"HI\"> </span><o:p></o:p></p>',NULL,'chaudhary_yatra1677749470New_Inclusion_Image.jpg',NULL,NULL,'chaudhary_yatra1674196769T16_px1920x605.jpg','chaudhary_yatra1674196769T16.jpg','chaudhary_yatra1674196769all_NIYAM___CYC.jpg','','4','','',NULL,NULL,'no','no','no','yes','2023-01-20 06:39:29'),(4,20,'03','Goa, Konkandarshan, Ganpatipule, Sindhudurg, Tarakal','1','','1','Kolhapur, Goa, Devbagh, Tarkarli, Malvan, Sindhudurg, Ganpatipule, Prachin Konkan (Museum), Derwan, Raigad, Shivtharghal, Mahabaleshwar.',5,25851,'','','09','chaudhary_yatra1677168314T3.jpg','chaudhary_yatra1677168314T3.pdf','Konkan is truly a heaven on earth for nature lovers who wish to relax in beaches, adventure to the top of hills and enjoy the beautiful waterfalls and sport in the clean backwaters. The 720 km long coastline along Maharashtra known as the Konkan is a stretch well known for it’s beautiful beaches, greenery, hills and sea forts. The beaches here are the most beautiful location to be in especially if you love the cool breeze, golden-brown sand and the mesmerizing blue sea. The beaches here are worth a visit. So take some time off you’re busy schedule to spend some quality time close to nature with family and friends by availing for a Konkan tour package','<p class=\"MsoNormal\">Konkan is truly a heaven on earth for nature lovers who wish\r\nto relax in beaches, adventure to the top of hills and enjoy the beautiful\r\nwaterfalls and sport in the clean backwaters. The 720 km long coastline along\r\nMaharashtra known as the Konkan is a stretch well known for it’s beautiful\r\nbeaches, greenery, hills and sea forts. The beaches here are the most beautiful\r\nlocation to be in especially if you love the cool breeze, golden-brown sand and\r\nthe mesmerizing blue sea. The beaches here are worth a visit. So take some time\r\noff you’re busy schedule to spend some quality time close to nature with family\r\nand friends by availing for a Konkan tour package <o:p></o:p></p><p class=\"MsoNormal\">Sprawling across the shore from Mumbai to Goa, Konkan is\r\nhome to picture-perfect sea beaches, splendid ruins, and much more. If you have\r\never traveled by train along the Konkan coast, you would know how beautiful\r\nthis place is. There are plenty of places to visit in Konkan where you can\r\nadmire the lush green charm of the coast and explore fishermen’s lives. Whether\r\nyou have always wanted to visit a string of forts or spend a holiday at the\r\ntropical beaches in India, Konkan is undoubtedly the best place to be at. Being\r\nhome to cascading waterfalls, virgin landscape, and delicious seafood, the\r\nKonkan coast has plenty to offer.<o:p></o:p></p><p>\r\n\r\n\r\n\r\n<span style=\"font-size:11.0pt;line-height:107%;font-family:\"Calibri\",sans-serif;\r\nmso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Mangal;\r\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-IN;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\">While there are many places to visit in Konkan,\r\nhere are 19 best places that you must visit during your trip to Konkan. From\r\nbeaches to ruins, there is something for all kinds of travelers in Konkan.</span><br></p>',NULL,NULL,'','','chaudhary_yatra1677168314T3_second_option.jpg','','','','4','1','4','0000-00-00','0000-00-00','no','no','no','yes','2023-02-06 09:04:45'),(6,18,'04','Special Goa Darshan','','','','Goa, Kalangut Beach, Donapawala, Miramar, Sent Francis Charch, Mangeshi Temple, Old Goa.',5,11045,'','','05','chaudhary_yatra1677168637T4.jpg','chaudhary_yatra16771686374.pdf','Goa, one of India\'s smallest states with an area of 3,702 sq km is cradled in the Sahayadri range in the Western Ghats. The vertical strip of the state begins from Tiracol in the north to Palolem in the south and is bounded by the Arabian Sea on the west, Maharashtra to thenorth and Karnataka to the east and south. Goa is India\'s most superior beach resort withsuperb beaches at least a million years old. Goa\'s beachnik lifestyle is best experienced during the winter months between October and the end of Feb.','<p>Goa, popularly known as \'the pearl of the east\', is famous for its churches, age-old ruins, palm-fringed beaches, coconut groves, ferry rides, and bubbly folk music. With its 131-km-long coastline, Goa is an important destination in every tourist\'s itinerary. Sun, sand and sea being the major attractions, Goa is a perfect heaven for the ones who need and want relaxation. </p><p>Goa is one of India\'s special places, a State seemingly blessed with fabulous weather, even more fabulous beaches, delightful people, good food, hill-top forts, little white-washed churches, soaring Portuguese-era cathedrals, a unique cultural legacy-small wonder, therefore, that Goa is one of India\'s prime holiday destinations.</p><div><br></div>',NULL,'chaudhary_yatra1677747401New_Inclusion_Image.jpg','','','chaudhary_yatra1677168637T4_-_second_option.jpg','chaudhary_yatra1675678598Inclusion_Image.jpg','chaudhary_yatra1675678598all_NIYAM___CYC.jpg','','4','1','2','0000-00-00','0000-00-00','no','no','no','yes','2023-02-06 10:16:37'),(7,18,'05','Kokan Darshan, Tarkarli, Ganpatipule, Mahabaleshwar','','','','Kankavali, Deobag, Tarkarli, Malvan, Sindhudurg, Ganpatipule, Prachin Kokan Museum, Dervan, Raigadh, Shivthargal, Mahableshwar.',5,11865,'','','06','chaudhary_yatra1675691277T5.jpg','chaudhary_yatra16756912785.pdf','Konkan is truly a heaven on earth for nature lovers who wish to relax in beaches, adventure to the top of hills and enjoy the beautiful waterfalls and sport in the clean backwaters. The 720 km long coastline along Maharashtra known as the Konkan is a stretch well known for it’s beautiful beaches, greenery, hills and sea forts. The beaches here are the most beautiful location to be in especially if you love the cool breeze, golden-brown sand and the mesmerizing blue sea. The beaches here are worth a visit. So take some time off you’re busy schedule to spend some quality time close to nature with family and friends by availing for a Konkan tour package','<p class=\"MsoNormal\">Konkan is home to picture-perfect sea beaches, splendid\r\nruins, and much more. If you have ever traveled by train along the Konkan\r\ncoast, you would know how beautiful this place is. There are plenty of places\r\nto visit in Konkan where you can admire the lush green charm of the coast and\r\nexplore fishermen’s lives. Whether you have always wanted to visit a string of\r\nforts or spend a holiday at the tropical beaches in India, Konkan is\r\nundoubtedly the best place to be at. Being home to cascading waterfalls, virgin\r\nlandscape, and delicious seafood, the Konkan coast has plenty to offer.<o:p></o:p></p><p>\r\n\r\n<span style=\"font-size:11.0pt;line-height:107%;font-family:\"Calibri\",sans-serif;\r\nmso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Mangal;\r\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-IN;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\">While there are many places to visit in Konkan,\r\nhere are 19 best places that you must visit during your trip to Konkan. From\r\nbeaches to ruins, there is something for all kinds of travelers in Konkan.</span><br></p>',NULL,'chaudhary_yatra1677747436New_Inclusion_Image.jpg','','','chaudhary_yatra1708095460T5_-_second_option.jpg','chaudhary_yatra1675691278Inclusion_Image.jpg','chaudhary_yatra1675691278Inclusion_Image.jpg','','4','1','2','0000-00-00','0000-00-00','no','no','no','yes','2023-02-06 13:47:57'),(8,18,'06','Dwarka, Kuberbhandari, Somnath, Sardar Sarovar','','','','Nilkanthdham (Swami Narayan Temple), Kuber Bhandari, Sardar Sarovar, Statue of Unity, Dakorji, Junagadh, | Sasangir Devalia Safari, Somnath, Bhaluka Tirth, Porbandar, Muldwarka, Dwarka, Rukmini Temple, Okha, Betdwarka, Nageshwar, Gopitalav, Sudamapuri, Prabhaspatan Siddharpur (Matrugaya). Ambaji, Akshardham (Swami Narayan Temple)',5,15375,'','','08','chaudhary_yatra1675692630T6.jpg','chaudhary_yatra16756926306.pdf','Dwarka is believed to have been the first capital of Gujarat. The city\'s name literally means the “gateway to heaven” in Sanskrit, as Dwar means “gate” and ka references “Brahma”. Dwarka has also been referred to throughout its history as “Mokshapuri”, “Dwarkamati”, and “Dwarkavati”.','<p class=\"MsoNormal\">According to ancient texts, Dwarka is considered to be the\r\nfirst capital of Gujarat. It is a city that is said to have been built by Lord\r\nKrishna after he killed his uncle Kansa in Mathura. In the Mahabharata , Dwarka\r\nis described as a utopian city with opulent architecture.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">The Kuber Bhandari temple is popular holy place at the shore\r\nof river Narmada and this temple is very ancient and is said to be around 2500\r\nyears old. Located on the bank of river Narmada the belief of visiting Kuber\r\nBhandari Temple on No Moon (Amavasya) day attracts pilgrims from all over\r\nIndia.<o:p></o:p></p>',NULL,'chaudhary_yatra1677747452New_Inclusion_Image.jpg',NULL,NULL,'chaudhary_yatra1708096107T6_-_second_option.jpg','chaudhary_yatra1675692630Inclusion_Image.jpg','chaudhary_yatra1675692630all_NIYAM___CYC.jpg','','4','1','4','0000-00-00','0000-00-00','no','no','no','yes','2023-02-06 14:10:30'),(9,18,'08','Kuber Bhandari, Statue of Unity, Ahmedabad','','','','Nilkanthdham (Swami Narayan Temple) Kuber Bhandari , Statue of Unity, Dakorji, Ahmedabad. Note : Travel to Dakorji, Ahmedabad Local Sightscene and Nashik will be by non AC vehicle.',5,8175,'','','02','chaudhary_yatra1675694100T8.jpg','chaudhary_yatra16756941008.pdf','Kuber Bhandari Mandir Karnali, Gujarat. It is a Lord Shiva temple and a very popular religious destination for locals and neighbourhood areas. We were told that on Amavasya there is a congregation of thousands of devotees. As per the legend, at one time Lord Shiva and Parvati were passing through this area.','<p><span style=\"color: rgb(17, 17, 17); font-family: sf_pro_textregular, Arial, Helvetica, sans-serif; font-size: 15px; text-align: justify;\">Statue of Unity-</span><span style=\"color: rgb(17, 17, 17); font-family: sf_pro_textregular, Arial, Helvetica, sans-serif; font-size: 15px; text-align: justify;\"> October 31st, 2018, marked the inauguration of the world’s tallest statue – the Statue of Unity, against the backdrop of the dramatic Satpura and Vindhyachal hills in Kevadia, Gujarat. The 182-metre (600 feet aprox.) statue is dedicated to Sardar Vallabhbhai Patel, the architect of independent India. The colossal monument towers over River Narmada, a tribute to India ‘from the people of Gujarat’ to the leader who placed people’s welfare first. The Statue of Unity overlooks the vast surrounds and the river basin of the Narmada River and the sprawling Sardar Sarovar dam. It stands on the Sadhu Bet hillock, connected by a 300-metre bridge, which offers access from the mainland to the statue.</span><br></p>',NULL,'chaudhary_yatra1677747466New_Inclusion_Image.jpg',NULL,NULL,'chaudhary_yatra1675694100T8_-_second_option_h_605_&_w_1920..jpg','chaudhary_yatra1675694100Inclusion_Image.jpg','chaudhary_yatra1675694100all_NIYAM___CYC.jpg','','4','1','4','0000-00-00','0000-00-00','no','no','no','yes','2023-02-06 14:34:59'),(10,18,'10','Mini Rajasthan, Chittor, Jaipur, Agra.','','','','Nathdwara Udaipur, Chittorgarh, Pushkar, Jaipur, Agra, Vrindavan, Mathura.',5,16205,'','','08','chaudhary_yatra1675694844T10.jpg','chaudhary_yatra167569484410.pdf','Rajasthan \'Land of Kings\' or \'Land of Kingdom\' is India\'s largest state by area. The state located on northwest part of country and is a home of cultural diversity. Its features include the ruins of Indus Valley Civilization, Temples, Forts and Fortresses in almost every city.','<p><span style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">Rajasthan \'Land of Kings\' or \'Land of Kingdom\' is </span><b style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">India\'s largest state by area</b><span style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">. The state located on northwest part of country and is a home of cultural diversity. Its features include the ruins of Indus Valley Civilization, Temples, Forts and Fortresses in almost every city.</span><br></p>',NULL,'chaudhary_yatra1677747483New_Inclusion_Image.jpg',NULL,NULL,'chaudhary_yatra1675694844T10_-_second_option_h_605_&_w_1920..jpg','chaudhary_yatra1675694844Inclusion_Image.jpg','chaudhary_yatra1675694844all_NIYAM___CYC.jpg','','4','1','4','0000-00-00','0000-00-00','no','no','no','yes','2023-02-06 14:47:24'),(11,18,'10A','Nathdwara, Mount Abu, Udaipur, Chittorgarh','','','','Nathdwara, Mount Abu, Udaipur, Chittorgarh.',5,12521,'','','05','chaudhary_yatra1675696087T10A.jpg','chaudhary_yatra167569608710A.pdf','Nathdwara is a significant Vaishnavite shrine pertaining to the Pushti Marg or the Vallabh Sampradaya or the Shuddha Advaita founded by Vallabha Acharya, revered mainly by people of Gujarat and Rajasthan, among others. Vitthal Nathji, son of Vallabhacharya institutionalised the worship of Shrinathji at Nathdwara.','<p>Nathdwara is a significant Vaishnavite shrine pertaining to the Pushti Marg or the Vallabh Sampradaya or the Shuddha Advaita founded by Vallabha Acharya, revered mainly by people of Gujarat and Rajasthan, among others. Vitthal Nathji, son of Vallabhacharya institutionalised the worship of Shrinathji at Nathdwara.<br></p>',NULL,'chaudhary_yatra1677747498New_Inclusion_Image.jpg','','','chaudhary_yatra1675696087T10A_-_second_option_h_605_&_w_