 city.<o:p></o:p></span></p>',NULL,'chaudhary_yatra1708680348New_Inclusion_Image_1_to_80.jpg','','','chaudhary_yatra1675761741T12A_-_second_option_h_605_&_w_1920..jpg','chaudhary_yatra1675761741Inclusion_Image.jpg','chaudhary_yatra1708680348all_NIYAM___CYC_2024-25.jpg','','4','1','4','0000-00-00','0000-00-00','no','no','no','yes','2023-02-07 09:22:21'),(16,18,'12B','Jaipur, Pushkar, Bikaner, Jaisalmer Desert','','','','Jaipur, Pushkar, Deshnok (Karni Mata Temple of Rats), Bikaner Ramdevra, Jaisalmer, Sum Desert.',5,18831,'','','07','chaudhary_yatra1675766257T12B.jpg','chaudhary_yatra167576625712B.pdf','Founded in AD 1727 by Maharaja Sawai Jai Singh II, Jaipur, the capital of Rajasthan is popularly known as the Pink City. With broad avenues and spacious gardens, the city is steeped in history and culture. Here the past comes alive in magnificent forts and palaces, blushed pink, where once lived the maharajas.','<p><b style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">Founded in AD 1727 by Maharaja Sawai Jai Singh II, Jaipur, the capital of Rajasthan is popularly known as the Pink City</b><span style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif;\">. With broad avenues and spacious gardens, the city is steeped in history and culture. Here the past comes alive in magnificent forts and palaces, blushed pink, where once lived the maharajas.</span><br></p>',NULL,'chaudhary_yatra1708680708New_Inclusion_Image_1_to_80.jpg',NULL,NULL,'chaudhary_yatra1675766257T12B_-_second_option_h_605_&_w_1920..jpg','chaudhary_yatra1675766257Inclusion_Image.jpg','chaudhary_yatra1708680708all_NIYAM___CYC_2024-25.jpg','','4','1','4','0000-00-00','0000-00-00','no','no','no','yes','2023-02-07 10:37:37'),(17,6,'13','Western Rajasthan, Jaisalmer, Ranakpur, Kumbhalgarh, Mount Abu','','','','Jaisalmer, Sum Desert, Jodhpur, Ranakpur, Kumbhalgarh, Mount Abu, Nathdwara, Udaipur, Chittorgarh.',5,17715,'','','08','chaudhary_yatra1675766975T13.jpg','chaudhary_yatra167576697513.pdf','The western part of Rajasthan is relatively dry and infertile. Rajasthan is home to the Thar Desert, also known as the Great Indian Desert, and the Chambal River, which is solely responsible for the water supply in the region. Jaipur, Udaipur, Kota and Ajmer are known as the four smart cities in Rajasthan.','<p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">The western part of Rajasthan is </span><b>relatively dry and infertile</b>. Rajasthan is home to the <span class=\"jpfdse\">Thar\r\nDesert</span>, also known as the Great Indian Desert, and the\r\nChambal River, which is solely responsible for the water supply in the region.\r\nJaipur, Udaipur, Kota and Ajmer are known as the four smart cities in Rajasthan.<o:p></o:p></p>',NULL,'chaudhary_yatra1677749416New_Inclusion_Image.jpg','','','chaudhary_yatra1675766975T13_-_second_option_h_605_&_w_1920..jpg','chaudhary_yatra1675766975Inclusion_Image.jpg','chaudhary_yatra1675766975Inclusion_Image.jpg','','4','','',NULL,NULL,'no','no','no','yes','2023-02-07 10:49:35'),(18,6,'14','Delhi, Agra, Mathura, Vrindavan, Fatehpur Sikri','','','','Delhi, Agra, Mathura, Vrindavan, Fatehpur Sikri, Ghana World Century. (April to September Close Ghana World Century.) No Seat Nomber.',4,19461,'','','06','chaudhary_yatra1675776450T14.jpg','chaudhary_yatra167577645014.pdf','Situated on the banks of the Yamuna River, Mathura is a sacred town for the Hindus that has found mention in historical and mythological anecdotes. Mathura city is mentioned in the oldest epic, the Ramayana. It was first known as Madhuvan because of the thick and dense forests that were once there.','<p class=\"MsoNormal\"><b><span style=\"font-family: Arial, sans-serif; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Situated on the banks of the Yamuna River, Mathura is a\r\nsacred town for the Hindus that has found mention in historical and\r\nmythological anecdotes</span></b><span style=\"font-family: Arial, sans-serif; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">. Mathura city is mentioned in the oldest epic,\r\nthe Ramayana. It was first known as Madhuvan because of the thick and dense\r\nforests that were once there.</span><o:p></o:p></p>',NULL,'chaudhary_yatra1677749431New_Inclusion_Image.jpg',NULL,NULL,'chaudhary_yatra1675776450T14_-_second_option_h_605_&_w_1920..jpg','chaudhary_yatra1675776450Inclusion_Image.jpg','chaudhary_yatra1675776450all_NIYAM___CYC.jpg','','4','','',NULL,NULL,'no','no','no','yes','2023-02-07 13:27:30'),(19,20,'15','Vaishnodevi, Delhi, Agra, Shivkhodi, Patnitop','1','','1','Mathura, Vrindavan, Agra, Delhi, Kurukshetra, Amritsar, Wagah Border, Katra (Vaishnodevi), Shivkhodi, Patnitop.',4,25301,'','','11','chaudhary_yatra1675778147T15.jpg','chaudhary_yatra167577814715.pdf','The temple of Goddess Vaishno Devi is one of the major and sacred Hindu temples dedicated to Parvati or Goddess Shakti, the Divine Consort of Lord Shiva. This beautiful temple lies ensconced among the picturesque hills of Vaishno Devi, in the state of Jammu and Kashmir in India. Hindus venerate Vaishno Devi, also commonly referred to as Mata Rani and Vaishnavi, is the very  manifestation of the Mother Goddess Shakti.','<p><span style=\"color: rgb(128, 128, 128); font-family: \"Trebuchet MS\", Verdana, Arial, Helvetica, sans-serif; font-size: 14px;\">The Vaishno Devi Manir is located close to the town of Katra, in the Reasi district. It is one o