 will be given but onward journey from Kolhapur to departure office will have to be done at own expense)',5,19461,'','','07','chaudhary_yatra1676194555T27.jpg','chaudhary_yatra167619455527.pdf','Tirupati, the holy city is located in the southeastern part of Andhra Pradesh and Known for ‘Kaliyuga’ deity Lord Venkateswara. The general elevation of the mountainous part of the district is 2500 feet above sea level.  The Chennai & Bangalore cities are located in 150 Kms. and 250 Kms. respectively to Tirupati Town. \r\nRamoji Film City is a perfect place for all the Bollywood and cinema lovers. The place was set-up by Ramoji Rao in the year 1991. Since then, Ramoji Film City has been serving as a spectacular getaway for the locals of Hyderabad and tourists worldwide. Sprawling over an area stretch of around 2500 acres, this wonderland has been crowned as the World’s Largest Film Studio Complex under the Guinness Book of World Records.','<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: Arial, sans-serif; color: rgb(80, 80, 80); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Tirupati, the holy city is\r\nlocated in the southeastern part of Andhra Pradesh and Known for ‘Kaliyuga’\r\ndeity Lord Venkateswara. The general elevation of the mountainous part of the\r\ndistrict is 2500 feet above sea level. \r\nThe Chennai & Bangalore cities are located in 150 Kms. and 250 Kms.\r\nrespectively to Tirupati Town. <o:p></o:p></span></p><p>\r\n\r\n</p><p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: Arial, sans-serif; color: rgb(80, 80, 80); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Ramoji Film City is a\r