'09','chaudhary_yatra1677224048T68.jpg','chaudhary_yatra167722404868.pdf','Kashi Vishwanath Temple is one of the holiest Hindu Temples located in Kashi, now called Varanasi. Know about this temples history, its architecture, the legend of Jyotirlingas here in the article below.\r\nKashi is the old name for the city of Benaras, now called Varanasi. The place is known to be on the banks of the holy river Ganges, called Ganga in Hindi. Varanasi is known for its temple and the most famous temple there is the Kashi Vishwanath temple. It is located in the Vishwanath Gali in the city and has millions of devotees visiting it every year.','<p class=\"MsoNormal\">Kashi Vishwanath Temple is one of the holiest Hindu Temples\r\nlocated in Kashi, now called Varanasi. Know about this temples history, its\r\narchitecture, the legend of Jyotirlingas here in the article below.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Kashi is the old name for the city of Benaras, now called\r\nVaranasi. The place is known to be on the banks of the holy river Ganges,\r\ncalled Ganga in Hindi. Varanasi is known for its temple and the most famous\r\ntemple there is the Kashi Vishwanath temple. It is located in the Vishwanath\r\nGali in the city and has millions of devotees visiting it every year.<o:p></o:p></p>',NULL,'chaudhary_yatra1677750014New_Inclusion_Image.jpg',NULL,NULL,'chaudhary_yatra1677224048T68_-_second_option.jpg','chaudhary_yatra1677224049Inclusion_Image_1-80.jpg','chaudhary_yatra1677224049all_NIYAM___CYC.jpg','','4','1','3','0000-00-00','0000-00-00','no','no','no','yes','2023-02-24 07:34:08'),(48,6,'69','Darjeeling, Gangasagar, Jagannathpuri','','','','Siliguri, Darjeeling, Namchi (4Dham Temple) Gangtok, Baba Mandir, Tsangulek , Calcutta, Harborpoint (Ganga Sagar), Bhubaneswar, Jagannathpuri, Konark, Sakshigopal.',5,36921,'','','13','chaudhary_yatra1677225342T69.jpg','chaudhary_yatra167722534269.pdf','\"Sab tirath bar bar, Gangasagar ekbar\", may we visit other holy places several times - but a visit once to Gangasagar is worth a life-time, keeping it in mind Hindus from all over the world, from Nepal, Thailand, West Indies, Canada, Japan, far from Australia and from every state of India reaches the confluence of Ganges at Sagar Sangam situated in southern part of West Bengal in India.\r\nGangasagar or Sagar Island is an island in the Ganges delta, lying on the continental shelf of Bay of Bengal about 100 kms (54 nautical miles) south of Kolkata. The island is large with an area of 224.3 kms. Gangasagar is a charming tourist destination, which attracts both pilgrims and adventure lovers. Located on an island in the Sundarbans, Gangasagar offers the charms of an un-spoilt beach on the estuary of the river Ganges. Gangasagar offers acres of silver sand and clear blue sky, and the calm sea for visitors who would like to spend their weekend in tranquility.\r\nGangasagar has acres of dazzling silver sand and clear blue sky, Gangasagar is still relatively unknown and thus, unexploited. The island of Gangasagar is among the most popular Hindu pilgrimage places in the country. Each year on Makar Sankranti (mid-January), large number of devotees from all over the nation, congregate at Gangasagar for a sacred dip at the convergence of the river Ganga and the Bay of Bengal. After the sacred dip, the pilgrims offer Puja at the Kapil Muni Temple or Ashram. In several Hindu myths, the name Gangasagar is mentioned, Gangasagar also finds itself in the poetry of Rabindranath Tagore. The lighthouse at Gangasagar has great views of this beach and is perfect for watching the sunrise and sunset.','<p class=\"MsoNormal\">\"Sab tirath bar bar, Gangasagar ekbar\", may we visit\r\nother holy places several times - but a visit once to Gangasagar is worth a\r\nlife-time, keeping it in mind Hindus from all over the world, from Nepal,\r\nThailand, West Indies, Canada, Japan, far from Australia and from every state\r\nof India reaches the confluence of Ganges at Sagar