sacred idols, are the famous “Ashta Vinayak.”\r\nAshtavinayaka literally means “eight Ganeshas” in Sanskrit. Everybody should visit the Ashtavinayak in Maharashtra at least once in a life time. There are eight temples dedicated to Ganesha, in Maharashtra related to various episodes from the puranas and other legends. According to Shastra, first you have to visit Moreshwar of Moregaon. Then visit Siddhatek, Pali, Mahad, Theur, Lenyandri, Ozar, Ranjangaon and then again Moregaon.','<p class=\"MsoNormal\">Ashtavinayaka Temples refer to the eight Shrines of Lord\r\nGanesha situated in Maharashtra state of India. The Ashtavinayaka Yatra is the\r\npilgrimage covering these eight holy abodes of Ganesha in and around Pune\r\nDistrict of Maharashtra. Out of these 8 Temples 6 are in Pune and 2 are in\r\nRaigad District.<o:p></o:p></p><p class=\"MsoNormal\">Lord Ganesha the elephant faced God is usually worshiped\r\nfirst before any other worship service is carried out to any other deity.\r\n“Vinayaka” is another name of Lord Ganesh, the God loved and worshiped by every\r\nHindu. Lord Ganesh is the protector of his devotees. Eight effigies found among\r\nthe nature, sculptured by nature have been housed in the temples created ages\r\nago at the places where the effigies were first identified. These ‘Swayambhu’\r\neffigies, now the sacred idols, are the famous “Ashta Vinayak.”<o:p></o:p></p><p>\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\">Ashtavinayaka literally means “eight Ganeshas” in Sanskrit.\r\nEverybody should visit the Ashtavinayak in Maharashtra at least once in a life\r\ntime. There are eight temples dedicated to Ganesha, in Maharashtra related to\r\nvarious episodes from the puranas and other legends. According to Shastra,\r\nfirst you have to visit Moreshwar of Moregaon. Then visit Siddhatek, Pali,\r\nMahad, Theur, Lenyandri, Ozar, Ranjangaon and then again Moregaon.<o:p></o:p></p>',NULL,'chaudhary_yatra1677914867New_Inclusion_Image_eightyone_onefivesix.jpg',NULL,NULL,