ath, Prabhaspatan, Porbandar, Muldwarka, Dwarka, Rukhmini Temple Okha, Betdwarka, Nageshwar, Gopitalav, Siddhapur (Matrugaya). Ambaji, Mount Abu, Nathdwara, Pushkar, Jaipur, Agra, Mathura, Vrindavan, Delhi, Kurukshetra, Amritsar, Katra (Vaishnadevi), Haridwar, Rampur (Kedarnath), Badrinath, Rishikesh, Prayag- Allahabad, Kashi Varanasi, Chitrakoot, Khajuraho, Ujjain, Omkareshwar, (*Mathura to Haridwar & *Kashi to Onkareshwar) attractions are not allotted seat number during travel).',5,43815,'','','32','chaudhary_yatra1678010536T83.jpg','chaudhary_yatra167801053783_2_pages.pdf','Dwarka is believed to have been the first capital of Gujarat. The city\'s name literally means the “gateway to heaven” in Sanskrit, as Dwar means “gate” and ka references “Brahma”. Dwarka has also been referred to throughout its history as “Mokshapuri”, “Dwarkamati”, and “Dwarkavati”.\r\nAccording to ancient texts, Dwarka is considered to be the first capital of Gujarat. It is a city that is said to have been built by Lord Krishna after he killed his uncle Kansa in Mathura. In the Mahabharata , Dwarka is described as a utopian city with opulent architecture.\r\nThe Kuber Bhandari temple is popular holy place at the shore of river Narmada and this temple is very ancient and is said to be around 2500 years old. Located on the bank of river Narmada the belief of visiting Kuber Bhandari Temple on No Moon (Amavasya) day attracts pilgrims from all over India.','<p class=\"MsoNormal\">Dwarka is believed to have been the first capital of\r\nGujarat. The city\'s name literally means the “gateway to heaven” in Sanskrit,\r\nas Dwar means “gate” and ka references “Brahma”. Dwarka has also been referred\r\nto throughout its history as “Mokshapuri”, “Dwarkamati”, and “Dwarkavati”.<o:p></o:p></p><p class=\"MsoNormal\">According to ancient texts, Dwarka is considered to be the\r\nfirst capital of Gujarat. It is a city that is said to have been built by Lord\r\nKrishna after he killed his uncle Kansa in Mathur