Mother Goddess Shakti.','<p>The temple of Goddess Vaishno Devi is one of the major and sacred Hindu temples dedicated to Parvati or Goddess Shakti, the Divine Consort of Lord Shiva. This beautiful temple lies ensconced among the picturesque hills of Vaishno Devi, in the state of Jammu and Kashmir in India. Hindus venerate Vaishno Devi, also commonly referred to as Mata Rani and Vaishnavi, is the very&nbsp; manifestation of the Mother Goddess Shakti.</p><p>The Vaishno Devi Manir is located close to the town of Katra, in the Reasi district. It is one of the most revered places of worship in India. The shrine is situated at an altitude of 5300 feet above sea level and lies at a distance of approximately 12 kilometres from Katra.</p><p><span style=\"font-size: 1rem;\">It has been recorded that close to 8 million yatris (pilgrims) visit the temple every year, from each and every part of the world. It is believed to be the second most visited religious shrine in India, coming after the Tirumala Venkateswara Temple.</span></p><div><br></div>',NULL,NULL,NULL,NULL,'chaudhary_yatra1678685111T88__second_option.jpg','chaudhary_yatra1678685111New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1678685111all_NIYAM___CYC.jpg','','4','','',NULL,NULL,'no','no','no','yes','2023-03-13 05:25:11'),(64,6,'89','Badrinath, Kedarnath, Mathura, Vaishnodevi, Kashi.','','','','Mathura, Vrindavan, Delhi, Kurukshetra, Amritsar, Katra (Vaishnadevi), Haridwar, Rampur (Kedarnath) Badrinath, (Rishikesh, Prayag Allahabad, Kashi-Varanasi)',5,33311,'','','18','chaudhary_yatra1679674833T89.jpg','chaudhary_yatra167967483389.pdf','Badrinath: Badarinath is one of the holy shrines for Vaishnavites among the 108 divya desams incarnation of Lord Vishnu. Badrinath town is also the part of Panch Badri temples including Yog Dhyan Badri, Bhavishya Badri, Adi Badri and Vriddha Badri, along with Badrinath temple.\r\nKedarnath: In Hindu tradition, it is believed that Lord Shiva manifested in form of Jyotirlingam or the cosmic light. There are 12 such Jyotirlingas and Kedarnath is highest among them. This magnificent temple is ancient and constructed over a thousand years ago by Jagad Guru Adi Shankaracharya. It is located in the Rudra Himalaya range of Uttarakhand State. It is situated at an altitude of 3,581 mt & it is a 16 km trek from the nearest place of Gaurikund.\r\nVaishno Devi: The temple of Goddess Vaishno Devi is one of the major and sacred Hindu temples dedicated to Parvati or Goddess Shakti, the Divine Consort of Lord Shiva. This beautiful temple lies ensconced among the picturesque hills of Vaishno Devi, in the state of Jammu and Kashmir in India. Hindus venerate Vaishno Devi, also commonly referred to as Mata Rani and Vaishnavi, is the very  manifestation of the Mother Goddess Shakti.','<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: Arial, sans-serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Badrinath: Badarinath is one\r\nof the holy shrines for Vaishnavites among the 108 divya desams incarnation of\r\nLord Vishnu. Badrinath town is also the part of Panch Badri temples including\r\nYog Dhyan Badri, Bhavishya Badri, Adi Badri and Vriddha Badri, along with\r\nBadrinath temple.</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Kedarnath: </span><span style=\"font-size: 10.5pt; line-height: 107%; font-family: Arial, sans-serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; backgr