 year pilgrims indulge in Yamunotri and Gangotri Char Dham Yatra to take the divine blessings of Yamunotri and Gangotri. These shrines are your first step ahead in the fulfillment of your spiritual goals. It is the first road to seek enlightenment and be free from the karmic backlogs of life.','<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Yamunotri and Gangotri Dham are the\r\nmost sacred pilgrimage sites for Hindu devotees. Without the darshan of these\r\ntwo prominent temples, your sacred Char Dham Yatra is incomplete. Yamunotri is\r\nthe first Dam in the journey of Char Dham Yatra. It is dedicated to Goddess\r\nYamuna which is also one of the most sacred rivers for Hindus. A short trek\r\nfrom Janki Chatti will lead you to take the divine blessings of Goddess Yamuna.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">On the other hand, Gangotri Temple\r\nis located on the banks of Bhagirathi River. It is the second shrine in the\r\njourney of Pious Char Dham Yatra. Gangotri Temple was built by a Nepalese King\r\nAmar Singh Thapa and the original source of river Ganga is Gaumukh at Gangotri\r\nGlacier. It is the most sacred river for Hindu Devotees.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Every year pilgrims indulge in\r\nYamunotri and Gangotri Char Dham Yatra to take the divine blessings of\r\nYamunotri and Gangotri. These shrines are your first step ahead in the\r\nfulfillment of your spiritual goals. It is the first road to seek enlightenment\r\nand be free from the karmic backlogs of life.<o:p></o:p></span></p>',NULL,'',NULL,NULL,'chaudhary_yatra1679723485T100__second_option.jpg','chaudhary_yatra1679723485New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1679723486all_NIYAM___CYC.jpg','','4','2','3','0000-00-00','0000-00-00','no','no','no','yes','2023-03-25 05:51:25'),(76,6,'111','Badrikedarnath, Yamunotri, Gangotri, Haridwar.','1','','1','Haridwar, Syanachatty (Yamunotri), Uttarkashi, Ganganani, Gangotri, Rampur (Kedarnath), Badrinath, Rishikesh.',5,27471,'','','14','chaudhary_yatra1679805756T111.jpg','chaudhary_yatra1679805756111.pdf','Uttarakhand is called as a Dev Bhoomi ie land of Gods. It has a number of temples dating back to thousands of years. The most famous among them are the temples located in the four locations of Badarinath, Kedarnath, Gangotri & Yamunotri, which are collectively referred as Char Dham. Pilgrims from all over India and abroad visit the shrines as Char Dham Yatra. The Char Dham yatra hold great importance and sanctity in Hindu religion. It is said that every Hindu should undertake Char Dham Yatra at least once in a life time & get blessings of gods adorning the shrines.\r\n\r\nThere are four holy shrines in Uttarakhand dedicated to Hindu Gods and holy rivers of India. The four shrines are situated within the Garhwal Region. These are collectively referred as \"Char Dhaam of Uttarakhand\" . Pilgrims from all over India and abroad visit the shrines as \"Char Dhaam Yatra\". In Hindu religion, Char Dhaam Yatra holds has great importance and sanctity. It is believed that every Hindu should undertake Char Dhaam Yatra at least once in a life time to avail the blessings of gods adorning the shrines.','<p class=\"MsoNormal\">Uttarakhand is called as a Dev Bhoomi ie land of Gods. It has a number of temples dating back to thousands of years. The most famous among them are the temples located in the four locations of Badarinath, Kedarnath, Gangotri & Yamunotri, which are collectively referred as Char Dham. Pilgrims from all over India and abroad visit the shrines as Char Dham Yatra. The Char Dham yatra hold great importance and sanctity in Hindu religion. It is said that every Hindu should undertake Char Dham Yatra at least once in a life time & get blessings of gods adorning the shrines.</p><p class=\"MsoNormal\">There are four holy shrines in Uttarakhand dedicated to Hindu Gods and holy rivers of India. The four shrines are situated within the Garhwal Region. These are collectively referred as \"Char Dhaam of Uttarakhand\" . Pilgrims from all over India and abroad visit the shrines as \"Char Dhaam Yatra\". In Hindu religion, Char Dhaam Yatra holds has great importance and sanctity. It is believed that every Hindu should undertake Char Dhaam Yatra at least once in a life time to avail the blessings of gods adorning the shrines.</p>',NULL,NULL,NULL,NULL,'chaudhary_yatra1679805756T111__second_option.jpg','chaudhary_yatra1679805756New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1679805756all_NIYAM___CYC.jpg','','4','1','3','0000-00-00','0000-00-00','no','no','no','yes','2023-03-26 04:42:36'),(77,20,'112','Amarnath, Vaishnodevi, Shrinagar, Kashmir.','1','','1','Amritsar, Wagh Border, Pahelgam / Baltal (Amarnath), Srinagar,  Gulmarg, Katra (Vaishnodevi).',5,27831,'','','12','chaudhary_yatra1679821076T112.jpg','chaudhary_yatra1679821076112.pdf','Amarnath Yatra is one among the four major pilgrimages of India, and flock of devotees trek through the south Kashmir Himalayas to the Holy Cave Shrine of Shri Amarnathji every year. The temple is opened for devotees only during summers, in the month of July to August. People rush to see the Ice image of Lord Shiva that is formed in the shape of a Lingam - stalagmite. The image incredibly waxes and wanes with the sight of Moon. People of Hindu faith in India consider this religious journey as one of the major tasks of their life that can fairly show them the path to heaven\r\nVaishno Devi: The temple of Goddess Vaishno Devi is one of the major and sacred Hindu temples dedicated to Parvati or Goddess Shakti, the Divine Consort of Lord Shiva. This beautiful temple lies ensconced among the picturesque hills of Vaishno Devi, in the state of Jammu and Kashmir in India. Hindus venerate Vaishno Devi, also commonly referred to as Mata Rani and Vaishnavi, is the very  manifestation of the Mother Goddess Shakti.','<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Amarnath Yatra is one among the\r\nfour major pilgrimages of India, and flock of devotees trek through the south\r\nKashmir Himalayas to the Holy Cave Shrine of Shri Amarnathji every year. The temple\r\nis opened for devotees only during summers, in the month of July to August.\r\nPeople rush to see the Ice image of Lord Shiva that is formed in the shape of a\r\nLingam - stalagmite. The image incredibly waxes and wanes with the sight of\r\nMoon. People of Hindu faith in India consider this religious journey as one of\r\nthe major tasks of their life that can fairly show them the path to heaven<o:p></o:p></span></p><p>\r\n\r\n<span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; back