anchi, Vishnukanchi, Mahabalipuram, Srirangam, Rameswaram, Kanyakumari, Suchindram, Madurai, Mysore, Vrindavan Garden, Gokarna, Kolhapur, Bhimashankar, Parli Vaijnath, Auda Nagnath, Verul (Ghrishneshwar), Omkareshwar, Ujjain, Indore.',5,77025,'','','56','chaudhary_yatra1679823916T115.jpg','chaudhary_yatra1679823916115___3_pages.pdf','पृथ्वीचा मानदंड असलेल्या या देवतात्मा हिमालयाच्या अंगाखांद्यावर अनेक सुंदर गोष्टी वसलेल्या आहेत. चीड-देवदारसारखे सूचिपर्णी वृक्ष, अनेक तऱ्हेची फुले-फळे, नद्या, त्यांची खोरी, उंचच उंच हिमशिखरे, अनेक मंदिरे, तीर्थक्षेत्रे आणि त्यांच्या सान्निध्यात रुजलेली लोकसंस्कृती. उत्तराखंड राज्य या सर्व निसर्गसंपत्तीने नटलेले आहे. या राज्याचे प्रामुख्याने कुमाऊँ आणि गढवाल असे दोन भाग पडत असले तरी गढवाल हा प्रदेश श्रद्धाळू, पर्यटक आणि गिर्यारोहक या सर्वाच्याच दृष्टीने जास्त महत्त्वाचा आहे. या भूमीला देवभूमी असे नाव मिळण्याचे हेच तर कारण आहे. अतिशय प्रसन्न आणि आल्हाददायक हवा, रम्य निसर्ग आणि त्यात वसलेली सुंदर देवळे. गढवालमधील गंगोत्री-यमुनोत्री-बद्रीनाथ-केदारनाथ या चार तीर्थक्षेत्रांना चारधाम असे संबोधले जाते, त्यांची यात्रा करणे हे पुण्यप्रद मानले जातेच, परंतु त्याचसोबत या चार ठिकाणांची भटकंती ही तिथे असलेल्या निसर्गामुळे अतिशय प्रेक्षणीय होते. या चारधामांची काही एक खास वैशिष्टय़े आहेत. हे चारही धाम हिवाळ्यात हिमवृष्टीमुळे बंद असतात. त्या काळात गंगोत्रीची पूजा ‘मुखवा’ इथे, यमुनोत्रीची पूजा ‘जानकीचट्टीला’, बद्रीनाथची पूजा ‘जोशीमठला’ तर केदारनाथची पूजा ही ‘उखीमठ’ या ठिकाणी केली जाते. वर्षांतले सहाच महिने हे धाम उघडे असल्यामुळे त्या काळात इथे भाविकांची आणि पर्यटकांची मोठी वर्दळ पाहायला मिळते. िहदू पंचांगानुसार अक्षय्यतृतीयेला, म्हणजे साधारणपणे एप्रिल-मे या काळात या चारही मंदिरांचे दरवाजे उघडतात आणि अधिकृतपणे ही यात्रा सुरू होते. याच काळात आपल्याकडे सुट्टय़ांचा काळ आणि उन्हाळासुद्धा तीव्र असल्यामुळे भटकंतीसाठी हिमालयात चारधामला जाणे अतिशय सोयीचे ठरते.','<p><span style=\"color: rgb(0, 0, 0); font-family: Montserrat, sans-serif; font-size: 17px;\">पृथ्वीचा मानदंड असलेल्या या देवतात्मा हिमालयाच्या अंगाखांद्यावर अनेक सुंदर गोष्टी वसलेल्या आहेत. चीड-देवदारसारखे