्रेक्षणीय होते. गंगोत्रीची पूजा ‘मुखवा’ इथे</span><span lang=\"EN\" style=\"font-size:12.0pt;mso-bidi-font-family:Calibri;mso-bidi-theme-font:\r\nminor-latin;color:#2F5597;mso-themecolor:accent5;mso-themeshade:191;mso-style-textfill-fill-color:\r\n#2F5597;mso-style-textfill-fill-themecolor:accent5;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=75000;mso-ansi-language:\r\nEN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;font-family:&quot;Mangal&quot;,serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;color:#2F5597;mso-themecolor:accent5;\r\nmso-themeshade:191;mso-style-textfill-fill-color:#2F5597;mso-style-textfill-fill-themecolor:\r\naccent5;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\nlumm=75000;mso-ansi-language:EN;mso-bidi-language:HI\">यमुनोत्रीची पूजा\r\n‘जानकीचट्टीला’</span><span lang=\"EN\" style=\"font-size:12.0pt;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin;color:#2F5597;mso-themecolor:accent5;\r\nmso-themeshade:191;mso-style-textfill-fill-color:#2F5597;mso-style-textfill-fill-themecolor:\r\naccent5;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\nlumm=75000;mso-ansi-language:EN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;\r\nfont-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\ncolor:#2F5597;mso-themecolor:accent5;mso-themeshade:191;mso-style-textfill-fill-color:\r\n#2F5597;mso-style-textfill-fill-themecolor:accent5;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=75000;mso-ansi-language:\r\nEN;mso-bidi-language:HI\">बद्रीनाथची पूजा ‘जोशीमठला’ तर केदारनाथची पूजा ही\r\n‘उखीमठ’ या ठिकाणी केली जाते. वर्षांतले सहाच महिने हे धाम उघडे असल्यामुळे त्या\r\nकाळात इथे भाविकांची आणि पर्यटकांची मोठी वर्दळ पाहायला मिळते. िहदू पंचांगानुसार\r\nअक्षय्यतृतीयेला</span><span lang=\"EN\" style=\"font-size:12.0pt;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin;color:#2F5597;mso-themecolor:accent5;\r\nmso-themeshade:191;mso-style-textfill-fill-color:#2F5597;mso-style-textfill-fill-themecolor:\r\naccent5;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\nlumm=75000;mso-ansi-language:EN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;\r\nfont-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\ncolor:#2F5597;mso-themecolor:accent5;mso-themeshade:191;mso-style-textfill-fill-color:\r\n#2F5597;mso-style-textfill-fill-themecolor:accent5;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=75000;mso-ansi-language:\r\nEN;mso-bidi-language:HI\">म्हणजे साधारणपणे एप्रिल-मे या काळात या चारही मंदिरांचे\r\nदरवाजे उघडतात आणि अधिकृतपणे ही यात्रा सुरू होते. याच काळात आपल्याकडे सुट्टय़ांचा\r\nकाळ आणि उन्हाळासुद्धा तीव्र असल्यामुळे भटकंतीसाठी हिमालयात चारधामला जाणे अतिशय\r\nसोयीचे ठरते.</span><span lang=\"EN\" style=\"font-size:12.0pt;mso-bidi-font-family:\r\nMangal;color:#2F5597;mso-themecolor:accent5;mso-themeshade:191;mso-style-textfill-fill-color:\r\n#2F5597;mso-style-textfill-fill-themecolor:accent5;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=75000;mso-ansi-language:\r\nEN;mso-bidi-language:HI\"><o:p></o:p></span></p>',NULL,NULL,NULL,NULL,'chaudhary_yatra1679825085T18_-_second_option.jpg','chaudhary_yatra1679825085New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1679825085all_NIYAM___CYC.jpg','','4','','',NULL,NULL,'no','no','no','yes','2023-03-26 10:04:45'),(83,6,'119','2dham, Dwarka, Badrikedar, Yamunotri, Gangotri','','','','Tribakeshwar, Nashik, Kuberbhandari, Nilkanthdham (Swaminarayan Temple) Statue of Unity, Sardar Sarovar, Dakorji, Junagadh, Girnar, Somnath, Prabhaspatan, Porbandar, Mukdwarka, Dwarka, Rukhmini Mandir, Okha, Betwarka, Nageshwar, Gopitalav, Siddpur, (Matrugaya) Ambaji Mt.Abu, Delwada, Nathdwara, Pushkar, Jaipur, Agra, Mathura, Vrindavan, Delhi, Haridwar, Sayanachatti (Yamunotri), Uttarkashi, Gangnani, Gangotri, Rampur (Kedarnath, Badrinath, Rishikesh)',5,44535,'','','25','chaudhary_yatra1679825853T119.jpg','chaudhary_yatra1679825853119___2_pages.pdf','द्वारका, गुजरातच्या द्वारका जिल्ह्यातील एक शहर ओखामंडल द्वीपकल्पाच्या पश्चिम किनाऱ्यावर आणि गोमती नदीच्या काठावर वसलेले आहे. द्वारका हे सर्वात लक्षणीय हिंदू तीर्थक्षेत्रांपैकी एक आहे आणि भगवान कृष्णाच्या राज्याची प्राचीन आणि पौराणिक राजधानी असल्याचे म्हटले जाते. द्वारका हे मोठ्या चारधाम सर्किटमधील चारधामांपैकी एक आहे आणि आदरणीय ‘सप्त पुरी’पैकी एक आहे;\r\nपृथ्वीचा मानदंड असलेल्या या देवतात्मा हिमालयाच्या अंगाखांद्यावर अनेक सुंदर गोष्टी वसलेल्या आहेत. चीड-देवदारसारखे सूचिपर्णी वृक्ष, अनेक तऱ्हेची फुले-फळे, नद्या, त्यांची खोरी, उंचच उंच हिमशिखरे, अनेक मंदिरे, तीर्थक्षेत्रे आणि त्यांच्या सान्निध्यात रुजलेली लोकसंस्कृती. या सर्व निसर्गसंपत्तीने नटलेले आहे. अतिशय प्रसन्न आणि आल्हाददायक हवा, रम्य निसर्ग आणि त्यात वसलेली सुंदर देवळे. गढवालमधील गंगोत्री-यमुनोत्री-बद्रीनाथ-केदारनाथ या चार तीर्थक्षेत्रांना चारधाम असे संबोधले जाते, त्यांची यात्रा करणे हे पुण्यप्रद मानले जातेच, परंतु त्याचसोबत या चार ठिकाणांची भटकंती ही तिथे असलेल्या निसर्गामुळे अतिशय प्रेक्षणीय होते. गंगोत्रीची पूजा ‘मुखवा’ इथे, यमुनोत्रीची पूजा ‘जानकीचट्टीला’, बद्रीनाथची पूजा ‘जोशीमठला’ तर केदारनाथची पूजा ही ‘उखीमठ’ या ठिकाणी केली जाते. वर्षांतले सहाच महिने हे धाम उघडे असल्यामुळे त्या काळात इथे भाविकांची आणि पर्यटकांची मोठी वर्दळ पाहायला मिळते. िहदू पंचांगानुसार अक्षय्यतृतीयेला, म्हणजे साधारणपणे एप्रिल-मे या काळात या चारही मंदिरांचे दरवाजे उघडतात आणि अधिकृतपणे ही यात्रा सुरू होते. याच काळात आपल्याकडे सुट्टय़ांचा काळ आणि उन्हाळासुद्धा तीव्र असल्यामुळे भटकंतीसाठी हिमालयात चारधामला जाणे अतिशय सोयीचे ठरते.','<p class=\"MsoNormal\" style=\"line-height:normal\"><span lang=\"HI\" style=\"font-size:\r\n12.0pt;font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\ncolor:#385723;mso-themecolor:accent6;mso-themeshade:128;mso-style-textfill-fill-color:\r\n#385723;mso-style-textfill-fill-themecolor:accent6;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=50000;mso-ansi-language:\r\nEN;mso-bidi-language:HI\">द्वारका</span><span lang=\"EN\" style=\"font-size:12.0pt;\r\nmso-bidi-font-family:Mangal;color:#385723;mso-themecolor:accent6;mso-themeshade:\r\n128;mso-style-textfill-fill-color:#385723;mso-style-textfill-fill-themecolor:\r\naccent6;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\nlumm=50000;mso-ansi-language:EN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;\r\nfont-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\ncolor:#385723;mso-themecolor:accent6;mso-themeshade:128;mso-style-textfill-fill-color:\r\n#385723;mso-style-textfill-fill-themecolor:accent6;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=50000;mso-ansi-language:\r\nEN;mso-bidi-language:HI\">गुजरातच्या द्वारका जिल्ह्यातील एक शहर ओखामंडल\r\nद्वीपकल्पाच्या पश्चिम किनाऱ्यावर आणि गोमती नदीच्या काठावर वसलेले आहे. द्वारका\r\nहे सर्वात लक्षणीय हिंदू तीर्थक्षेत्रांपैकी एक आहे आणि भगवान कृष्णाच्या राज्याची\r\nप्राचीन आणि पौराणिक राजधानी असल्याचे म्हटले जाते. द्वारका हे मोठ्या चारधाम\r\nसर्किटमधील चारधामांपैकी एक आहे आणि आदरणीय ‘सप्त पुरी’पैकी एक आहे</span><span lang=\"EN\" style=\"font-size:12.0pt;mso-bidi-font-family:Mangal;color:#385723;\r\nmso-themecolor:accent6;mso-themeshade:128;mso-style-textfill-fill-color:#385723;\r\nmso-style-textfill-fill-themecolor:accent6;mso-style-textfill-fill-alpha:100.0%;\r\nmso-style-textfill-fill-colort