:lumm=50000;mso-ansi-language:\r\nEN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;font-family:&quot;Mangal&quot;,serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;color:#385723;mso-themecolor:accent6;\r\nmso-themeshade:128;mso-style-textfill-fill-color:#385723;mso-style-textfill-fill-themecolor:\r\naccent6;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\nlumm=50000;mso-ansi-language:EN;mso-bidi-language:HI\">नद्या</span><span lang=\"EN\" style=\"font-size:12.0pt;mso-bidi-font-family:Calibri;mso-bidi-theme-font:\r\nminor-latin;color:#385723;mso-themecolor:accent6;mso-themeshade:128;mso-style-textfill-fill-color:\r\n#385723;mso-style-textfill-fill-themecolor:accent6;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=50000;mso-ansi-language:\r\nEN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;font-family:&quot;Mangal&quot;,serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;color:#385723;mso-themecolor:accent6;\r\nmso-themeshade:128;mso-style-textfill-fill-color:#385723;mso-style-textfill-fill-themecolor:\r\naccent6;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\nlumm=50000;mso-ansi-language:EN;mso-bidi-language:HI\">त्यांची खोरी</span><span lang=\"EN\" style=\"font-size:12.0pt;mso-bidi-font-family:Calibri;mso-bidi-theme-font:\r\nminor-latin;color:#385723;mso-themecolor:accent6;mso-themeshade:128;mso-style-textfill-fill-color:\r\n#385723;mso-style-textfill-fill-themecolor:accent6;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=50000;mso-ansi-language:\r\nEN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;font-family:&quot;Mangal&quot;,serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;color:#385723;mso-themecolor:accent6;\r\nmso-themeshade:128;mso-style-textfill-fill-color:#385723;mso-style-textfill-fill-themecolor:\r\naccent6;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\nlumm=50000;mso-ansi-language:EN;mso-bidi-language:HI\">उंचच उंच हिमशिखरे</span><span lang=\"EN\" style=\"font-size:12.0pt;mso-bidi-font-family:Calibri;mso-bidi-theme-font:\r\nminor-latin;color:#385723;mso-themecolor:accent6;mso-themeshade:128;mso-style-textfill-fill-color:\r\n#385723;mso-style-textfill-fill-themecolor:accent6;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=50000;mso-ansi-language:\r\nEN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;font-family:&quot;Mangal&quot;,serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;color:#385723;mso-themecolor:accent6;\r\nmso-themeshade:128;mso-style-textfill-fill-color:#385723;mso-style-textfill-fill-themecolor:\r\naccent6;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\nlumm=50000;mso-ansi-language:EN;mso-bidi-language:HI\">अनेक मंदिरे</span><span lang=\"EN\" style=\"font-size:12.0pt;mso-bidi-font-family:Calibri;mso-bidi-theme-font:\r\nminor-latin;color:#385723;mso-themecolor:accent6;mso-themeshade:128;mso-style-textfill-fill-color:\r\n#385723;mso-style-textfill-fill-themecolor:accent6;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=50000;mso-ansi-language:\r\nEN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;font-family:&quot;Mangal&quot;,serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;color:#385723;mso-themecolor:accent6;\r\nmso-themeshade:128;mso-style-textfill-fill-color:#385723;mso-style-textfill-fill-themecolor:\r\naccent6;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\nlumm=50000;mso-ansi-language:EN;mso-bidi-language:HI\">तीर्थक्षेत्रे आणि\r\nत्यांच्या सान्निध्यात रुजलेली लोकसंस्कृती. या सर्व निसर्गसंपत्तीने नटलेले आहे. अतिशय\r\nप्रसन्न आणि आल्हाददायक हवा</span><span lang=\"EN\" style=\"font-size:12.0pt;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;color:#385723;\r\nmso-themecolor:accent6;mso-themeshade:128;mso-style-textfill-fill-color:#385723;\r\nmso-style-textfill-fill-themecolor:accent6;mso-style-textfill-fill-alpha:100.0%;\r\nmso-style-textfill-fill-colortransforms:lumm=50000;mso-ansi-language:EN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;color:#385723;mso-themecolor:accent6;\r\nmso-themeshade:128;mso-style-textfill-fill-color:#385723;mso-style-textfill-fill-themecolor:\r\naccent6;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\nlumm=50000;mso-ansi-language:EN;mso-bidi-language:HI\">रम्य निसर्ग आणि त्यात\r\nवसलेली सुंदर देवळे. गढवालमधील गंगोत्री-यमुनोत्री-बद्रीनाथ-केदारनाथ या चार\r\nतीर्थक्षेत्रांना चारधाम असे संबोधले जाते</span><span lang=\"EN\" style=\"font-size:\r\n12.0pt;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;color:#385723;\r\nmso-themecolor:accent6;mso-themeshade:128;mso-style-textfill-fill-color:#385723;\r\nmso-style-textfill-fill-themecolor:accent6;mso-style-textfill-fill-alpha:100.0%;\r\nmso-style-textfill-fill-colortransforms:lumm=50000;mso-ansi-language:EN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;color:#385723;mso-themecolor:accent6;\r\nmso-themeshade:128;mso-style-textfill-fill-color:#385723;mso-style-textfill-fill-themecolor:\r\naccent6;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\nlumm=50000;mso-ansi-language:EN;mso-bidi-language:HI\">त्यांची यात्रा करणे हे\r\nपुण्यप्रद मानले जातेच</span><span lang=\"EN\" style=\"font-size:12.0pt;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin;color:#385723;mso-themecolor:accent6;\r\nmso-themeshade:128;mso-style-textfill-fill-color:#385723;mso-style-textfill-fill-themecolor:\r\naccent6;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\nlumm=50000;mso-ansi-language:EN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;\r\nfont-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\ncolor:#385723;mso-themecolor:accent6;mso-themeshade:128;mso-style-textfill-fill-color:\r\n#385723;mso-style-textfill-fill-themecolor:accent6;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=50000;mso-ansi-language:\r\nEN;mso-bidi-language:HI\">परंतु त्याचसोबत या चार ठिकाणांची भटकंती ही तिथे\r\nअसलेल्या निसर्गामुळे अतिशय प्रेक्षणीय होते. गंगोत्रीची पूजा ‘मुखवा’ इथे</span><span lang=\"EN\" style=\"font-size:12.0pt;mso-bidi-font-family:Calibri;mso-bidi-theme-font:\r\nminor-latin;color:#385723;mso-themecolor:accent6;mso-themeshade:128;mso-style-textfill-fill-color:\r\n#385723;mso-style-textfill-fill-themecolor:accent6;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=50000;mso-ansi-language:\r\nEN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;font-family:&quot;Mangal&quot;,serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;color:#385723;mso-themecolor:accent6;\r\nmso-themeshade:128;mso-style-textfill-fill-color:#385723;mso-style-textfill-fill-themecolor:\r\naccent6;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\nlumm=50000;mso-ansi-language:EN;mso-bidi-language:HI\">यमुनोत्रीची पूजा\r\n‘जानकीचट्टीला’</span><span lang=\"EN\" style=\"font-size:12.0pt;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin;color:#385723;mso-themecolor:accent6;\r\nmso-themeshade:128;mso-style-textfill-fill-color:#385723;mso-style-textfill-fill-themecolor:\r\naccent6;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\nlumm=50000;mso-ansi-language:EN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;\r\nfont-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\ncolor:#385723;mso-themecolor:accent6;mso-themeshade:128;mso-style-textfill-fill-color:\r\n#385723;mso-style-textfill-fill-themecolor:accent6;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=50000;mso-ansi-language:\r\nEN;mso-bidi-language:HI\">बद्रीनाथची पूजा ‘जोशीमठला’ तर केदारनाथची पूजा ही\r\n‘उखीमठ’ या ठिकाणी केली जाते. वर्षांतले सहाच महिने हे धाम उघडे असल्यामुळे त्या\r\nकाळात इथे भाविकांची आणि पर्यटकांची मोठी वर्दळ पाहायला मिळते. िहदू पंचांगानुसार\r\nअक्षय्यतृतीयेला</span><span lang=\"EN\" style=\"font-size:12.0pt;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin;color:#385723;mso-themecolor:accent6;\r\nmso-themeshade:128;mso-style-textfill-fill-color:#385723;mso-style-textfill-fill-themecolor:\r\naccent6;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\nlumm=50000;mso-ansi-language:EN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;\r\nfont-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\ncolor:#385723;mso-themecolor:accent6;mso-themeshade:128;mso-style-textfill-fill-color:\r\n#385723;mso-style-textfill-fill-themecolor:accent6;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=50000;mso-ansi-language:\r\nEN;mso-bidi-language:HI\">म्हणजे साधारणपणे एप्रिल-मे या काळात या चारही मंदिरांचे\r\nदरवाजे उघडतात आणि अधिकृतपणे ही यात्रा सुरू होते. याच काळात आपल्याकडे सुट्टय़ांचा\r\nकाळ आणि उन्हाळासुद्धा तीव्र असल्यामुळे भटकंतीसाठी हिमालयात चारधामला जाणे अतिशय\r\nसोयीचे ठरते.</span><span lang=\"EN\" style=\"font-size:12.0pt;mso-bidi-font-family:\r\nMangal;color:#385723;mso-themecolor:accent6;mso-themeshade:128;mso-style-textfill-fill-color:\r\n#385723;mso-style-textfill-fill-themecolor:accent6;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=50000;mso-ansi-language:\r\nEN;mso-bidi-language:HI\"><o:p></o:p></span></p>',NULL,NULL,NULL,NULL,'chaudhary_yatra1679825853T119__second_option.jpg','chaudhary_yatra1679825853New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1679825853all_NIYAM___CYC.jpg','','4','','',NULL,NULL,'no','no','no','yes','2023-03-26 10:17:32'),(84,6,'120','3dham, Badrikedarnath, Jagannathpuri, Rameswaram, Nepal.','','','','Haridwar, Sthanachatti (Yamunotri), Uttarkashi, Gangnani, Gangotri, Rampur (Kedarnath) Badrinath (Rishikesh, Prayag Allahabad, Kashi-Varanasi) Ayodhya, Gorakhpur, Kathmandu, Janakpur, Gaya, Buddha Gaya, Calcutta, Harbor Point (Ganga Sagar), Jagannathpuri, Konark, Bhubaneswar, Sakshigopal, Simhachalam, Annavaram, Shrishailyam, Tirupati (Balaji) Padmavati, Vellore (Sripuram Mahalakshmi Golden Temple), Sivakanchi, Vishnukanchi, Mahabalipuram, Srirangam, Rameswaram, Kanyakumari, Suchindram, Madurai, Mysore, Vrindavan Garden, Gokarna, Kolhapur, Bhimashankar, Parli Vaijnath, Aundha Nagnath, Verul (Ghrishneshwar), Omkareshwar, Ujjain.',5,68331,'','','45','chaudhary_yatra1679896008T120.jpg','chaudhary_yatra1679896008120___3_pages.pdf','पृथ्वीचा मानदंड असलेल्या या देवतात्मा हिमालयाच्या अंगाखांद्यावर अनेक सुंदर गोष्टी वसलेल्या आहेत. चीड-देवदारसारखे सूचिपर्णी वृक्ष, अनेक तऱ्हेची फुले-फळे, नद्या, त्यांची खोरी, उंचच उंच हिमशिखरे, अनेक मंदिरे, तीर्थक्षेत्रे आणि त्यांच्या सान्निध्यात रुजलेली लोकसंस्कृती. या सर्व निसर्गसंपत्तीने नटलेले आहे. अतिशय प्रसन्न आणि आल्हाददायक हवा, रम्य निसर्ग आणि त्यात वसलेली सुंदर देवळे. गढवालमधील गंगोत्री-यमुनोत्री-बद्रीनाथ-केदारनाथ या चार तीर्थक्षेत्रांना चारधाम असे संबोधले जाते, त्यांची यात्रा करणे हे पुण्यप्रद मानले जातेच, परंतु त्याचसोबत या चार ठिकाणांची भटकंती ही तिथे असलेल्या निसर्गामुळे अतिशय प्रेक्षणीय होते. गंगोत्रीची पूजा ‘मुखवा’ इथे, यमुनोत्रीची पूजा ‘जानकीचट्टीला’, बद्रीनाथची पूजा ‘जोशीमठला’ तर केदारनाथची पूजा ही ‘उखीमठ’ या ठिकाणी केली जाते. वर्षांतले सहाच महिने हे धाम उघडे असल्यामुळे त्या काळात इथे भाविकांची आणि पर्यटकांची मोठी वर्दळ पाहायला मिळते. िहदू पंचांगानुसार अक्षय्यतृतीयेला, म्हणजे साधारणपणे एप्रिल-मे या काळात या चारही मंदिरांचे दरवाजे उघडतात आणि अधिकृतपणे ही यात्रा सुरू होते. याच काळात आपल्याकडे सुट्टय़ांचा काळ आणि उन्हाळासुद्धा तीव्र असल्यामुळे भटकंतीसाठी हिमालयात चारधामला जाणे अतिशय सोयीचे ठरते.','<p class=\"MsoNormal\" style=\"line-height:normal\"><span lang=\"HI\" style=\"font-size:\r\n12.0pt;font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\ncolor:#385623;mso-themecolor:accent6;mso-themeshade:128;mso-ansi-language:EN;\r\nmso-bidi-language:HI\">पृथ्वीचा मानदंड असलेल्या या देवतात्मा हिमालयाच्या\r\nअंगाखांद्यावर अनेक सुंदर गोष्टी वसलेल्या आहेत. चीड-देवदारसारखे सूचिपर्णी वृक्ष</span><span lang=\"EN\" style=\"font-size:12.0pt;mso-bidi-font-family:Calibri;mso-bidi-theme-font:\r\nminor-latin;color:#385623;mso-themecolor:accent6;mso-themeshade:128;mso-ansi-language:\r\nEN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;font-family:&quot;Mangal&quot;,serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;color:#385623;mso-themecolor:accent6;\r\nmso-themeshade:128;mso-ansi-language:EN;mso-bidi-language:HI\">अनेक तऱ्हेची\r\nफुले-फळे</span><span lang=\"E