े पुण्यप्रद मानले जातेच</span><span lang=\"EN\" style=\"font-size:12.0pt;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;color:#385623;\r\nmso-themecolor:accent6;mso-themeshade:128;mso-ansi-language:EN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;color:#385623;mso-themecolor:accent6;\r\nmso-themeshade:128;mso-ansi-language:EN;mso-bidi-language:HI\">परंतु त्याचसोबत\r\nया चार ठिकाणांची भटकंती ही तिथे असलेल्या निसर्गामुळे अतिशय प्रेक्षणीय होते.\r\nगंगोत्रीची पूजा ‘मुखवा’ इथे</span><span lang=\"EN\" style=\"font-size:12.0pt;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;color:#385623;\r\nmso-themecolor:accent6;mso-themeshade:128;mso-ansi-language:EN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;color:#385623;mso-themecolor:accent6;\r\nmso-themeshade:128;mso-ansi-language:EN;mso-bidi-language:HI\">यमुनोत्रीची पूजा\r\n‘जानकीचट्टीला’</span><span lang=\"EN\" style=\"font-size:12.0pt;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin;color:#385623;mso-themecolor:accent6;\r\nmso-themeshade:128;mso-ansi-language:EN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;color:#385623;mso-themecolor:accent6;mso-themeshade:128;mso-ansi-language:\r\nEN;mso-bidi-language:HI\">बद्रीनाथची पूजा ‘जोशीमठला’ तर केदारनाथची पूजा ही\r\n‘उखीमठ’ या ठिकाणी केली जाते. वर्षांतले सहाच महिने हे धाम उघडे असल्यामुळे त्या\r\nकाळात इथे भाविकांची आणि पर्यटकांची मोठी वर्दळ पाहायला मिळते. िहदू पंचांगानुसार\r\nअक्षय्यतृतीयेला</span><span lang=\"EN\" style=\"font-size:12.0pt;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin;color:#385623;mso-themecolor:accent6;\r\nmso-themeshade:128;mso-ansi-language:EN\">, </span><span lang=\"HI\" style=\"font-size:12.0pt;font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;color:#385623;mso-themecolor:accent6;mso-themeshade:128;mso-ansi-language:\r\nEN;mso-bidi-language:HI\">म्हणजे साधारणपणे एप्रिल-मे या काळात या चारही मंदिरांचे\r\nदरवाजे उघडतात आणि अधिकृतपणे ही यात्रा सुरू होते. याच काळात आपल्याकडे सुट्टय़ांचा\r\nकाळ आणि उन्हाळासुद्धा तीव्र असल्यामुळे भटकंतीसाठी हिमालयात चारधामला जाणे अतिशय\r\nसोयीचे ठरते.</span><span lang=\"EN\" style=\"font-size:12.0pt;mso-bidi-font-family:\r\nMangal;color:#385623;mso-themecolor:accent6;mso-themeshade:128;mso-ansi-language:\r\nEN;mso-bidi-language:HI\"><o:p></o:p></span></p>',NULL,NULL,NULL,NULL,'chaudhary_yatra1679896008T120__second_option.jpg','chaudhary_yatra1679896009New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1679896009all_NIYAM___CYC.jpg','','4','','',NULL,NULL,'no','no','no','yes','2023-03-27 05:46:48'),(85,6,'121','Dham, Badri-Kedarnath, Jagannathpuri, Nepal, Gangasagar','','','','Haridwar, Syanachatti (Yamunotri) Uttarkashi, Ganganani, Gangotri, Rampur (Kedarnath), Badrinath, (Rishikesh, Prayag-Allahabad, Kashi-Varanashi), Ayodhya, Gorakhpur, Kathmandu, Janakpur, Gaya. Buddhagaya, Calcutta, Harborpoint (Gangasagar), Jagannathpuri, Konark, Bhubaneswar, Sakshigopal, Simhachalam, Annavaram, Shrishailyam, Tirupati (Balaji) Padmavati.',5,52725,'','','32','chaudhary_yatra1679896372T121.jpg','chaudhary_yatra1679896372121___2_pages.pdf','Badrinath: Badarinath is one of the holy shrines for Vaishnavites among the 108 divya desams incarnation of Lord Vishnu. Badrinath town is also the part of Panch Badri temples including Yog Dhyan Badri, Bhavishya Badri, Adi Badri and Vriddha Badri, along with Badrinath temple.\r\nKedarnath: In Hindu tradition, it is believed that Lord Shiva manifested in form of Jyotirlingam or the cosmic light. There are 12 such Jyotirlingas and Kedarnath is highest among them. This magnificent temple is ancient and constructed over a thousand years ago by Jagad Guru Adi Shankaracharya. It is located in the Rudra Himalaya range of Uttarakhand State. It is situated at an altitude of 3,581 mt & it is a 16 km trek from the nearest place of Gaurikund.','<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Badrinath: Badarinath is one of the\r\nholy shrines for Vaishnavites among the 108 divya desams incarnation of Lord\r\nVishnu. Badrinath town is also the part of Panch Badri temples including Yog\r\nDhyan Badri, Bhavishya Badri, Adi Badri and Vriddha Badri, along with Badrinath\r\ntemple.<o:p></o:p></span></p><p>\r\n\r\n</p><p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Kedarnath: In Hindu tradition, it\r\nis believed that Lord Shiva manifested in form of Jyotirlingam or the cosmic\r\nlight. There are 12 such Jyotirlingas and Kedarnath is highest among them. This\r\nmagnificent temple is ancient and constructed over a thousand years ago by\r\nJagad Guru Adi Shankaracharya. It is located in the Rudra Himalaya range of\r\nUttarakhand State. It is situated at an altitude of 3,581 mt &amp; it is a 16\r\nkm trek from the nearest place of Gaurikund.<o:p></o:p></span></p>',NULL,NULL,NULL,NULL,'