hwaram, Nepal, Ujjain','','','','Omkareshwar, Ujjain, Khajuraho, Chitrakoot, Prayag-Allahabad, Kashi, Ayodhya, Gorakhpur, Kathmandu, Janakpur, Gaya, Buddhagaya, Calcutta, HarborPoint (Gangasagar) Bhubaneswar, Konark, Jagannathpuri, Sakshigopal, Singhachalam, Annavaram, Srisailyam, Tirupati (Balaji), Padmavati, Vellore (Sripuram Mahalaxmi Golden Temple), Shivakanchi, Vishnukanchi, Mahabalipuram, Srirangam, Rameshwaram, Kanyakumari, Suchindram, Madurai, Mysore, Vrindavan Garden, Gokarna, Kolhapur.',4,43031,'','','32','chaudhary_yatra1679898166T124.jpg','chaudhary_yatra1679898166124.pdf','\"Sab tirath bar bar, Gangasagar ekbar\", may we visit other holy places several times - but a visit once to Gangasagar is worth a life-time, keeping it in mind Hindus from all over the world, from Nepal, Thailand, West Indies, Canada, Japan, far from Australia and from every state of India reaches the confluence of Ganges at Sagar Sangam situated in southern part of West Bengal in India.\r\nGangasagar or Sagar Island is an island in the Ganges delta, lying on the continental shelf of Bay of Bengal about 100 kms (54 nautical miles) south of Kolkata. The island is large with an area of 224.3 kms. Gangasagar is a charming tourist destination, which attracts both pilgrims and adventure lovers. Located on an island in the Sundarbans, Gangasagar offers the charms of an un-spoilt beach on the estuary of the river Ganges. Gangasagar offers acres of silver sand and clear blue sky, and the calm sea for visitors who would like to spend their weekend in tranquility.\r\nGangasagar has acres of dazzling silver sand and clear blue sky, Gangasagar is still relatively unknown and thus, unexploited. The island of Gangasagar is among the most popular Hindu pilgrimage places in the country. Each year on Makar Sankranti (mid-January), large number of devotees from all over the nation, congregate at Gangasagar for a sacred dip at the convergence of the river Ganga and the Bay of Bengal. After the sacred dip, the pilgrims offer Puja at the Kapil Muni Temple or Ashram. In several Hindu myths, the name Gangasagar is mentioned, Gangasagar also finds itself in the poetry of Rabindranath Tagore. The lighthouse at Gangasagar has great views of this beach and is perfect for watching the sunrise and sunset.','<p class=\"MsoNormal\">\"Sab tirath bar bar, Gangasagar ekbar\", may we visit\r\nother holy places several times - but a visit once to Gangasagar is worth a\r\nlife-time, keeping it in mind Hindus from all over the world, from Nepal,\r\nThailand, West Indies, Canada, Japan, far from Australia and from every state\r\nof India reaches the confluence of Ganges at Sagar Sangam situated in southern\r\npart of West Bengal in India.<o:p></o:p></p><p class=\"MsoNormal\">Gangasagar or Sagar Island is an island in the Ganges delta, lying\r\non the continental shelf of Bay of Bengal about 100 kms (54 nautical miles)\r\nsouth of Kolkata. The island is large with an area of 224.3 kms. Gangasagar is\r\na charming tourist destination, which attracts both pilgrims and adventure\r\nlovers. Located on an island in the Sundarbans, Gangasagar offers the charms of\r\nan un-spoilt beach on the estuary of the river Ganges. Gangasagar offers acres\r\nof silver sand and clear blue sky, and the calm sea for visitors who would like\r\nto spend their weekend in tranquility.<o:p></o:p></p><p>\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\">Gangasagar has acres of dazzling silver sand and clear blue sky,\r\nGangasagar is still relatively unknown and thus, unexploited. The island of\r\nGangasagar is among the most popular Hindu pilgrimage places in the country.\r\nEach year on Makar Sankranti (mid-January), large number of devotees from all\r\nover the nation, congregate at Gangasagar for a sacred dip at the convergence\r\nof the river Ganga and the Bay of Bengal. After the sacred dip, the pilgrims\r\noffer Puja at the Kapil Muni Temple or Ashram. In several Hindu myths, the name\r\nGangasagar is mentioned