se at Gangasagar has great views of this beach\r\nand is perfect for watching the sunrise and sunset.<o:p></o:p></p>',NULL,NULL,NULL,NULL,'chaudhary_yatra1680267980T32_-_second_option.jpg','chaudhary_yatra1680267980New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1680267980all_NIYAM___CYC.jpg','','4','','',NULL,NULL,'no','no','no','yes','2023-03-31 13:06:19'),(96,6,'133','South India, Tirupati, Rameshwaram, Gokarna.','','','','Tirupati (Balaji), Padmavati, Vellore-Sripuram, Shivakachi, Vishnukanchi, Mahabalipuram, Shrirangam, Rameshwaram, Kanyakumari, Suchindram, Madurai, Mysore, Vrindavan Garden, Gokarna, Kolhapur.',5,30981,'','','12','chaudhary_yatra1680536769T133.jpg','chaudhary_yatra1680536769133.pdf','Tirupati, the holy city is located in the southeastern part of Andhra Pradesh and Known for ‘Kaliyuga’ deity Lord Venkateswara. The general elevation of the mountainous part of the district is 2500 feet above sea level.  The Chennai & Bangalore cities are located in 150 Kms. and 250 Kms. respectively to Tirupati Town. \r\nRamoji Film City is a perfect place for all the Bollywood and cinema lovers. The place was set-up by Ramoji Rao in the year 1991. Since then, Ramoji Film City has been serving as a spectacular getaway for the locals of Hyderabad and tourists worldwide. Sprawling over an area stretch of around 2500 acres, this wonderland has been crowned as the World’s Largest Film Studio Complex under the Guinness Book of World Records. \r\nRameswaram\r\nAdi Shankaracharya propagated the idea of Hinduism through Advaita Vedanta and the town of Rameshwaram stands as a testimony of his faith. One of the four pilgrimage places, Char Dham of India, it modestly invites followers of Lord Shiva from everywhere to pay visit at least once in their lifetime to the Jyotirlinga installed in the Ramanathaswamy Temple. Vaishnavites are also not left in their devotion to come to this place which is believed to be associated with Lord Rama, incarnation of Lord Vishnu as well.\r\nLocated in Ramanathapuram district, the town is a part of Pamban Island also known as Rameshwaram Island being associated with the legendry temple built in marvelous Dravidian style of architecture. Situated at the very tip of the Indian peninsula, the island is connected with Indian mainland by Pamban Bridge on Pamban Channel in Gulf of Mannar.\r\nA visit to Varanasi in Uttar Pradesh is not considered complete in terms of pilgrimage if not coupled with a trip to Rameshwaram which is said to be the Varanasi of South. Welcome to the charm that devotees come to associated with an abode of God irrespective of the place it belong to.','<p class=\"MsoNormal\"><b><span style=\"font-size: 10.5pt; line-height: 107%; font-family: Arial, sans-serif; color: rgb(80, 80, 80); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Tirupati</span></b><span style=\"font-size: 10.5pt; line-height: 107%; font-family: Arial, sans-serif; color: rgb(80, 80, 80); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">, the holy city is located in the southeastern\r\npart of Andhra Pradesh and Known for ‘Kaliyuga’ deity Lord Venkateswara. The\r\ngeneral elevation of the mountainous part of the district is 2500 feet above\r\nsea level.&nbsp; The Chennai &amp; Bangalore\r\ncities are located in 150 Kms. and 250 Kms. respectively to Tirupati Town. <o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: Arial, sans-serif; color: rgb(80, 80, 80); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Ra