al, sans-serif; color: rgb(80, 80, 80); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Adi Shankaracharya propagated the idea of\r\nHinduism through Advaita Vedanta and the town of Rameshwaram stands as a\r\ntestimony of his faith. One of the four pilgrimage places, Char Dham of India,\r\nit modestly invites followers of Lord Shiva from everywhere to pay visit at least\r\nonce in their lifetime to the Jyotirlinga installed in the Ramanathaswamy\r\nTemple. Vaishnavites are also not left in their devotion to come to this place\r\nwhich is believed to be associated with Lord Rama, incarnation of Lord Vishnu\r\nas well.<o:p></o:p></span></p>',NULL,NULL,NULL,NULL,'chaudhary_yatra1680855106T136__second_option.jpg','chaudhary_yatra1680855106New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1680855106all_NIYAM___CYC.jpg','','4','','',NULL,NULL,'no','no','no','yes','2023-04-07 08:11:45'),(98,6,'137','Mysore, Dharmasthala, Gokarna, Kolhapur','','','','Mysore, Vrindavan Garden, Gokarna, Kolhapur.',5,10965,'','','06','chaudhary_yatra1680855960T137__second_option.jpg','chaudhary_yatra1680855960137.pdf','Mysore is one of the major cities of Karnataka and the impressive cultural heritage is the major draw for visitors from all over the world. The erstwhile princely state of Mysore was one of the largest in the British Era and till Indian Independence. The royal history of the land has left behind even better heritage. Among the must visit places in Mysore, the star highlight is the Maharaja Palace. One of the largest palaces in India, it used to be the residence of the Wodeyar Maharaja’s family. Renovated in 1912 the architectural wonder is a blend of Indo-Saracenic style, the mix of Islamic, Hindu, Gothic and Rajput style. Every Sunday, and during the Dussehra celebrations, the palace is lit and looks an impressive sight. Other palaces in the ‘City of Palaces’ are Jayalakshmi Vilas Mansion, Jaganmohan Palace and Lalitha Mahal Palace. Also, to complete a Mysore tour a visit to Tipu Sultan’s Summer Palace and Srirangpatna Fort must not be missed.','<p>Mysore is one of the major cities of Karnataka and the impressive cultural heritage is the major draw for visitors from all over the world. The erstwhile princely state of Mysore was one of the largest in the British Era and till Indian Independence. The royal history of the land has left behind even better heritage. Among the must visit places in Mysore, the star highlight is the Maharaja Palace. One of the largest palaces in India, it used to be the residence of the Wodeyar Maharaja’s family. Renovated in 1912 the architectural wonder is a blend of Indo-Saracenic style, the mix of Islamic, Hindu, Gothic and Rajput style. Every Sunday, and during the Dussehra celebrations, the palace is lit and looks an impressive sight. Other palaces in the ‘City of Palaces’ are Jayalakshmi Vilas Mansion, Jaganmohan Palace and Lalitha Mahal Palace. Also, to complete a Mysore tour a visit to Tipu Sultan’s Summer Palace and Srirangpatna Fort must not be missed.<br></p>',NULL,NULL,NULL,NULL,'chaudhary_yatra1680855960T137__second_option.jpg','chaudhary_yatra1680855960New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1680855960all_NIYAM___CYC.jpg','','4','','',NULL,NULL,'no','no','no','yes','2023-04-07 08:26:00'),(99,6,'138','Narmada Parikrama, Omkareshwar, Bedhaghat, Amarkantak','','','','Omkareshwar, Prakasha, Katpore, Bharuch, Ankleshwar, Shuklatirtha, Nareshwar, Garudeshwar, Maheshwar, Ujjain, Bedaghat, Nemawar, Amarkantak, Maharajpur, Hoshangabad, Omkareshwar.',5,16365,'','','15','chaudhary_yatra1680858409T138.jpg','chaudhary_yatra1680858409138.pdf','भारतात वेगवेगळ्या ठिकाणी वेगवेगळ्या परिक्रमांना खूप महत्व आहे. अयोध्या परिक्रमा, गिरनार परिक्रमा, कुरुक्षेत्र परिक्रमा, वृंदावन परिक्रमा, कैलास परिक्रमा.  आणि या सगळ्यात नर्मदा परिक्रमेला तर अनन्यसाधारण असं महत्व आहे.\r\n18 पुराणं madhun नदी म्हणून फक्त एकच ते म्हणजे नर्मदा पुराण.  शिवाय रामायण महाभारत आणि अशा अनेक पौराणिक ग्रंथांमधे सुद्धा नर्मदा नदीचं वर्णन केलं गेलंय. हिंदू धर्मात असं सांगितलं गेलय की या नदीच्या किनारी असलेल्या तीर्थक्षेत्रांना भेट दिल्यावर माणसाला पुण्य मिळतं.  नर्मदा ही अमरकंटक नावाच्या ठिकाणाहून मध्य भारतातल्या मैकाल टेकड्यांमध्ये उगम पावणारी पवित्र अशी नदी आहे आणि या नदीचं पावित्र्य इतकं आहे कि तिचा उल्लेख नर्मदा मैय्या असा केला जातो.  परिक्रमा हा संस्कृत शब्द आहे जो ‘परी’ म्हणजे आजूबाजूला आणि ‘क्रमा’ म्हणजे जाणं असा बनलाय… म्हणूनच नर्मदा परिक्रमा म्हणजे नदीची परिक्रमा. ही शतकानुशतकं अस्तित्वात असलेली हिंदूंची अध्यात्मिक आणि धार्मिक परंपरा आहे. ज्यात यात्रेकरू नर्मदा नदीचं पाणी कुपीत गोळा करून नदीकाठी कोणत्याही ठिकाणाहून आणि नदीच्या उजवीकडून चालायला सुरवात करतात. मंदिरात प्रदक्षिणा घालतो तशीच प्रदक्षिणा नदीला किंवा पर्वताला सुद्धा घालतात. या प्रदक्षिणेलाच परिक्रमा असंही म्हणतात. या नदी भोवती परिक्रमा करण्याची प्रथा भारतभरात प्रचलित आहे. जवळ जवळ एक ते दीड लाखांहून अधिक प्रवासी दरवर्षी या परिक्रमेत सहभागी होताना दिसतात.','<p>भारतात वेगवेगळ्या ठिकाणी वेगवेगळ्या परिक्रमांना खूप महत्व आहे. अयोध्या परिक्रमा, गिरनार परिक्रमा, कुरुक्षेत्र परिक्रमा, वृंदावन परिक्रमा, कैलास परिक्रमा.&nbsp; आणि या सगळ्यात नर्मदा परिक्रमेला तर अनन्यसाधारण असं महत्व आहे.</p><p>18 पुराणं madhun नदी म्हणून फक्त एकच ते म्हणजे नर्मदा पुराण.&nbsp; शिवाय रामायण महाभारत आणि अशा अनेक पौराणिक ग्रंथांमधे सुद्धा नर्मदा नदीचं वर्णन केलं गेलंय. हिंदू धर्मात असं सांगितलं गेलय की या नदीच्या किनारी असलेल्या तीर्थक्षेत्रांना भेट दिल्यावर माणसाला पुण्य मिळतं.&nbsp; नर्मदा ही अमरकंटक नावाच्या ठिकाणाहून मध्य भारतातल्या मैकाल टेकड्यांमध्ये उगम पावणारी पवित्र अशी नदी आहे आणि या नदीचं पावित्र्य इतकं आहे कि तिचा उल्लेख नर्मदा मैय्या असा केला जातो.&nbsp; परिक्रमा हा संस्कृत शब्द आहे जो ‘परी’ म्हणजे आजूबाजूला आणि ‘क्रमा’ म्हणजे जाणं असा बनलाय… म्हणूनच नर्मदा परिक्रमा म्हणजे नदीची परिक्रमा. ही शतकानुशतकं अस्तित्वात असलेली हिंदूंची अध्यात्मिक आणि धार्मिक परंपरा आहे. ज्यात यात्रेकरू नर्मदा नदीचं पाणी कुपीत गोळा करून नदीकाठी कोणत्याही ठिकाणाहून आणि नदीच्या उजवीकडून चालायला सुरवात करतात. मंदिरात प्रदक्षिणा घालतो तशीच प्रदक्षिणा नदीला किंवा पर्वताला सुद्धा घालतात. या प्रदक्षिणेलाच परिक्रमा असंही म्हणतात. या नदी भोवती परिक्रमा करण्याची प्रथा भारतभरात प्रचलित आहे. जवळ जवळ एक ते दीड लाखांहून अधिक प्रवासी दरवर्षी या परिक्रमेत सहभागी होताना दिसतात.</p><div><br></div>',NULL,NULL,NULL,NULL,'chaudhary_yatra1680858409T138__second_option.jpg','chaudhary_yatra1680858409New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1680858409all_NIYAM___CYC.jpg','','4','','',NULL,NULL,'no','no','no','yes','2023-04-07 09:06:49'),(100,6,'139','Kuberdham, Swami Narayan Temple.','','','','Kuber Dham, Swami Narayan Temple, Shani Panauti, Statue of Unity.',5,2531,'','','01','chaudhary_yatra1680859359T139.jpg','chaudhary_yatra1680859359139-140.pdf','अतिशय कमी किंवा नाहीच म्हणा ना! दिवाळीतील धनोत्रयोदशी आणि लक्ष्मीपूजनाला माता लक्ष्मीसमवेत ज्यांची पूजा करतात तो देव म्हणजे कुबेर होय! इतकी मर्यादीत माहिती ही आपल्यकडील सामान्य माणसाला असते. कुबेर म्हणजे धनाची देवता, कुबेर पैसाअडका देतो. हे जरा प्रगत ज्ञान नित्य उपासना करणाऱ्या मोजक्या लोकांना माहीत आहे. धनदेवता कुबेराची उपासना ही धनप्राप्तीसाठी केली जाते हे खास.\r\n\r\n“धनाशिवाय पर्याय नाही!”\r\nधनसंपदा असणे किंवा आर्थिक परिस्थिती उत्तम असणे ही आजच्या काळाची गरज आहे. वाढत्या गरजांबरोबर उत्पन्नही वाढले पाहिजे. बर वाढत्या गरजांची पूर्तता करत असताना आपल्याला कर्ज नको असते किंवा काढलेले कर्ज फेडून संसार व घर नीट चालवण्यासाठी तेवढेच वाढीव उत्पन्न हवे असते. आपल्याकडे खूप पैसा आला तरी खर्च करून त्यातील शिल्लक राहिली पाहिजे ही आपली माफक अपेक्षा असते. पैसा खूप येतोय तरी तो टीकत नाही आणि पैशाला आल्या-आल्या पन्नास पाय फुटतात. हे आपल्याला नको वाटते. या साऱ्या धनसमस्यांवर श्री कुबेर उपासना हा उत्तम पर्याय आहे.\r\nधनदाता म्हणजे धन देणारा कुबेर आपल्या सर्वांना हवाच. पण कशासाठी हवा? आपल्या नावे महालक्ष्मीमातेने अचल संपत्ती जरी लिहीली असली तरी ही संपत्ती सुरक्षित ठेवून त्याचे संवर्धन करण्याची महत्त्वाची जबाबदारी ही देव कुबेरावर आहे. त्यामुळे धनदेवता कुबेर हा आपल्याला हवाच हवा!','<p>अतिशय कमी किंवा नाहीच म्हणा ना! दिवाळीतील धनोत्रयोदशी आणि लक्ष्मीपूजनाला माता लक्ष्मीसमवेत ज्यांची पूजा करतात तो देव म्हणजे कुबेर होय! इतकी मर्यादीत माहिती ही आपल्यकडील सामान्य माणसाला असते. कुबेर म्हणजे धनाची देवता, कुबेर पैसाअडका देतो. हे जरा प्रगत ज्ञान नित्य उपासना करणाऱ्या मोजक्या लोकांना माहीत आहे. धनदेवता कुबेराची उपासना ही धनप्राप्तीसाठी केली जाते हे खास.</p><p><span style=\"font-size: 1rem;\">“धनाशिवाय पर्याय नाही!”</span><br></p><p>धनसंपदा असणे किंवा आर्थिक परिस्थिती उत्तम असणे ही आजच्या काळाची गरज आहे. वाढत्या गरजांबरोबर उत्पन्नही वाढले पाहिजे. बर वाढत्या गरजांची पूर्तता करत असताना आपल्याला कर्ज नको असते किंवा काढलेले कर्ज फेडून संसार व घर नीट चालवण्यासाठी तेवढेच वाढीव उत्पन्न हवे असते. आपल्याकडे खूप पैसा आला तरी खर्च करून त्यातील शिल्लक राहिली पाहिजे ही आपली माफक अपेक्षा असते. पैसा खूप येतोय तरी तो टीकत नाही आणि पैशाला आल्या-आल्या पन्नास पाय फुटतात. हे आपल्याला नको वाटते. या साऱ्या धनसमस्यांवर श्री कुबेर उपासना हा उत्तम पर्याय आहे.</p><p>धनदाता म्हणजे धन देणारा कुबेर आपल्या सर्वांना हवाच. पण कशासाठी हवा? आपल्या नावे महालक्ष्मीमातेने अचल संपत्ती जरी लिहीली असली तरी ही संपत्ती सुरक्षित ठेवून त्याचे संवर्धन करण्याची महत्त्वाची जबाबदारी ही देव कुबेरावर आहे. त्यामुळे धनदेवता कुबेर हा आपल्याला हवाच हवा!</p><div><br></div>',NULL,NULL,NULL,NULL,'chaudhary_yatra1680859359T138__second_option.jpg','chaudhary_yatra1680859359New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1680859359all_NIYAM___CYC.jpg','','4','','',NULL,NULL,'no','no','no','yes','2023-04-07 09:22:39'),(101,6,'146','Dehradun, Mussoorie, Mathura, Kashi, Ayodhya.','','','','Mathura, Vrindavan, Agra, Delhi, Haridwar, Mussoorie, Dehradun, Rishikesh, Ayodhya, Prayag-Allahabad, Gaya, Buddha Gaya, Kashi.',5,19011,'','','13','chaudhary_yatra1680882516T146.jpg','chaudhary_yatra1680882516146.pdf','Dehradun City is one of the oldest cities of India, bejeweled-like a glittering jewel in the lower Himalayan mountain ranges. The city is perched at an elevatio