chaudhary_yatra1680883664T148__second_option.jpg','chaudhary_yatra1680883664New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1680883664all_NIYAM___CYC.jpg','','4','','',NULL,NULL,'no','no','no','yes','2023-04-07 16:07:44'),(104,6,'149','Tristhali, Ayodhya, Haridwar, Patanjali, Mathura','','','','Naimisharanya, Ayodhya, Gaya, Buddha Gaya, Prayag-Allahabad,  Kashi, Haridwar, Rishikesh, Patanjali, Delhi, Mathura, Vrindavan, Agra.',5,20261,'','','12','chaudhary_yatra1680884592T149.jpg','chaudhary_yatra1680884592149.pdf','Ayodhya, the birthplace of Lord Rama and is believed to be one of the seven most sacred places in India. Situated on the banks of Saryu, some 135 km east of Lucknow, Ayodhya was called Saket in ancient times. Ayodhya finds mention in several legends and stories including the epic Ramayana. India’s biggest festival, Diwali, can be traced back to Ayodhya when the entire city glittered with clay lamps to welcome the victorious Rama who returned home after slaying Ravana.\r\nHaridwar, Rishikesh and Agra, Mathura and Vrindavan. This five cities has so many interesting places and things to do. Tourist can experience Mughal architecture, forts and art at Agra. Temples can be visited at Mathura and Vrindavan. Ashrams, Hindu culture and wild life can be experienced at Haridwar and Rajaji Nattional Park. Yoga, Meditation, Rafting, Camping and Bungee Jumping is enjoyed at Rishikesh. River Ganga and Yamuna is also major attraction at these cities.\r\nMathura is situated in Uttar Pradesh State of India. Mathura is 145 kms far from Delhi. Agra is just 58 kms far from Mathura. This area is also known as Brajbhoomi. According to legends Shri Krishna (Incarnation of God Vishnu) born here in ancient time. Later Lord Krishna spent his childhood in Gokul. Lord Krishna is one of the most popular God in India. So followers of lord Krishna visit this area. Mathura region includes places such as Vrindavan, Govardhan, Kusum Sarovar, Barsana, Gokul and Nandgaon. A long line of charming Ghats - with their steps leading to the water\'s edge, arched gateways and temple spires extending along the right bank of the River Yamuna, highlighting the sacred character of the town of Mathura. The birth place of Lord Krishna, \"the best famous, best loved and most complex of Lord Vishnu\'s appearances\" - Mathura is today an important place of pilgrimage. The city stretches along the right bank of the Yamuna and the nonstop line of Ghats along the river makes a splendid sight when viewed from the opposite bank.','<p class=\"MsoNormal\"><b>Ayodhya</b>, the birthplace of Lord Rama and is believed to be one of the seven most\r\nsacred places in India. Situated on the banks of Saryu, some 135 km east of\r\nLucknow, Ayodhya was called Saket in ancient times. Ayodhya finds mention in\r\nseveral legends and stories including the epic Ramayana. India’s biggest\r\nfestival, Diwali, can be traced back to Ayodhya when the entire city glittered\r\nwith clay lamps to welcome the victorious Rama who returned home after slaying\r\nRavana.<o:p></o:p></p><p class=\"MsoNormal\"><b>Haridwar</b>, Rishikesh and Agra, Mathura and Vrindavan. This five cities has so many\r\ninteresting places and things to do. Tourist can experience Mughal\r\narchitecture, forts and art at Agra. Temples can be visited at Mathura and\r\nVrindavan. Ashrams, Hindu culture and wild life can be experienced at Haridwar\r\nand Rajaji Nattional Park. Yoga, Meditation, Rafting, Camping and Bungee\r\nJumping is enjoyed at Rishikesh. River Ganga and Yamuna is also major\r\nattraction at these cities.<o:p></o:p></p><p>\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><b>Mathura</b> is situated in Uttar Pradesh State of India. Mathura is 145 kms far from\r\nDelhi. Agra is just 58 kms far from Mathura. This area is also known as\r\nBrajbhoomi. According to legends Shri Krishna (Incarnation of God Vishnu) born\r\nhere in ancient time. Later Lord Krishna spent his childhood in Gokul. Lord\r\nKrishna is one of the most popular God in India. So followers of lord Krishna\r\nvisit this area. Mathura region includes places such as Vrindavan, Govardhan,\r\nKusum Sarovar, Barsana, Gokul and Nandgaon. A long line of charming Ghats -\r\nwith their steps leading to the water\'s edge, arched gateways and temple spires\r\nextending along the right bank of the River Yamuna, highlighting the sacred\r\ncharacter of the town of Mathura. The birth place of Lord Krishna, \"the\r\nbest famous, best loved and most complex of Lord Vishnu\'s appearances\" -\r\nMathura is today an important place of pilgrimage. The city stretches along the\r\nright bank of the Yamuna and the nonstop line of Ghats along the river makes a\r\nsplendid sight when viewed from the opposite bank.<o:p></o:p></p>',NULL,NULL,NULL,NULL,'chaudhary_yatra1680884592T149__second_option.jpg','chaudhary_yatra1680884592New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1680884592all_NIYAM___CYC.jpg','','4','','',NULL,NULL,'no','no','no','yes','2023-04-07 16:23:12'),(105,6,'150','Tristhali, Ayodhya','','','','Naimisharanya, Ayodhya, Gaya, Buddha Gaya, Prayag-Allahabad,  Kashi.',5,12981,'','','07','chaudhary_yatra1680885065T150.jpg','chaudhary_yatra1680885065150.pdf','Ayodhya, the birthplace of Lord Rama and is believed to be one of the seven most sacred places in India. Situated on the banks of Saryu, some 135 km east of Lucknow, Ayodhya was called Saket in ancient times. Ayodhya finds mention in several legends and stories including the epic Ramayana. India’s biggest festival, Diwali, can be traced back to Ayodhya when the entire city glittered with clay lamps to welcome the victorious Rama who returned home after slaying Ravana.','<p class=\"MsoNormal\"><b>Ayodhya</b>, the birthplace of Lord Rama and is believed to be one of the seven most\r\nsacred places in India. Situated on the banks of Saryu, some 135 km east of\r\nLucknow, Ayodhya was called Saket in ancient times. Ayodhya finds mention in\r\nseveral legends and stories including the epic Ramayana. India’s biggest\r\nfestival, Diwali, can be traced back to Ayodhya when the entire city glittered\r\nwith clay lamps to welcome the victorious Rama who returned home after slaying\r\nRavana.<o:p></o:p></p>',NULL,NULL,NULL,NULL,'chaudhary_yatra1680885065T150__second_option.jpg','chaudhary_yatra1680885065New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1680885065all_NIYAM___CYC.jpg','','4','','',NULL,NULL,'no','no','no','yes','2023-04-07 16:31:05'),(106,6,'151','Delhi, Haridwar, Mathura, Agra','','','','Haridwar, Rishikesh, Delhi, Mathura, Vrindavan, Agra.',5,15555,'','','08','chaudhary_yatra1680885558T151.jpg','chaudhary_yatra1680885558151.pdf','Haridwar, Rishikesh and Agra, Mathura and Vrindavan. This five cities has so many interesting places and things to do. Tourist can experience Mughal architecture, forts and art at Agra. Temples can be visited at Mathura and Vrindavan. Ashrams, Hindu culture and wild life can be experienced at Haridwar and Rajaji Nattional Park. Yoga, Meditation, Rafting, Camping and Bungee Jumping is enjoyed at Rishikesh. River Ganga and Yamuna is also major attraction at these cities.\r\nRishikesh is a small city to be found in the northern state of Uttarkhand in India and enjoys global fame as the worldwide capital of yoga and meditation. Positioned on the banks of River Ganges, Rishikesh is also the gateway to the Himalayas and offers massive natural beauty and majesty. This really spiritual town does boats a large number of temples that are placed against the beautiful backdrop of the Shivalik Range of the Himalayas. There is a well-liked legend linked with the name of the town that states that when Rishi Raibhya did penance, God appeared before him in the name of Rishikesh and hence it got its name. While on one hand Rishikesh is a perfect destination for those looking to delve into their spiritual side amid the peaceful surroundings.','<p class=\"MsoNormal\"><b>Haridwar</b>, Rishikesh and Agra, Mathura and Vrindavan. This five cities has so many\r\ninteresting places and things to do. Tourist can experience Mughal\r\narchitecture, forts and art at Agra. Temples can be visited at Mathura and\r\nVrindavan. Ashrams, Hindu culture and wild life can be experienced at Haridwar\r\nand Rajaji Nattional Park. Yoga, Meditation, Rafting, Camping and Bungee\r\nJumping is enjoyed at Rishikesh. River Ganga and Yamuna is also major\r\nattraction at these cities.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\"><b>Rishikesh</b> is a small city to be found in the northern state of Uttarkhand in India\r\nand enjoys global fame as the worldwide capital of yoga and meditation.\r\nPositioned on the banks of River Ganges, Rishikesh is also the gateway to the\r\nHimalayas and offers massive natural beauty and majesty. This really spiritual\r\ntown does boats a large number of temples that are placed against the beautiful\r\nbackdrop of the Shivalik Range of the Himalayas. There is a well-liked legend\r\nlinked with the name of the town that states that when Rishi Raibhya did\r\npenance, God appeared before him in the name of Rishikesh and hence it got its\r\nname. While on one hand Rishikesh is a perfect destination for those looking to\r\ndelve into their spiritual side amid the peaceful surroundings.<o:p></o:p></p>',NULL,'',NULL,NULL,'chaudhary_yatra1680885558T151__second_option.jpg','chaudhary_yatra1680885558New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1680885558all_NIYAM___CYC.jpg','','4','2','3','0000-00-00','0000-00-00','no','no','no','yes','2023-04-07 16:39:18'),(107,20,'152','Maharashtra Darshan, Pandharpur, Gangapur, Kolhapur, Mahurgarh','1','','1','Shirdi, Shanishinganapur, Paithan, Verul-Ghrishneshwar, Bhadramaruti, Shegaon, Anandsagar, Mahurgad, Andhanagnath, Parli Vaijnath, Ambajogai, Tuljapur, Akkalkot, Gangapur, Pandharpur, Nrisimhwadi, Jyotiba, Kolhapur, Jejuri',5,10695,'','','08','chaudhary_yatra1680886428T152.jpg','chaudhary_yatra1680886428152.pdf','शनी शिंगणापूर: शनिदेव स्वयंभू पाषाण रूपात विराजमान आहेत. येथे श्रीशनैश्वराचे स्वयंभू जाज्वल्य देवस्थान असून शनैश्वराची मूर्ती ५ फूट ९ इंच उंचीची आहे. या मंदिरात असलेला दगडी स्तंभास शनिदेवाची मूर्ती मानली जाते. सुमारे दीडशे वर्षांपूर्वी एका पुरात ही शिळा वाहत सोनई गावाजवळ आली. या स्तंभाला तसा वेगळा आकार नाही. शनि – ज्योतिषशास्त्राचे भयानक ग्रहांपैकी एक आहे. पण त्यांची मंदिरे फार दुर्मिळ आहेत. आणि येथे एक विशेष स्थान मानले जाते. मूर्ती केवळ एक शिळा आहे. अहमदनगर जिल्ह्यातील शीर्डी जवळवसलेल्या एक प्रमुख आणि जागृत क्षेत्र म्हणून शनि शिंगणापूर हे संपूर्ण महाराष्ट्रात परिचित आहे. शनी मंदिरामुळे गावाच्या नावात शनी जोडले गेले.\r\n\r\nपंढरपूर: हे महाराष्ट्र राज्यातील सोलापूर शहराच्या पश्चिम बाजूला भीमा नदीच्या काठावर वसलेले एक तीर्थक्षेत्र आहे. अवघ्या महाराष्ट्राचे आराध्य दैवत दीनदुबळ्यांचा कैवारी सगळ्यांची विठू माऊली म्हणजे पांडुरंग यांच्या वास्तव्याचे ठिकाण पुरानापासून या पंढरपुराला काहीक नावाने ओळखले जाते जसे पांढरीपूर उंदरीतपूर पंढरीचे आणि संतांच्या काव्यात पंढरी संतांनी याचे तुलना तर थेट वैकुंठाशी केले आहे. जगद्गुरु तुकोबाराय म्हणतात तुका म्हणे हे पेठ भूमिवरी हे वैकुंठ तर संत बहिणाबाईंच्या शब्दात पंढरीसारखे नाही. क्षेत्र कोठे जरी ते वैकुंठे दाखविले.पंढरपुरात पोहोचल्यावर ओढ लागते ते चंद्रभागेची. भीमाशंकर पासून उगम पावणारी भीमा आपल्यासोबत माऊलींची इंद्रायणी त्याचबरोबर भामा आणि नेरेला सोबत घेऊन पंढरपुराला चंद्रकृती वळसा घालते येथे चंद्रभागा हे नाव धारण करते या चंद्रभागेचे महत्त्व सांगताना तुकोबाराय म्हणतात अवघीच तीर्थे घडले एक वेळा चंद्रभागा डोळा देख लिया चंद्रभागेच्या वाळवंटात भाविकांची लगबग दिसून येते काहींना तीर्थस्थान करायचं असतं तर काही चंद्रभागेला दिवार पण करतात मस्तकी टिळा लावून आणि हार फुलांची खरेदी करून आपण निघतो भक्त पुंडलिकाच्या दर्शनाला चंद्रभागेच्या पात्रात भक्त पुंडलिकाचे मंदिर आहे.\r\nकोल्हापूर: शहर भारताच्या महाराष्ट्र राज्याच्या दक्षिणेकडील भागात पंचगंगा नदीच्या काठावर वसलेले आहे. हे कोल्हापूरचे प्रशासकीय केंद्र जिल्हा म्हणून काम करते. अंबाबाई म्हणून ओळखल्या जाणार्‍या महालक्ष्मीच्या प्राचीन मंदिरामुळे आणि त्याच्या आध्यात्मिक भूतकाळामुळे, कोल्हापूरला “दक्षिण काशी” किंवा दक्षिण काशी असे संबोधले जाते.\r\nकोल्हापुरी चप्पल, सुप्रसिद्ध हाताने बनवलेल्या आणि वेणीच्या चामड्याच्या चप्पलची जोडी, परिसरात तयार केली जाते आणि त्याला २०१९ मध्ये भौगोलिक संकेत लेबल देण्यात आले होते. हिंदू पौराणिक कथांमध्ये कोल्हापूरला “करवीर” असे संबोधले जाते.','<p class=\"MsoNormal\"><b><span lang=\"HI\" style=\"font-family:\"Mangal\",serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">शनी शिंगणापूर</span></b><b>: </b><span lang=\"HI\" style=\"font-family:\"Mangal\",serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-language:HI\">शनिदेव स्वयंभू पाषाण रूपात विराजमान आहेत.\r\nयेथे श्रीशनैश्वराचे स्वयंभू जाज्वल्य देवस्थान असून शनैश्वराची मूर्ती ५ फूट ९\r\nइंच उंचीची आहे. या मंदिरात असलेला दगडी स्तंभास शनिदेवाची मूर्ती मानली जाते.\r\nसुमारे दीडशे वर्षांपूर्वी एका पुरात ही शिळा वाहत सोनई गावाजवळ आली. या स्तंभाला\r\nतसा वेगळा आकार नाही. शनि – ज्योतिषशास्त्राचे भयानक ग्रहांपैकी एक आहे. पण\r\nत्यांची मंदिरे फार दुर्मिळ आहेत. आणि येथे एक विशेष स्थान मानले जाते. मूर्ती\r\nकेवळ एक शिळा आहे. अहमदनगर जिल्ह्यातील शीर्डी जवळवसलेल्या एक प्रमुख आणि जागृत\r\nक्षेत्र म्हणून शनि शिंगणापूर हे संपूर्ण महाराष्ट्रात परिचित आहे. शनी मंदिरामुळे\r\nगावाच्या नावात शनी जोडले गेले.</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p> </o:p></p><p class=\"MsoNormal\"><b><span lang=\"HI\" style=\"font-family:\"Mangal\",serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">पंढरपूर</span></b><b>: </b><span lang=\"HI\" style=\"font-family:\"Mangal\",serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-language:HI\">हे महाराष्ट्र राज्यातील सोलापूर शहराच्या\r\nपश्चिम बाजूला भीमा नदीच्या काठावर वसलेले एक तीर्थक्षेत्र आहे. अवघ्या\r\nमहाराष्ट्राचे आराध्य दैवत दीनदुबळ्यांचा कैवारी सगळ्यांची विठू माऊली म्हणजे\r\nपांडुरंग यांच्या वास्तव्याचे ठिकाण पुरानापासून या पंढरपुराला काहीक नावाने ओळखले\r\nजाते जसे पांढरीपूर उंदरीतपूर पंढरीचे आणि संतांच्या काव्यात पंढरी संतांनी याचे\r\nतुलना तर थेट वैकुंठाशी केले आहे. जगद्गुरु तुकोबाराय म्हणतात तुका म्हणे हे पेठ\r\nभूमिवरी हे वैकुंठ तर संत बहिणाबाईंच्या शब्दात पंढरीसारखे नाही. क्षेत्र कोठे जरी\r\nते वैकुंठे दाखविले</span>.<span lang=\"HI\" style=\"font-family:\"Mangal\",serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">पंढरपुरात पोहोचल्यावर ओढ\r\nलागते ते चंद्रभागेची</span>. <span lang=\"HI\" style=\"font-family:\"Mangal\",serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">भीमाशंकर पासून उगम\r\nपावणारी भीमा आपल्यासोबत माऊलींची इंद्रायणी त्याचबरोबर भामा आणि नेरेला सोबत घेऊन\r\nपंढरपुराला चंद्रकृती वळसा घालते येथे चंद्रभागा हे नाव धारण करते या चंद्रभागेचे\r\nमहत्त्व सांगताना तुकोबाराय म्हणतात अवघीच तीर्थे घडले एक वेळा चंद्रभागा डोळा देख\r\nलिया चंद्रभागेच्या वाळवंटात भाविकांची लगबग दिसून येते काहींना तीर्थस्थान करायचं\r\nअसतं तर काही चंद्रभागेला दिवार पण करतात मस्तकी टिळा लावून आणि हार फुलांची खरेदी\r\nकरून आपण निघतो भक्त पुंडलिकाच्या दर्शनाला चंद्रभागेच्या पात्रात भक्त पुंडलिकाचे\r\nमंदिर आहे.</span><o:p></o:p></p><p class=\"MsoNormal\"><b><span lang=\"HI\" style=\"font-family:\"Mangal\",serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">कोल्हापूर:</span></b><span lang=\"HI\" style=\"font-family:\"Mangal\",serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-language:HI\"> शहर भारताच्या महाराष्ट्र राज्याच्या\r\nदक्षिणेकडील भागात पंचगंगा नदीच्या काठावर वसलेले आहे. हे कोल्हापूरचे प्रशासकीय\r\nकेंद्र जिल्हा म्हणून काम करते. अंबाबाई म्हणून ओळखल्या जाणार्‍या महालक्ष्मीच्या\r\nप्राचीन मंदिरामुळे आणि त्याच्या आध्यात्मिक भूतकाळामुळे</span>, <span lang=\"HI\" style=\"font-family:\r\n\"Mangal\",serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nmso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:\r\nHI\">कोल्हापूरला “दक्षिण काशी” किंवा दक्षिण काशी असे संबोधले जाते.</span><o:p></o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span lang=\"HI\" style=\"font-family:\"Mangal\",serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">कोल्हापुरी चप्पल</span>, <span lang=\"HI\" style=\"font-family:\r\n\"Mangal\",serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nmso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:\r\nHI\">सुप्रसिद्ध हाताने बनवलेल्या आणि वेणीच्या चामड्याच्या चप्पलची जोडी</span>, <span lang=\"HI\" style=\"font-family:\r\n\"Mangal\",serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nmso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:\r\nHI\">परिसरात तयार केली जाते आणि त्याला २०१९ मध्ये भौगोलिक संकेत लेबल देण्यात आले\r\nहोते. हिंदू पौराणिक कथांमध्ये कोल्हापूरला “करवीर” असे संबोधले जाते.</span><o:p></o:p></p>',NULL,NULL,NULL,NULL,'chaudhary_yatra1680886428T152__second_option.jpg','chaudhary_yatra1680886428New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1680886428all_NIYAM___CYC.jpg','','4','2','4','0000-00-00','0000-00-00','no','no','no','yes','2023-04-07 16:53:48'),(108,6,'152A','Sadeteen Shaktipith, Akkalkot, Pandharpur','','','','Shirdi, Anandsagar, Mahurgad, Andhanagnath, Parli Vaijnath, Ambajogai, Tuljapur, Akkalkot, Gangapur, Pandharpur, Nrisimhwadi, Jyotiba, Kolhapur, Jejuri, Vani (Saptshrungidevi).',5,11711,'','','06','chaudhary_yatra1680887340T152A.jpg','chaudhary_yatra1680887340152.pdf','नवरात्रोत्सव आला की, राज्यातील देवीच्या साडेतीन पीठांकडे भाविकांचे पावले वळायला लागतात. राज्यातील कोल्हापूर, तुळजापूर, माहूर आणि नाशिक या ठिकाणी देवीची साडेतीन पीठं आहेत.  या सर्वच तिर्थक्षेत्रांना मोठा मान असून त्यांच्याबद्दलच्या अनेक आख्यायिकाही आहेत. ही सर्वच स्थळे जागृत मानली जातात. त्यामुळे भाविक मनोभावाने या स्थळांना नेहमीच भेटी देतात. मात्र, नवरात्रोत्सवात इथे जास्त गर्दी बघायला मिळते. या साडेतीन पीठांचं महत्व आणि त्यांच्याबद्द्लच्या आख्यायिका काय आहेत याची माहिती आम्ही तुमच्यासाठी घेऊन आलो आहोत.\r\nमहालक्ष्मी मंदिर – कोल्हापूर\r\nकोल्हापूरचे महालक्ष्मी मंदिर (अंबाबाईचे देऊळ) हे पुराणात उल्लेखलेल्या १०८ पीठांपैकी एक, व महाराष्ट्रात असलेल्या देवीची साडेतीन पीठांपैकी एक आहे. कोल्हापूरची अंबाबाई खर्‍या अर्थाने अखिल महाराष्ट्राची कुलस्वामिनी ठरते. महालक्ष्मी ही विष्णूची भार्या व म्हणून समोर गरुडमंडपात विष्णुवाहन गरूडाची स्थापना केली आहे. तर मूर्तीच्या जवळील सिंह व शिरावरील शिवलिंगामुळे देवी अनेकांच्या मते पार्वतीचे रूप आहे. देवीची मूर्ती दगडी असून तिचे वजन ४० किलोग्रॅम आहे. मूर्तीमागे दगडी सिंह आहे. डोक्यावर मुकुट आहे आणि त्यावर शेषनाग आहे.\r\nतुळजाभवानी-तुळजापूर\r\nभारतातील शक्तिदेवताच्या पीठापैकी साडे तीन पीठे महाराष्ट्रात आहे. त्यातील श्री क्षेत्र तुळजापूर हे पूर्ण व आद्यपीठ मानले जाते, तुळजापूर हे महत्वाचे तीर्थक्षेत्र असून त्याठिकाणी तुळजाभवानी देवीचे प्राचीन मंदिर आहे. स्वराज्य स्थापना करणारे छत्रपती श्री शिवाजी महाराज, भोसले घराण्याची ही कुलदेवता आहे. तुळजाभवानी देवीच्या आशीर्वादाने शिवाजी महाराजांना स्वराज्य स्थापनेची प्रेरणा मिळाली होती. देवीने महाराजांना दृष्टांत देऊन महाराष्ट्रावरील दुष्टचक्राचे निवारण करण्यासाठी भवानी तलवार दिली होती, अशी आख्यायिका आहे. देवीचे मंदिर बालाघाटातील एका डोंगरमाथ्यावर असल्याने अगदी जवळ गेल्यावर देखील या मंदिराचा कळस दिसत नाही. मंदिराच्या काही भागाची बांधणी हेमाडपंती आहे. महाराष्ट्रात या देवीस विशेष महत्त्व असून नवरात्रीचा उत्सव जरी नऊ दिवसांचा असला तरी तुळजापूरला मात्र, हा उत्सव एकूण एकवीस दिवस चालतो.\r\nरेणुकादेवी – माहूर\r\nमाहूर हे देवीच्या साडेतीन पीठांपैकी एक असून येथील पीठाची देवता रेणुकादेवी आहे. रेणुकादेवी तसेच दत्तात्रेय आणि परशुराम यांचीदेखील प्राचीन मंदिरे माहूरगडावर आहेत.येथे मंदिरासमोरच एक किल्ला आहे. देवीच्या साडेतीन शक्तिपीठांपैकी एक मूळ जागृत पीठ म्हणजे, माहूरची श्री रेणुकामाता होय. श्री परशुरामाची माता म्हणूनही रेणुकामातेला ओळखले जाते. महाराष्ट्रातील अनेक परिवारांची ही कुलदेवता आहे.देवीचे मंदिर १३ व्या शतकात देवगिरीच्या यादवकालीन राजाने बांधले आहे असे म्हटले जाते. माहूरगडावरच श्री दत्तात्रयांचा जन्म झाला अशी भाविकांची श्रद्धा आहे.\r\nसप्तशृंगीदेवी – नाशिक\r\nमहाराष्ट्रात देवीच्या साडेतीन पीठांपैकी अर्धे पीठ असलेली सप्तशृंगीदेवी  सप्तशृंगगडावर वसलेली आहे. सह्याद्रीच्या पर्वतरांगेवरील सात शिखरांचा प्रदेश म्हणजे सप्तशृंगगड. एकीकडे खोल दरी, तर दुसरीकडे छाती दडपविणारे कडे आणि यात फुललेली नाजूक हिरवाई, असा निसर्ग घेऊन येथे उभी ठाकलेली देवी जणू या निसर्गाच्या रौद्र रूपाशीच नाते सांगणारी आहे, असे वाटते.\r\nआदिमायेच्या या गडावर वस्ती करण्याची आख्यायिकाही तिच्या या रूपातूनच जन्माला आली आहे. मातलेल्या महिषासुर राक्षसाच्या निर्दालनासाठी देवादिकांनी देवीची याचना केली अन्‌ होमाद्वारे ती प्रकटही झाली. तिचे प्रकट रूप हेच सप्तशृंगीचे होते, असे सांगितले जाते. या देवीचे महात्म्य मोठे आहे. देवी भागवतात देवीची देशात १०८ शक्तिपीठे असल्याचा उल्लेख आहे. त्यांपैकी महाराष्ट्रात साडेतीन पीठे आहेत. त्यांपैकी सप्तशृंगीचे अर्धे पीठ आहे. याव्यतिरिक्त अर्धे पीठ असल्याचा कोणताही उल्लेख त्यात सापडत नाही. या देवीला श्री ब्रह्मस्वरूपिणी असेही म्हणतात.ब्रह्मदेवाच्या कमंडलूपासून निघालेल्या गिरिजा महानदीचे रूप म्हणजे सप्तशृंगीदेवी. महाकाली, महालक्ष्मी व महासरस्वतीचे त्रिगुणात्मक स्वरूप म्हणजे सप्तशृंगीदेवी, असे मानले जाते. नाशिकच्या तपोवनात राम, सीता व लक्ष्मण वनवासासाठी आले असता, येथे येऊन गेल्याचीही आख्यायिका आहे.','<p class=\"MsoNormal\"><span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">नवरात्रोत्सव आला की</span>, <span lang=\"HI\" style=\"font-family:\r\n&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nmso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:\r\nHI\">राज्यातील देवीच्या साडेतीन पीठांकडे भाविकांचे पावले वळायला लागतात.\r\nराज्यातील कोल्हापूर</span>, <span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-language:HI\">तुळजापूर</span>, <span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">माहूर आणि नाशिक या\r\nठिकाणी देवीची साडेतीन पीठं आहेत.&nbsp; या\r\nसर्वच तिर्थक्षेत्रांना मोठा मान असून त्यांच्याबद्दलच्या अनेक आख्यायिकाही आहेत.\r\nही सर्वच स्थळे जागृत मानली जातात. त्यामुळे भाविक मनोभावाने या स्थळांना नेहमीच\r\nभेटी देतात. मात्र</span>, <span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-language:HI\">नवरात्रोत्सवात इथे जास्त गर्दी बघायला मिळते.\r\nया साडेतीन पीठांचं महत्व आणि त्यांच्याबद्द्लच्या आख्यायिका काय आहेत याची माहिती\r\nआम्ही तुमच्यासाठी घेऊन आलो आहोत.</span><o:p></o:p></p><p class=\"MsoNormal\"><b><span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">महालक्ष्मी मंदिर\r\n– कोल्हापूर</span></b><b><o:p></o:p></b></p><p class=\"MsoNormal\"><span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">कोल्हापूरचे महालक्ष्मी\r\nमंदिर (अंबाबाईचे देऊळ) हे पुराणात उल्लेखलेल्या १०८ पीठांपैकी एक</span>, <span lang=\"HI\" style=\"font-family:\r\n&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nmso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:\r\nHI\">व महाराष्ट्रात असलेल्या देवीची साडेतीन पीठांपैकी एक आहे. कोल्हापूरची\r\nअंबाबाई खर्‍या अर्थाने अखिल महाराष्ट्राची कुलस्वामिनी ठरते.</span><span lang=\"HI\"> </span><span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-language:HI\">महालक्ष्मी ही विष्णूची भार्या व म्हणून समोर\r\nगरुडमंडपात विष्णुवाहन गरूडाची स्थापना केली आहे. तर मूर्तीच्या जवळील सिंह व\r\nशिरावरील शिवलिंगामुळे देवी अनेकांच्या मते पार्वतीचे रूप आहे. देवीची मूर्ती दगडी\r\nअसून तिचे वजन ४० किलोग्रॅम आहे. मूर्तीमागे दगडी सिंह आहे. डोक्यावर मुकुट आहे\r\nआणि त्यावर शेषनाग आहे.</span><o:p></o:p></p><p class=\"MsoNormal\"><b><span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">तुळजाभवानी-तुळजापूर</span></b><b><o:p></o:p></b></p><p class=\"MsoNormal\"><span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">भारतातील शक्तिदेवताच्या\r\nपीठापैकी साडे तीन पीठे महाराष्ट्रात आहे. त्यातील श्री क्षेत्र तुळजापूर हे पूर्ण\r\nव आद्यपीठ मानले जाते</span>,<span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\"> तुळजापूर हे महत्वाचे\r\nतीर्थक्षेत्र असून त्याठिकाणी तुळजाभवानी देवीचे प्राचीन मंदिर आहे. स्वराज्य\r\nस्थापना करणारे छत्रपती श्री शिवाजी महाराज</span>, <span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">भोसले घराण्याची ही\r\nकुलदेवता आहे. तुळजाभवानी देवीच्या आशीर्वादाने शिवाजी महाराजांना स्वराज्य\r\nस्थापनेची प्रेरणा मिळाली होती. देवीने महाराजांना दृष्टांत देऊन महाराष्ट्रावरील\r\nदुष्टचक्राचे निवारण करण्यासाठी भवानी तलवार दिली होती</span>, <span lang=\"HI\" style=\"font-family:\r\n&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nmso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:\r\nHI\">अशी आख्यायिका आहे. देवीचे मंदिर बालाघाटातील एका डोंगरमाथ्यावर असल्याने अगदी\r\nजवळ गेल्यावर देखील या मंदिराचा कळस दिसत नाही. मंदिराच्या काही भागाची बांधणी\r\nहेमाडपंती आहे. महाराष्ट्रात या देवीस विशेष महत्त्व असून नवरात्रीचा उत्सव जरी नऊ\r\nदिवसांचा असला तरी तुळजापूरला मात्र</span>, <span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">हा उत्सव एकूण एकवीस दिवस\r\nचालतो.</span><o:p></o:p></p><p class=\"MsoNormal\"><b><span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">रेणुकादेवी –\r\nमाहूर</span></b><b><o:p></o:p></b></p><p class=\"MsoNormal\"><span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">माहूर हे देवीच्या\r\nसाडेतीन पीठांपैकी एक असून येथील पीठाची देवता रेणुकादेवी आहे. रेणुकादेवी तसेच\r\nदत्तात्रेय आणि परशुराम यांचीदेखील प्राचीन मंदिरे माहूरगडावर आहेत.येथे\r\nमंदिरासमोरच एक किल्ला आहे. देवीच्या साडेतीन शक्तिपीठांपैकी एक मूळ जागृत पीठ\r\nम्हणजे</span>, <span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-language:HI\">माहूरची श्री रेणुकामाता होय. श्री परशुरामाची माता\r\nम्हणूनही रेणुकामातेला ओळखले जाते. महाराष्ट्रातील अनेक परिवारांची ही कुलदेवता\r\nआहे.देवीचे मंदिर १३ व्या शतकात देवगिरीच्या यादवकालीन राजाने बांधले आहे असे\r\nम्हटले जाते. माहूरगडावरच श्री दत्तात्रयांचा जन्म झाला अशी भाविकांची श्रद्धा\r\nआहे.</span><o:p></o:p></p><p class=\"MsoNormal\"><b><span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">सप्तशृंगीदेवी –\r\nनाशिक</span></b><b><o:p></o:p></b></p><p class=\"MsoNormal\"><span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">महाराष्ट्रात देवीच्या\r\nसाडेतीन पीठांपैकी अर्धे पीठ असलेली सप्तशृंगीदेवी </span><span lang=\"HI\">&nbsp;</span><span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">सप्तशृंगगडावर\r\nवसलेली आहे. सह्याद्रीच्या पर्वतरांगेवरील सात शिखरांचा प्रदेश म्हणजे सप्तशृंगगड.\r\nएकीकडे खोल दरी</span>, <span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-language:HI\">तर दुसरीकडे छाती दडपविणारे कडे आणि यात\r\nफुललेली नाजूक हिरवाई</span>, <span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-language:HI\">असा निसर्ग घेऊन येथे उभी ठाकलेली देवी जणू या\r\nनिसर्गाच्या रौद्र रूपाशीच नाते सांगणारी आहे</span>, <span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">असे वाटते.</span><o:p></o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">आदिमायेच्या या गडावर\r\nवस्ती करण्याची आख्यायिकाही तिच्या या रूपातूनच जन्माला आली आहे. मातलेल्या महिषासुर\r\nराक्षसाच्या निर्दालनासाठी देवादिकांनी देवीची याचना केली अन्‌ होमाद्वारे ती\r\nप्रकटही झाली. तिचे प्रकट रूप हेच सप्तशृंगीचे होते</span>, <span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">असे सांगितले जाते. या\r\nदेवीचे महात्म्य मोठे आहे. देवी भागवतात देवीची देशात १०८ शक्तिपीठे असल्याचा\r\nउल्लेख आहे. त्यांपैकी महाराष्ट्रात साडेतीन पीठे आहेत. त्यांपैकी सप्तशृंगीचे\r\nअर्धे पीठ आहे. याव्यतिरिक्त अर्धे पीठ असल्याचा कोणताही उल्लेख त्यात सापडत नाही.\r\nया देवीला श्री ब्रह्मस्वरूपिणी असेही म्हणतात.ब्रह्मदेवाच्या कमंडलूपासून\r\nनिघालेल्या गिरिजा महानदीचे रूप म्हणजे सप्तशृंगीदेवी. महाकाली</span>, <span lang=\"HI\" style=\"font-family:\r\n&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nmso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:\r\nHI\">महालक्ष्मी व महासरस्वतीचे त्रिगुणात्मक स्वरूप म्हणजे सप्तशृंगीदेवी</span>, <span lang=\"HI\" style=\"font-family:\r\n&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nmso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:\r\nHI\">असे मानले जाते. नाशिकच्या तपोवनात राम</span>, <span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">सीता व लक्ष्मण\r\nवनवासासाठी आले असता</span>, <span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-language:HI\">येथे येऊन गेल्याचीही आख्यायिका आहे.</span><o:p></o:p></p>',NULL,NULL,NULL,NULL,'chaudhary_yatra1680887340T152A__second_option.jpg','chaudhary_yatra1680887340New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1680887340all_NIYAM___CYC.jpg','','4','','',NULL,NULL,'no','no','no','yes','2023-04-07 17:09:00'),(109,6,'153','Shirdi, Shanishingnapur, Paithan, Verul, Shegaon','','','','Shirdi, Shanishinganapur, Paithan, Verul-Ghrishneshwar, Bhadramaruti, Shegaon.',5,7455,'','','05','chaudhary_yatra1680891335T153.jpg','chaudhary_yatra1680891335153.pdf','संपूर्ण राज्यात साईबाबांचे मंदिर आहे, परंतु शिर्डीतील साईबाबांचे मंदिर सर्व मंदिरांपेक्षा वेगळे आहे, कारण साई बाबा शिर्डीच्या साईबाबांचे मंदिर होण्यापूर्वी या छोट्या गावात राहत होते. शिर्डीचे साई बाबा सामान्य माणसाप्रमाणेच वास्तव्यास असतात, परंतु ते वापरणारे कपडे पाहून लोक त्यांना फकीर असेही म्हणतात. साई बाबा एक महान अध्यात्मिक गुरु होते आणि त्यांच्याकडे बरीच अद्भुत शक्ती होती. पण ते चमत्कारी शक्ती कधीच दाखवत नाहीत. असे मानले जाते की शिर्डीचे साई बाबा हा भगवंताचा अवतार आहे. महाराष्ट्रातील अहमदनगर जिल्ह्यातील शिर्डी शहरात साईबाबांचे प्रसिद्ध आणि पवित्र मंदिर आहे. मुंबईपासून ३०० किमी अंतरावर साईबाबांचे हे मंदिर आहे. साई बाबा शिर्डीचे आध्यात्मिक गुरू होते तसेच हिंदू आणि मुस्लिम हे त्यांचे सर्व भक्त होते.','<p class=\"MsoNormal\"><strong><span lang=\"HI\" style=\"font-family:\"Mangal\",serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-bidi;\r\ncolor:#2F5597;mso-themecolor:accent5;mso-themeshade:191;mso-style-textfill-fill-color:\r\n#2F5597;mso-style-textfill-fill-themecolor:accent5;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=75000;mso-bidi-language:\r\nHI\">संपूर्ण राज्यात साईबाबांचे मंदिर आहे</span></strong><strong><span style=\"font-family:\"Calibri\",sans-serif;mso-ascii-theme-font:minor-latin;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-font-family:Mangal;mso-bidi-theme-font:\r\nminor-bidi;color:#2F5597;mso-themecolor:accent5;mso-themeshade:191;mso-style-textfill-fill-color:\r\n#2F5597;mso-style-textfill-fill-themecolor:accent5;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=75000\">, </span></strong><strong><span lang=\"HI\" style=\"font-family:\"Mangal\",serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-theme-font:minor-bidi;color:#2F5597;mso-themecolor:accent5;\r\nmso-themeshade:191;mso-style-textfill-fill-color:#2F5597;mso-style-textfill-fill-themecolor:\r\naccent5;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\nlumm=75000;mso-bidi-language:HI\">परंतु शिर्डीतील साईबाबांचे मंदिर सर्व\r\nमंदिरांपेक्षा वेगळे आहे</span></strong><strong><span style=\"font-family:\"Calibri\",sans-serif;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:\r\nMangal;mso-bidi-theme-font:minor-bidi;color:#2F5597;mso-themecolor:accent5;\r\nmso-themeshade:191;mso-style-textfill-fill-color:#2F5597;mso-style-textfill-fill-themeco