n;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-font-family:Mangal;mso-bidi-theme-font:\r\nminor-bidi;color:#2F5597;mso-themecolor:accent5;mso-themeshade:191;mso-style-textfill-fill-color:\r\n#2F5597;mso-style-textfill-fill-themecolor:accent5;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=75000\"> </span></strong><strong><span lang=\"HI\" style=\"font-family:\"Mangal\",serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-theme-font:minor-bidi;color:#2F5597;mso-themecolor:accent5;\r\nmso-themeshade:191;mso-style-textfill-fill-color:#2F5597;mso-style-textfill-fill-themecolor:\r\naccent5;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\nlumm=75000;mso-bidi-language:HI\">महाराष्ट्रातील अहमदनगर जिल्ह्यातील शिर्डी\r\nशहरात साईबाबांचे प्रसिद्ध आणि पवित्र मंदिर आहे. मुंबईपासून ३०० किमी अंतरावर\r\nसाईबाबांचे हे मंदिर आहे. साई बाबा शिर्डीचे आध्यात्मिक गुरू होते तसेच हिंदू आणि\r\nमुस्लिम हे त्यांचे सर्व भक्त होते.</span></strong><strong><span style=\"font-family:\"Calibri\",sans-serif;mso-ascii-theme-font:minor-latin;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-font-family:Mangal;mso-bidi-theme-font:\r\nminor-bidi;color:#2F5597;mso-themecolor:accent5;mso-themeshade:191;mso-style-textfill-fill-color:\r\n#2F5597;mso-style-textfill-fill-themecolor:accent5;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=75000\"><o:p></o:p></span></strong></p>',NULL,'',NULL,NULL,'chaudhary_yatra1680891335T153__second_option.jpg','chaudhary_yatra1680891335New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1680891335all_NIYAM___CYC.jpg','','4','','',NULL,NULL,'no','no','no','yes','2023-04-07 18:15:35'),(110,6,'154','Tuljapur, Gangapur, Pandharpur, Kolhapur, Jejuri.','','','','Tuljapur, Akkalkot, Gangapur, Pandharpur, Nrisimhwadi , Jyotiba, Kolhapur, Jejuri. (The journey from the departure office to Tuljapur in the Yatra will normally be by ST vehicle.)',5,8111,'','','05','chaudhary_yatra1680892092T154.jpg','chaudhary_yatra1680892092154.pdf','तुळजापूर- भारतातील शक्तिदेवताच्या पीठापैकी साडे तीन पीठे महाराष्ट्रात आहे. त्यातील श्री क्षेत्र तुळजापूर हे पूर्ण व आद्यपीठ मानले जाते, तुळजापूर हे महत्वाचे तीर्थक्षेत्र असून त्याठिकाणी तुळजाभवानी देवीचे प्राचीन मंदिर आहे. स्वराज्य स्थापना करणारे छत्रपती श्री शिवाजी महाराज, भोसले घराण्याची ही कुलदेवता आहे. तुळजाभवानी देवीच्या आशीर्वादाने शिवाजी महाराजांना स्वराज्य स्थापनेची प्रेरणा मिळाली होती. देवीने महाराजांना दृष्टांत देऊन महाराष्ट्रावरील दुष्टचक्राचे निवारण करण्यासाठी भवानी तलवार दिली होती, अशी आख्यायिका आहे. देवीचे मंदिर बालाघाटातील एका डोंगरमाथ्यावर असल्याने अगदी जवळ गेल्यावर देखील या मंदिराचा कळस दिसत नाही. मंदिराच्या काही भागाची बांधणी हेमाडपंती आहे. महाराष्ट्रात या देवीस विशेष महत्त्व असून नवरात्रीचा उत्सव जरी नऊ दिवसांचा असला तरी तुळजापूरला मात्र, हा उत्सव एकूण एकवीस दिवस चालतो.\r\nपंढरपूर हे महाराष्ट्रातील एक प्रसिद्ध तीर्थक्षेत्र आहे. हे गाव सोलापूर जिल्ह्यात भीमा नदीच्या काठावर आहे. विठ्ठल रुक्मिणी मंदिर, भगवान श्रीकृष्ण आणि त्यांची पत्नी रुक्मिणी यांना समर्पित मंदिर याच गावात आहे. या मंदिरात भगवान श्रीकृष्ण आणि देवी रुक्मिणी यांच्या काळ्या रंगाच्या सुंदर मूर्ती आहेत. उपासकांसाठी हे मंदिर आजही अखंड श्रद्धास्थान आहे. या मंदिरात विठोबाच्या वेशात श्रीकृष्णाची पूजा केली जाते.\r\nकोल्हापूर - कोल्हापूरचे महालक्ष्मी मंदिर (अंबाबाईचे देऊळ) हे पुराणात उल्लेखलेल्या १०८ पीठांपैकी एक, व महाराष्ट्रात असलेल्या देवीची साडेतीन पीठांपैकी एक आहे. कोल्हापूरची अंबाबाई खर्‍या अर्थाने अखिल महाराष्ट्राची कुलस्वामिनी ठरते. महालक्ष्मी ही विष्णूची भार्या व म्हणून समोर गरुडमंडपात विष्णुवाहन गरूडाची स्थापना केली आहे. तर मूर्तीच्या जवळील सिंह व शिरावरील शिवलिंगामुळे देवी अनेकांच्या मते पार्वतीचे रूप आहे. देवीची मूर्ती दगडी असून तिचे वजन ४० किलोग्रॅम आहे. मूर्तीमागे दगडी सिंह आहे. डोक्यावर मुकुट आहे आणि त्यावर शेषनाग आहे.','<p class=\"MsoNormal\"><b><span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">तुळजापूर</span></b><b>- </b><span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-language:HI\">भारतातील शक्तिदेवताच्या पीठापैकी साडे तीन\r\nपीठे महाराष्ट्रात आहे. त्यातील श्री क्षेत्र तुळजापूर हे पूर्ण व आद्यपीठ मानले\r\nजाते</span>,<span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-language:HI\"> तुळजापूर हे महत्वाचे तीर्थक्षेत्र असून\r\nत्याठिकाणी तुळजाभवानी देवीचे प्राचीन मंदिर आहे. स्वराज्य स्थापना करणारे छत्रपती\r\nश्री शिवाजी महाराज</span>, <span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-language:HI\">भोसले घराण्याची ही कुलदेवता आहे. तुळजाभवानी\r\nदेवीच्या आशीर्वादाने शिवाजी महाराजांना स्वराज्य स्थापनेची प्रेरणा मिळाली होती.\r\nदेवीने महाराजांना दृष्टांत देऊन महाराष्ट्रावरील दुष्टचक्राचे निवारण करण्यासाठी\r\nभवानी तलवार दिली होती</span>, <span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-language:HI\">अशी आख्यायिका आहे. देवीचे मंदिर बालाघाटातील\r\nएका डोंगरमाथ्यावर असल्याने अगदी जवळ गेल्यावर देखील या मंदिराचा कळस दिसत नाही.\r\nमंदिराच्या काही भागाची बांधणी हेमाडपंती आहे. महाराष्ट्रात या देवीस विशेष\r\nमहत्त्व असून नवरात्रीचा उत्सव जरी नऊ दिवसांचा असला तरी तुळजापूरला मात्र</span>, <span lang=\"HI\" style=\"font-family:\r\n&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nms