-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">व महाराष्ट्रात असलेल्या\r\nदेवीची साडेतीन पीठांपैकी एक आहे. कोल्हापूरची अंबाबाई खर्‍या अर्थाने अखिल\r\nमहाराष्ट्राची कुलस्वामिनी ठरते.</span><span lang=\"HI\"> </span><span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-language:HI\">महालक्ष्मी ही\r\nविष्णूची भार्या व म्हणून समोर गरुडमंडपात विष्णुवाहन गरूडाची स्थापना केली आहे.\r\nतर मूर्तीच्या जवळील सिंह व शिरावरील शिवलिंगामुळे देवी अनेकांच्या मते पार्वतीचे\r\nरूप आहे. देवीची मूर्ती दगडी असून तिचे वजन ४० किलोग्रॅम आहे. मूर्तीमागे दगडी\r\nसिंह आहे. डोक्यावर मुकुट आहे आणि त्यावर शेषनाग आहे.</span><o:p></o:p></p>',NULL,NULL,NULL,NULL,'chaudhary_yatra1680892092T154_second_option.jpg','chaudhary_yatra1680892092New_Inclusion_Image_eightyone_onefivesix.jpg','chaudhary_yatra1680892092all_NIYAM___CYC.jpg','','4','','',NULL,NULL,'no','no','no','yes','2023-04-07 18:28:12'),(111,6,'155','All India Chardham Yatra from Train','','','','Okha (Betdwarka), Dwarka, Nageshwar, Gopitlav, Rukmini Temple, Muldwarka, Haridwar, Kedarnath, Badrinath, Rishikesh, Mana Border, Calcutta, Gangasagar, Bhubaneswar, Konark, Sakshigopal, Jagannathpuri, Madurai, Rameswaram, Kanyakumari.',5,61211,'','','22','chaudhary_yatra1680893884T155.jpg','chaudhary_yatra1680893884155.pdf','आदि गुरु शंकराचार्य द्वारा परिभाषित चार वैष्णव तीर्थ हैं। जहाँ हर हिंदू को अपने जीवन काल मे अवश्य जाना चाहिए, जो हिंदुओं को मोक्ष प्राप्त करने में मदद करेंगे। इसमें उत्तर दिशा मे बद्रीनाथ, पश्चिम की ओर द्वारका, पूर्व दिशा मे जगन्नाथ पुरी और दक्षिण मे रामेश्वरम धाम है। हिंदू पुराणों में हरि यानी विष्णु और हर या शिव को शाश्वत मित्र कहा जाता है। ऐसा माना गया है कि जहाँ भगवान विष्णु का निवास करते हैं वहीं भगवान शिव भी पास में रहते हैं। ये चार धाम भी इसके अपवाद नहीं माने गये हैं। अतः केदारनाथ को बद्रीनाथ की जोड़ी, रंगनाथ स्वामी को रामेश्वरम की, सोमनाथ को द्वारका, लिंगराज को पुरी की जोड़ी के रूप में माना जाता है।','<p class=\"MsoNormal\"><strong><span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;color:#2F5597;mso-themecolor:accent5;\r\nmso-themeshade:191;mso-style-textfill-fill-color:#2F5597;mso-style-textfill-fill-themecolor:\r\naccent5;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\nlumm=75000;mso-bidi-language:HI\">आदि गुरु शंकराचार्य द्वारा परिभाषित चार वैष्णव\r\nतीर्थ हैं। जहाँ हर हिंदू को अपने जीवन काल मे अवश्य जाना चाहिए</span></strong><strong><span style=\"font-family:&quot;Calibri&quot;,sans-serif;mso-ascii-theme-font:minor-latin;\r\nmso-hansi-theme-font:minor-latin;mso-bidi-font-family:Mangal;mso-bidi-theme-font:\r\nminor-bidi;color:#2F5597;mso-themecolor:accent5;mso-themeshade:191;mso-style-textfill-fill-color:\r\n#2F5597;mso-style-textfill-fill-themecolor:accent5;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=75000\">, </span></strong><strong><span lang=\"HI\" style=\"font-family:&quot;Mangal&quot;,serif;mso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:\r\nminor-latin;color:#2F5597;mso-themecolor:accent5;mso-themeshade:191;mso-style-textfill-fill-color:\r\n#2F5597;mso-style-textfill-fill-themecolor:accent5;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=75000;mso-bidi-language:\r\nHI\">जो हिंदुओं को मोक्ष प्राप्त करने में मदद करेंगे। इसमें उत्तर दिशा मे\r\nबद्रीनाथ</span></strong><strong><span style=\"font-family:&quot;Calibri&quot;,sans-serif;\r\nmso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:\r\nMangal;mso-bidi-theme-font:minor-bidi;color:#2F5597;mso-themecolor:accent5;\r\nmso-themeshade:191;mso-style-tex