 East.','<span style=\"font-size: 15.3333px;\">These states like Assam, Meghalaya, Arunachal Pradesh, Manipur, Mizoram, Nagaland and Tripura popular as “Seven Sisters”.  Only 20 km narrow corridor of land, which is called “Chicken’s Neck or Siliguri Corridor”, connected with India among over 2000 km of border with Bhutan, China, Myanmar and Bangladesh. The new inclusion in North East is Sikkim. North east is one of the most ethically and a linguistically diverse regions in Asia. Each state has its distinct cultures and traditions. The people there belong to the Mangaloid tribe and have either retained their tribal identity or have merged with the Hindu mainstream. Majority of Khasi, Mizo, and Naga sects of these tribal people converted to Christianity, but retain their tribal characteristics. Each state is a traveler’s paradise, with picturesque hills and green meadows which shelters thousand of species of flora and fauna. In addition, the states provide scope for angling, boating, rafting, trekking and hiking. Besides, there are a number of wild life sanctuaries and national parks where rare animals, birds and plants which will surely provide fascinating insight to the visitors. The region is known for its unique culture, handicrafts, martial arts, and scenic beauty. Problems include insurgency, unemployment, drug addiction, and lack of infrastructure. Since the beginning of the economic liberalization in the 1990s, studies have shown that this region is lagging behind the others in terms of development.</span>',NULL,'chaudhary_yatra1698758936inclusion.jpg',NULL,NULL,'chaudhary_yatra1698743766asam_img2.jpg','chaudhary_yatra1698743766inclusion_asam.jpg','chaudhary_yatra1698758552term_n_conditn_asam.jpg','','4','1','5','0000-00-00','0000-00-00','no','no','no','yes','2023-10-31 09:16:05'),(136,6,'FIT2','Charismatic Assam and Meghalaya','3','','','Shillong, Kaziranga,  Guwahati',4,0,'','','7','chaudhary_yatra1698907476FIT2_img1.jpg','chaudhary_yatra1698907476FIT_2_-_Ch