elhi, Agra, Mathura, Vrindavan, Fatehpur Sikri, Ghana World Century. (April to September Close Ghana World Century.) No Seat Nomber.',4,19461,'','','06','chaudhary_yatra1675776450T14.jpg','chaudhary_yatra167577645014.pdf','Situated on the banks of the Yamuna River, Mathura is a sacred town for the Hindus that has found mention in historical and mythological anecdotes. Mathura city is mentioned in the oldest epic, the Ramayana. It was first known as Madhuvan because of the thick and dense forests that were once there.','<p class=\"MsoNormal\"><b><span style=\"font-family: Arial, sans-serif; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Situated on the banks of the Yamuna River, Mathura is a\r\nsacred town for the Hindus that has found mention in historical and\r\nmythological anecdotes</span></b><span style=\"font-family: Arial, sans-serif; color: rgb(32, 33, 36); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">. Mathura city is mentioned in the oldest epic,\r\nthe Ramayana. It was first known as Madhuvan because of the thick and dense\r\nforests that were once there.</span><o:p></o:p></p>',NULL,'','','','chaudhary_yatra1675776450T14_-_second_option_h_605_&_w_1920..jpg','chaudhary_yatra1675776450Inclusion_Image.jpg','chaudhary_yatra1675776450all_NIYAM___CYC.jpg','','4','1','','','no','yes','2023-02-07 07:57:30'),(19,6,'15','Vaishnodevi, Delhi, Agra, Shivkhodi, Patnitop','Mathura, Vrindavan, Agra, Delhi, Kurukshetra, Amritsar, Wagah Border, Katra (Vaishnodevi), Shivkhodi, Patnitop.',4,25301,'','','11','chaudhary_yatra1675778147T15.jpg','chaudhary_yatra167577814715.pdf','The temple of Goddess Vaishno Devi is one of the major and sacred Hindu temples dedicated to Parvati or Goddess Shakti, the Divine Consort of Lord Shiva. This beautiful temple lies ensconced among the picturesque hills of Vaishno Devi, in the state of Jammu and Kashmir in India. Hindus venerate Vaishno Devi, also commonly referred to as Mata Rani and Vaishnavi, is the very  manifestation of the Mother Goddess Shakti.','<p><span style=\"color: rgb(128, 128, 128); font-family: \"Trebuchet MS\", Verdana, Arial, Helvetica, sans-serif; font-size: 14px;\">The Vaishno Devi Manir is located close to the town of Katra, in the Reasi district. It is one of the most revered places of worship in India. The shrine is situated at an altitude of 5300 feet above sea level and lies at a distance of approximately 12 kilometres from Katra.</span><br style=\"color: rgb(128, 128, 128); font-family: \"Trebuchet MS\", Verdana, Arial, Helvetica, sans-serif; font-size: 14px;\"><br style=\"color: rgb(128, 128, 128); font-family: \"Trebuchet MS\", Verdana, Arial, Helvetica, sans-serif; font-size: 14px;\"><span style=\"color: rgb(128, 128, 128); font-family: \"Trebuchet MS\", Verdana, Arial, Helvetica, sans-serif; font-size: 14px;\">It has been recorded that close to 8 million yatris (pilgrims) visit the temple every year, from each and every part of the world. It is believed to be the second most visited religious shrine in India, coming after the Tirumala Venkateswara Temple.</span><br style=\"color: rgb(128, 128, 128); font-family: \"Trebuchet MS\", Verdana, Arial, Helvetica, sans-serif; font-size: 14px;\"><br style=\"color: rgb(128, 128, 128); font-family: \"Trebuchet MS\", Verdana, Arial, Helvetica, sans-serif; font-size: 14px;\"><span style=\"color: rgb(128, 128, 128); font-family: \"Trebuchet MS\", Verdana, Arial, Helvetica, sans-serif; font-size: 14px;\">The temple premises are maintained by the Sri Mata Vaishno Devi Shrine Board.</span><br></p>',NULL,'','','','chaudhary_yatra1675778147T15_-_second_option_h_605_&_w_1920..jpg','chaudhary_yatra1675778147Inclusion_Image.jpg','chaudhary_yatra1675778147all_NIYAM___CYC.jpg','','4','2','','','no','yes','2023-02-07 08:25:46'),(20,6,'17','Vaishno Devi, Delhi, Agra, Kurukshetra, Wagahwarder','Mathura, Vrindavan, Agra, Delhi, Kurukshetra, Amritsar, Wagah Border, Katra-Vaishnodevi.',5,22421,'','','09','chaudhary_yatra1675936166T17.jpg','chaudhary_yatra167593616617.pdf','The temple of Goddess Vaishno Devi is one of the major and sacred Hindu temples dedicated to Parvati or Goddess Shakti, the Divine Consort of Lord Shiva. This beautiful temple lies ensconced among the picturesque hills of Vaishno Devi, in the state of Jammu and Kashmir in India. Hindus venerate Vaishno Devi, also commonly referred to as Mata Rani and Vaishnavi, is the very  manifestation of the Mother Goddess Shakti.','<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; color: gray; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">The temple of </span><a href=\"https://www.dollsofindia.com/sculptures/brass/goddess/\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; color: rgb(255, 96, 0); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Goddess</span></a><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; color: gray; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> Vaishno Devi is one of the major and sacred </span><a href=\"https://www.dollsofindia.com/paintings/miniature/hindu/\"><span style=\"font-size: 10.5pt; line-heig