here and in winter everything is covered with\r\nsnow. The red apples hanging on the apples look very beautiful. There are many\r\ntourist places to see in Kashmir like Gulmarg, Sonmarg etc. Gulmarg is called\r\nthe life of Kashmir.<o:p></o:p></p>',NULL,'','','','chaudhary_yatra1675956424T21A_-_second_option_h_605_&_w_1920..jpg','chaudhary_yatra1675956424Inclusion_Image.jpg','chaudhary_yatra1675956424all_NIYAM___CYC.jpg','','4','1','','','no','yes','2023-02-09 09:57:03'),(26,6,'23','Kullu-Manali, Dalhousie, Khajjiar, Shimla','Amritsar, Wagah Border, Dalhousie (Khajjiar) Dharamsala (MacLodganj) Chamundadevi, Kangdadevi, Brajeshwaridevi, Chintapurnadevi, Jalumakidevi, Kulu, Manali, Solang Valley, Rohtangpass, Kufri, Simla, Pinjorgarden, Chandigarh.',4,33375,'','','13','chaudhary_yatra1675957346T23.jpg','chaudhary_yatra167595734623.pdf','A trip to Kullu Manali is the medicine for fatigued minds and tired souls. Nature has blessed them generously, and yet, one is different from the kind of experiences they offer. Kullu is called the “land of the gods”, and quite aptly so. Stretched out leisurely on the banks of the River Beas, it is blessed with a magnificent scenery characterized by forests, valleys, streams, rivers and orchards. Mystical Malana to serene Manikaran, it lures tourists for many reasons. The town of Manali is seated comfortably in the River Beas Valley, and its popularity has increased faster than the clouds that dance on its hilltops. Wonderfully combining nature and adventure, it is serenity, history, nature, spirituality and shopping, all merged into one. Holidays in Kullu Manali then, is about sightseeing, but it is also about adventure, spirituality & being prepared to be constantly surprised.','<p>A trip to Kullu Manali is the medicine for fatigued minds and tired souls. Nature has blessed them generously, and yet, one is different from the kind of experiences they offer. Kullu is called the “land of the gods”, and quite aptly so. Stretched out leis