audhary_yatra167619388526.pdf','Tirupati, the holy city is located in the southeastern part of Andhra Pradesh and Known for ‘Kaliyuga’ deity Lord Venkateswara. The general elevation of the mountainous part of the district is 2500 feet above sea level.  The Chennai & Bangalore cities are located in 150 Kms. and 250 Kms. respectively to Tirupati Town.\r\n\r\nRamoji Film City is a perfect place for all the Bollywood and cinema lovers. The place was set-up by Ramoji Rao in the year 1991. Since then, Ramoji Film City has been serving as a spectacular getaway for the locals of Hyderabad and tourists worldwide. Sprawling over an area stretch of around 2500 acres, this wonderland has been crowned as the World’s Largest Film Studio Complex under the Guinness Book of World Records.\r\n\r\nRameswaram\r\n\r\nAdi Shankaracharya propagated the idea of Hinduism through Advaita Vedanta and the town of Rameshwaram stands as a testimony of his faith. One of the four pilgrimage places, Char Dham of India, it modestly invites followers of Lord Shiva from everywhere to pay visit at least once in their lifetime to the Jyotirlinga installed in the Ramanathaswamy Temple. Vaishnavites are also not left in their devotion to come to this place which is believed to be associated with Lord Rama, incarnation of Lord Vishnu as well.\r\n\r\nLocated in Ramanathapuram district, the town is a part of Pamban Island also known as Rameshwaram Island being associated with the legendry temple built in marvelous Dravidian style of architecture. Situated at the very tip of the Indian peninsula, the island is connected with Indian mainland by Pamban Bridge on Pamban Channel in Gulf of Mannar.\r\n\r\nA visit to Varanasi in Uttar Pradesh is not considered complete in terms of pilgrimage if not coupled with a trip to Rameshwaram which is said to be the Varanasi of South. Welcome to the charm that devotees come to associated with an abode of God irrespective of the place it belong to.','<p class=\"MsoNormal\"><s