e of the major and sacred Hindu temples dedicated to Parvati or Goddess Shakti, the Divine Consort of Lord Shiva. This beautiful temple lies ensconced among the picturesque hills of Vaishno Devi, in the state of Jammu and Kashmir in India. Hindus venerate Vaishno Devi, also commonly referred to as Mata Rani and Vaishnavi, is the very  manifestation of the Mother Goddess Shakti.','<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">The temple of </span><a href=\"https://www.dollsofindia.com/sculptures/brass/goddess/\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Goddess</span></a><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> Vaishno Devi\r\nis one of the major and sacred </span><a href=\"https://www.dollsofindia.com/paintings/miniature/hindu/\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Hindu</span></a><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> temples\r\ndedicated to </span><a href=\"https://www.dollsofindia.com/read/parvati.htm\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Parvati</span></a><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> or\r\nGoddess </span><a href=\"https://www.dollsofindia.com/read/shakti.htm\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Shakti</span></a><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">, the Divine\r\nConsort of Lord </span><a href=\"https://www.dollsofindia.com/read/shiva-paintings.htm\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Shiva</span></a><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">. This beautiful\r\ntemple lies ensconced among the picturesque hills of Vaishno Devi, in the state\r\nof Jammu and Kashmir in India. Hindus venerate Vaishno Devi, also commonly\r\nreferred to as Mata Rani and Vaishnavi, is the very  manifestation of\r\nthe </span><a href=\"https://www.dollsofindia.com/read/mother-child.htm\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Mother</span></a><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \"Trebuchet MS\", sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> Goddess\r\nShakti.<o:p></o:p></span></p>',NULL,'','','','chaudhary_yatra1676463671T30A_-_second_option_h_605_&_w_1920..jpg','chaudhary_yatra1676463671Inclusion_Image.jpg','chaudhary_yatra1676463671all_NIYAM___CYC.jpg','','4','2','','','no','yes','2023-02-15 06:51:11'),(36,6,'30B','Vellore, Pondechary, Tanjavaram, Madurai','Vellore (Sripuram mahalakshmi Golden Temple), Shivkanchi, Vishnukanchi, Mahabalipuram, Pondechary, Kumbhkonam, Tejavaram, Madurai.',4,13061,'','','08','chaudhary_yatra1676464347T30B.jpg','chaudhary_yatra167646434730.pdf','Vellore has a blend of heritage and culture reflecting the ancient Dravidian civilization. It was the seat of the Pallavas, Cholas, Nayak, Marathas, Arcot Nawabs and Bijapur Sultan Kingdoms. Vellore was once the capital city of the Vijayanagar empire during 1606-1672. The fort in Vellore was described as the best and strongest fortress during the Carnatic War in the 17th Century. The monuments found in the district give a vivid picture of the evolution of the city through the ages.\r\n\r\nIn the centuries before India\'s independence there were many changes in kingdoms of the south and their capitals. The north and south regions of Arcot came into the political map in 1810 at the time of the last Mughal Emperor. Later in 1908, the two districts, namely North and South Arcot, came into existence. Chittoor (now in Andhra Pradesh) was the first capital of the North Arcot district. From then on it was the principal military base of the British. In 1911, Vellore became the head quarters of North Arcot Dt., comprising Vellore and Thiruvannamalai.','<p style=\"margin-right: 0px; margin-bottom: 2px; margin-left: 0px; line-height: 20px; font-size: 14px; color: rgb(51, 51, 51); font-family: Roboto, sans-serif;\">Vellore has a blend of heritage and culture reflecting the ancient Dravidian civilization. It was the seat of the Pallavas, Cholas, Nayak, Marathas, Arcot Nawabs and Bijapur Sultan Kingdoms. Vellore was once the capital city of the Vijayanagar empire during 1606-1672. The fort in Vellore was described as the best and strongest fortress during the Carnatic War in the 17th Century. The monuments found in the district give a vivid picture of the evolution of the city through the ages.</p><p style=\"margin-right: 0px; margin-bottom: 2px; margin-left: 0px; line-height: 20px; font-size: 14px; color: rgb(51, 51, 51); font-family: Roboto, sans-serif;\">In the centuries before India\'s independence there were many changes in kingdoms of the south and their capitals. The north and south regions of Arcot came into the political map in 1810 at the time of the last Mughal Emperor. Later in 1908, the two districts, namely North and South Arcot, came into existence. Chittoor (now in Andhra Pradesh) was the first capital of the North Arcot district. From then on it was the principal military base of the British. In 1911, Vellore became the head quarters of North Arcot Dt., comprising Vellore and Thiruvannamalai.</p>',NULL,'','','','chaudhary_yatra1676464347T30B_-_second_option_h_605_&_w_1920..jpg','chaudhary_yatra1676464347Inclusion_Image.jpg','chaudhary_yatra1676464347all_NIYAM___CYC.jpg','','4','2','','','no','yes','2023-02-15 07:02:27'),(37,6,'31','South India, Tirupati, Kanyakumari','Madurai, Rameshwaram, Kanyakumari Suchindram, Uty, Mysore Bangalore, Tirupati.',5,25185,'','','10','chaudhary_yatra1676558358T31.jpg','chaudhary_yatra167655835831.pdf','Tirupati, the holy city is located in the southeastern part of Andhra Pradesh and Known for ‘Kaliyuga’ deity Lord Venkateswara. The general elevation of the mountainous part of the district is 2500 feet above sea level.  The Chennai & Bangalore cities are located in 150 Kms. and 250 Kms. respectively to Tirupati Town.','<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: Arial, sans-serif; color: rgb(80, 80, 80); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Tirupati, the holy city is\r\nlocated in the southeastern part of Andhra Pradesh and Known for ‘Kaliyuga’\r\ndeity Lord Venkateswara. The general elevation of the mountainous part of the\r\ndistrict is 2500 feet above sea level. \r\nThe Chennai & Bangalore cities are located in 150 Kms. and 250 Kms.\r\nrespectively to Tirupati Town. <o:p></o:p></span></p>',NULL,'','','','chaudhary_yatra1676558359T31_-_second_option_h_605_&_w_1920..jpg','chaudhary_yatra1676558359Inclusion_Image.jpg','chaudhary_yatra1676558359all_NIYAM___CYC.jpg','','4','2','','','no','yes','2023-02-16 09:09:18'),(38,6,'32','Rameshwaram, Kanyakumari, Uty.','Madurai, Rameshwaram, Kanyakumari, Suchindram, Uty, Mysore, Bangalore.',5,21765,'','','09','chaudhary_yatra1676560393T32.jpg','chaudhary_yatra167655966332.pdf','The Rameshwaram Temple which is the main reason the town is known to every other person following Hinduism, Lord Shiva and Lord Vishnu is said to be built by Sethupathis of Sethukavalan - custodian of the legendary bridge built by Lord Rama when he crossed the sea to reach Lanka (now Sri Lanka) the place in the control of Demon King Ravana, also a Brahman.\r\nRameshwaram is believed to be the place from where Lord Rama started his journey to get his wife Sita back from Ravana and the Lord was helped by \'Vaanar-Sena\' army of legendary monkey-humans and served by Hanuman, Lord Ram\'s paramount devotee. Also, many later versions of Ramayana testify of installing a ShivaLingam by Shri Ram and Devi Sita to worship Lord Shiva as a part of penance for Brahmahatya - killing of Brahmana, Ravana who was himself a well-known staunch follower of Lord Shiva. The Rameshwaram Temple, built in 12th century is believed to have the same Shiva Lingam.\r\nThe bridge to Lanka named \'Rama Set u\', also known as Adam\'s Bridge is of religious as well as ecological importance. Some 30 Km long, it was supposed to be passable on foot till 15th century after which a storm deepened the channel.','<p class=\"MsoNormal\">The Rameshwaram Temple which is the main reason the town is known\r\nto every other person following Hinduism, Lord Shiva and Lord Vishnu is said to\r\nbe built by Sethupathis of Sethukavalan - custodian of the legendary bridge\r\nbuilt by Lord Rama when he crossed the sea to reach Lanka (now Sri Lanka) the\r\nplace in the control of Demon King Ravana, also a Brahman.<o:p></o:p></p><p class=\"MsoNormal\">Rameshwaram is believed to be the place from where Lord Rama\r\nstarted his journey to get his wife Sita back from Ravana and the Lord was\r\nhelped by \'Vaanar-Sena\' army of legendary monkey-humans and served by Hanuman,\r\nLord Ram\'s paramount devotee. Also, many later versions of Ramayana testify of\r\ninstalling a ShivaLingam by Shri Ram and Devi Sita to worship Lord Shiva as a\r\npart of penance for Brahmahatya - killing of Brahmana, Ravana who was himself a\r\nwell-known staunch follower of Lord Shiva. The Rameshwaram Temple, built in\r\n12th century is believed to have the same Shiva Lingam.<o:p></o:p></p><p>\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\">The bridge to Lanka named \'Rama Set u\', also known as Adam\'s\r\nBridge is of religious as well as ecological importance. Some 30 Km long, it\r\nwas supposed to be passable on foot till 15th century after which a storm\r\ndeepened the channel.<o:p></o:p></p>',NULL,'','','','chaudhary_yatra1676559663T32_-_second_option_h_605_&_w_1920..jpg','chaudhary_yatra1676559663Inclusion_Image.jpg','chaudhary_yatra1676559663all_NIYAM___CYC.jpg','','4','1','Domestic Package','2','no','yes','2023-02-16 09:31:03'),(39,6,'32B','Madurai, Rameshwaram, Kanyakumari','Madurai, Rameshwaram, Kanyakumari, Suchindram.',4,13061,'','','06','chaudhary_yatra1676886531T32B.jpg','chaudhary_yatra167688653132.pdf','The Rameshwaram Temple which is the main reason the town is known to every other person following Hinduism, Lord Shiva and Lord Vishnu is said to be built by Sethupathis of Sethukavalan - custodian of the legendary bridge built by Lord Rama when he crossed the sea to reach Lanka (now Sri Lanka) the place in the control of Demon King Ravana, also a Brahman.\r\nRameshwaram is believed to be the place from where Lord Rama started his journey to get his wife Sita back from Ravana and the Lord was helped by \'Vaanar-Sena\' army of legendary monkey-humans and served by Hanuman, Lord Ram\'s paramount devotee. Also, many later versions of Ramayana testify of installing a ShivaLingam by Shri Ram and Devi Sita to worship Lord Shiva as a part of penance for Brahmahatya - killing of Brahmana, Ravana who was himself a well-known staunch follower of Lord Shiva. The Rameshwaram Temple, built in 12th century is believed to have the same Shiva Lingam.\r\nThe bridge to Lanka named \'Rama Set u\', al