 Andhra Pradesh and Known for ‘Kaliyuga’ deity Lord Venkateswara. The general elevation of the mountainous part of the district is 2500 feet above sea level.  The Chennai & Bangalore cities are located in 150 Kms. and 250 Kms. respectively to Tirupati Town.','<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: Arial, sans-serif; color: rgb(80, 80, 80); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Tirupati, the holy city is\r\nlocated in the southeastern part of Andhra Pradesh and Known for ‘Kaliyuga’\r\ndeity Lord Venkateswara. The general elevation of the mountainous part of the\r\ndistrict is 2500 feet above sea level. \r\nThe Chennai & Bangalore cities are located in 150 Kms. and 250 Kms.\r\nrespectively to Tirupati Town. <o:p></o:p></span></p>',NULL,'','','','chaudhary_yatra1676891128T33_-_second_option.jpg','chaudhary_yatra1676891128Inclusion_Image.jpg','chaudhary_yatra1676891128all_NIYAM___CYC.jpg','','4','2','','','no','yes','2023-02-20 05:35:27'),(41,6,'34','Kerala Darshan, Cochin, Periyar, Munnar, Rameshwaram','Cochin, Munnar, Periyar (Thekkadi). Madurai, Rameshwaram, Kanyakumari, Suchidram, Trivandrum, Kovalam, Alleppey-Backwaters.',5,30251,'','','11','chaudhary_yatra1676899127T34.jpg','chaudhary_yatra167689912734.pdf','Kochi is one of the cosmopolitan cities of Kerala which had come into limelight with its rich treasures of spices. It is also called as the Gateway to Kerala and its awe inspiring scenic views makes it a perfect tourist destination. Kochi is small place in Kerala which is also known as God\'s Own Country and famous for its green pastures with beautiful landscapes. This city houses the very famous port which is known for its world class standards and facilities. International airport at Nedumbassery is located approximately 40 km North of the city. Malayalam is the native language spoken here. With economic and social development this place has become one of the most happening places in Kerala. People are highly fashion conscious and great western culture influence can be seen in the way they dress.','<p><span style=\"color: rgb(34, 34, 34); font-family: Arial; font-size: 17px; text-align: justify;\">Kochi is one of the cosmopolitan cities of Kerala which had come into limelight with its rich treasures of spices. It is also called as the Gateway to Kerala and its awe inspiring scenic views makes it a perfect tourist destination. Kochi is small place in Kerala which is also known as God\'s Own Country and famous for its green pastures with beautiful landscapes. This city houses the very famous port which is known for its world class standards and facilities. International airport at Nedumbassery is located approximately 40 km North of the city. Malayalam is the native language spoken here. With economic and social development this place has become one of the most happening places in Kerala. People are highly fashion conscious and great western culture influence can be seen in the way they dress.</span><br></p>',NULL,'','','','chaudhary_yatra1676899127T34_-_second_option.jpg','chaudhary_yatra1676899127Inclusion_Image1-80.jpg','chaudhary_yatra1676899127all_NIYAM___CYC.jpg','','4','2','','','no','yes','2023-02-20 07:48:46'),(42,6,'1','panchavati','panchavati',5,5,'','','3','chaudhary_yatra1680875363chaudhary_yatra1673872790chaudhary_yatra1663143685T4.jpg','chaudhary_yatra168087536315.pdf','tyrtyretyhrthyr','<p>hrthrthhrhrth</p>',NULL,'','','','chaudhary_yatra1680875363chaudhary_yatra1673956929sai_tour.png','chaudhary_yatra1680875363chaudhary_yatra1675696087T10A.jpg','chaudhary_yatra1680875363chaudhary_yatra1675766975T13.jpg','','1','2','Special Limited Offer','4','no','yes','2023-04-07 08:19:23'),(43,6,'35','nvnfnmvmvnx','balaji',5,6000,'','','6','chaudhary_yatra1681364050chaudhary_yatra1673956929sai_tour.png','chaudhar