INSERT INTO `seat_reservation_rules` VALUES (1,'<p class=\"MsoNormal\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n115%\">Guidelines of seat reservation, per seat rate in Company buses.<o:p></o:p></span></b></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">All\r\nthe seats in the Company buses are manufactured with latest technology and of\r\ngood quality so that the passenger does not feel any strain and the journey is\r\ncomfortable. From April 1 in 2013, the Company management has bifurcated the\r\nseat reservations into four sectors as below:<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">1)\r\nPremium row - The A to D rows in the front of the bus.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">2)\r\nRegular row - The rows after premium rows.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">3)\r\nSemi economical row - Y row or the second last row<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">4)\r\nEconomical row - Z row or the last row in the bus.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">The\r\nfare per seat as below:<o:p></o:p></span></p><p class=\"MsoNormal\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n115%\">Company bus seat type increase/subsidy rate Maximum/subsidy rate<o:p></o:p></span></b></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">1)\r\nIf seat required in regular row&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Regular\r\nper seat fare<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">2)\r\nIf seat required in premium row&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;5% extra&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Uptill Rs 500/-<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">3)\r\nIf seat received semi economical row&nbsp; &nbsp; &nbsp; 2.5\r\n% subsidy&nbsp; &nbsp; &nbsp; Uptill Rs. 250<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">4)\r\nIf seat received economical row&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 5 % subsidy&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Uptill Rs. 500<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">Tip:\r\nThese rules are applicable only for passengers, who are journeying for more\r\nthan 4 days.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">Notification\r\n* Any passenger will get only one seat other than two seat group\r\n&amp;&amp;&amp;&amp;&amp;&amp;&amp; and if the passenger wants a window seat\r\nthey will have to pay additional 5% per seat rate (Maximum limit Rs 1500).\r\nHowever, the Company reserves the right to change the seat number without prior\r\nnotification. (*All rules and conditions of the Company applicable)<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">&nbsp;</span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">*The\r\nfacilities, rules and conditions of Choudhary Yatra Company Pvt. Ltd.\r\napplicable for passengers in India.&nbsp;<o:p></o:p></span></p>','chaudhary_yatra1676388348Seat_Resevation_Rs_NIYAM___CYC.pdf','no','yes','2023-02-14 09:55:47');
