  `package_date_id` varchar(255) NOT NULL,
  `booking_date` date NOT NULL,
  `booking_reference_no` varchar(255) NOT NULL,
  `booking_status` enum('confirm','cancel','done') NOT NULL DEFAULT 'confirm',
  `payment_confirmed_status` varchar(255) NOT NULL,
  `is_view` enum('yes','no') NOT NULL DEFAULT 'no',
  `is_deleted` enum('yes','no') NOT NULL DEFAULT 'no',
  `is_active` enum('yes','no') NOT NULL DEFAULT 'yes',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=489 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
