INSERT INTO `terms_conditions` VALUES (6,'<p class=\"MsoNormal\">*The facilities, rules and conditions of Choudhary Yatra Company Pvt. Ltd. applicable for passengers in India.</p><p class=\"MsoNormal\"><b style=\"font-size: 1rem;\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n115%\">A) Accommodation arrangement in hotel/independent room during journey.</span></b></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">The\r\naccommodation arrangement in hotel/independent room as in the declared seat\r\nfare is within 50 km area of the halting area. If a family\r\nhas 2/3/4 members they will have to stay in the same room. The passengers will\r\nbe given accommodation in the building at the halt area or nearby building on\r\nany floor. However the room rates may not not be similar. Hence, the passengers\r\nwill have to accept the rooms given. The rooms will not have included\r\nfacilities like TV, cooler, heater or AC. Sometimes during the journey for one\r\nor two nights, the passengers will have to stay at Devasthan Trust yatra\r\nnivas/guest house/bhakta nivas/lodge/Dharamshala/ordinary hotel with families\r\ngetting double bedroom with attached bathroom or at some places having cot\r\nsystem or some instances without bed or attached bathroom. But in such\r\ninstances the difference is not returned because the per seat is calculated on\r\nthat basis.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">&nbsp;</span><b style=\"font-size: 12pt;\">B)\r\nFor common/collective arrangements during journey</b></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">Arrangements\r\nof common/collective accommodation of passengers during journey are made in\r\nyatri nivas/Devasthan Trust\'s Bhakti Nivas/Dharmashala/marriage halls etc in a\r\nbig hall on any floor, verandas, collective/common accommodation, common\r\nbathroom/toilet. The arrangements are made in a single building in the halting\r\nplace or in a different building, which is available.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">&nbsp;</span><b style=\"font-size: 1rem;\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n115%\">C) For passengers of AC vehicles.</span></b></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">1)\r\nThe Company arranges AC services from the first siteseeing/darshan site till\r\nthe last siteseeing/darshan site or as given in the daily programme. The concerned\r\ncoach does not have a TV. During the journey any AC vehicle with less or more\r\nseats are plied. If a smaller vehicle with less number of seats is used the\r\nseat number can change and it is compulsary for the passenger to accept the\r\naccept the number given by the tour manager.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">&nbsp;</span><b style=\"font-size: 1rem;\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n115%\">D) For non AC passengers.</span></b></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">City\r\nsiteseeing arrangements are made in 3x2 buses, jeeps, small vehicle etc. due to\r\nwhich seat numbers can change and the seat number allotted to the passenger at\r\nthe time of booking, is not given. The passengers have to sit anywhere, front\r\nor back in the concerned vehicle. However the journey is very less. The seats\r\nof buses used for Haridwar to Badrinath, Yamunotri, Gangotri journeys are less\r\nthan the Company buses. Hence the Company does not give seat arrangements in\r\nthose buses and the passengers will have to travel on the seats allotted by the\r\ntour manager. None of the vehicles have AC, TV, Video, pushback systems. For\r\nSleeper Vehicles - During daytime travel, the top berth passenger will be authorised\r\nto sit on the lower berth and at that time the lower berth passenger will be\r\nauthorised to sleep on the top berth. Passengers on any birth will not be\r\nallowed to object. If any passenger refuses it, they will have to give 10\r\npercent extra per seat fare. If a third seat is included in two berths, the\r\npassenger will have to give 75 % of the fare per seat and that passenger will\r\nnot get independent mattress in a room. If a journey is arranged in a sleeper\r\ncoach and if in special circumstances, a seater bus or smaller vehicle is used,\r\nthe passengers will get refund of 5 percent of their fare with maximum ceiling\r\nof Rs 500 per seat. If a passenger wants a lower birth in sleeper coach, they\r\nwill have to give additional Rs 500 per seat and if upper birth is taken, a\r\nsubsidy of Rs 500 will be given.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">&nbsp;</span><b style=\"font-size: 1rem;\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n115%\">E) </span></b><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 115%;\">For\r\nlocal siteseeing during the journey, where it has been announced that the\r\nCompany will be using jeeps, Sumo, mini bus or small vehicles, the passengers\r\ntravelling in the front of the rickshaw, jeep, Sumo, Max, mini bus or small\r\nvehicle, will have to travel in the back on the return journey. Is siteseeing\r\nsome local sites, the Company has included common fare of 10 passengers in a\r\ncommon jeep. However is less than 10 persons sit in the vehicle, they will have\r\nto pay the passenger fares of the excluded passengers. Eg. the combined fare of\r\n10 persons in a jeep is Rs 2000/- so the Company will pay Rs 200/- per\r\npassenger. But if 6 out of 10 persons sit in a jeep, the fare of&nbsp; 4 other passengers at Rs 200/- per seat\r\ntotaling Rs 800/- will have to be paid by the persons sitting in the jeep.\r\nFurthermore, if the passengers sitting in the front refuse to sit in the back\r\nlater, and other passengers do not sit, the sitting passengers will have to pay\r\nthe fare of the passengers who did not sit.</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">&nbsp;</span><b style=\"font-size: 1rem;\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n115%\">F) Important notifications for all passengers:</span></b></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">In\r\nthose journeys arranged to Badrinath, Gaurikund, &amp;&amp; Sainachetty\r\n&amp;&amp;, Gangotri, &amp;&amp; Kufri &amp;&amp;, Rohtang Pass,&nbsp; Siligudi, Gangtok, Darjeeling, Port Blair\r\nsite seeing sites, the Company has arranged other non AC vehicles other than\r\nits buses and the cost has been included in the per seat fare. However as these\r\nmini buses, Sumo, jeep etc are smaller in comparison to the Company vehicles,\r\nthe passengers will have to adjust and sit in the back seats.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">2)\r\nIf due to any reason, the flight/railway is cancelled, the passengers will have\r\nto pay for their food, travel and accommodation. The Company will receive the\r\nrefund on the cancelled tickets less the cancellation charges. The amount\r\nreceived by the Company will be returned by cheque to you. However, if the flight\r\nto a destination is cancelled, the passengers will have to bear the travel\r\ncharges&nbsp; to the said destination by train\r\nor other means.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">3)\r\nIn only Hotel Yatra No 1 to 80, the siteseeing of Ramoji Film City is arranged\r\nand the entrance fee is included in the per seat fare.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">&nbsp;4) Nashik is the main yatra site and all\r\naccommodations at Nashik are of collective/common arrangements. Passengers who\r\nhave arrangements for separate rooms and do not like common accommodation, will\r\nhave to pay the separate room charges.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">5)\r\nThe rules, regulations, facilities elaborated in this information booklet, and\r\nalso the oral and written information of rules, regulations, facilities given\r\nby the directors in the Central Office of the Company will be applicable. Other\r\nthan the directors, no other rules, regulations, facilities informed by any\r\nother person will be applicable.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">6)\r\nThe Company will not be responsible if a darshan/siteseeing at a planned site\r\nis not possible due to - political instability, Maowadi/Naxalite incident,\r\nnatural/unnatural disaster, vehicle breakdown, morcha, rasta roko, local\r\nfair/utsav, due to sudden crowds at the given site, if tickets not available,\r\nsickness of a passenger, personal difficulties, if more time is used up for\r\nvisiting other sites, if time is spent at other places, if the\r\ndarshan/siteseeing of a given site/Mandir is not completed within time as\r\ninstructed by the tour manager, if the concerned is closed on that particular\r\nday, if any Government permit is not available, or any other reason. Under such\r\ncircumstances, the the Company vehicles and passengers will not stop at the\r\nsite and the passengers will have to travel as per the programme schedule and\r\nthe passengers will not get any compensation/amount from the Company, please\r\nnote.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">&nbsp;</span><b style=\"font-size: 1rem;\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n115%\">H) Facilities not included in the per seat fare:</span></b></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">1)\r\nAny other facility not noted in the Company instruction booklet, reservation\r\napplication or in the daily programme schedule.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">2)\r\nFrom the first siteseeing till the last siteseeing the railway, flight, ship\r\ntravel\'s tea, snacks, food, furthermore, to and from from the railway station,\r\nairport, bus parking till the accommodation the coolie charges, not fulfilling\r\nof other regulations of railways/flight by the passengers despite having ticket\r\nthe passengers will have to pay the fine charges.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">3)\r\nAll personal expenditure like mineral water, medicines, Ac charges, other\r\nvehicle/auto/taxi arrangements to a given site, if the Company vehicle is not\r\nallowed, also religious rites, alms, entrance fee tickets, boating, ropeway,\r\nhorse, doli, kandi-dandi, rickshaw, coolie, hamali, laundry, telephone, extra\r\ncost for accommodation due to breakdown of Company vehicle or natural/unnatural\r\ndisasters, if railway or flight is cancelled, if eating at other places instead\r\nof partaking of Company food, tea, snacks expenditure etc.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">&nbsp;</span><b style=\"font-size: 1rem;\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n115%\">I) Regulations of food during journey:</span></b></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">1)\r\nGenerally accommodation arrangements of passengers are made at more than one\r\nplace. However as there is a single catering team for one journey, the food is\r\nprepared at a single location and hence, passengers located at different places\r\nwill have to come to the common dining place at their own cost. The passengers\r\nhave to come within the stipulated period. If a passenger does not come within\r\nthe stipulated period or if they eat elsewhere, the Company will not reimburse\r\nthe cost. No food/snacks are given by the Company after 10 PM. The passengers\r\nshould note this and not harass the Company employees for food after this\r\nstated time.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">2)\r\nThe passengers will have to bear the cost to reach the location where the\r\nCompany bus starts its journey or the railway station from where the train is\r\nscheduled.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">5)\r\nIf any passenger from Kolhapur wants to go till Pune railway station, they will\r\nget ordinary bus fare from Kolhapur till Pune. Passengers will have to pay the\r\nrickshaw or other cost while coming from home till the spot where the Kolhapur\r\nbus leaves and the rickshaw and other cost to the Pune railway station from the\r\nspot in Pune where the bus stops.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">6)\r\nFor every journey, there is one tour manager, who has to keep an eye on the\r\naccommodation of the passengers, food and disaster management. Most of the\r\nsiteseeing is conducted through the Company buses. However at some places,\r\nother modes of travel like - small vehicles, rickshaw, horses, doli, walking\r\nhave to be used. Under such circumstances, it is not possible for the tour\r\nmanager to go along with the passengers for siteseeing, especially in places\r\nlike Vaishnodevi, Amarnath, Kedarnath, Girnare, Yamunotri etc most of the\r\ntravel is by walking, horses, doli and helicopter. Hence it should be clearly\r\nnoted that the tour manager does not accompany the passengers.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">7)\r\nThe seat numbers in the bus are as per the chart shown to the passengers in the\r\noffice. In some vehicles, the seating arrangements and seat numbers are\r\ndifferent from the Company chart. Under such circumstances, the seats in the\r\nbuses are given as per the seating arrangements of the office and passengers\r\nshould note it.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">&nbsp;</span><b style=\"font-size: 1rem;\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n115%\">J) Humble appeal to LTC beneficaries of Centre/State Govt employees:</span></b></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">1)\r\nThe travel, food and accommodation charges are included in the fare per seat.\r\nOnly buses through GMVN/ITDC give fare receipt for Central/State Govt.\r\nemployees taking benefit of LTC.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">2)\r\nCentral/State Govt. employees taking benefit of LTC and who wish to get\r\nGMVN/ITDC travel certificate&nbsp; and ticket,\r\nthey should clearly mention it while applying at the Nashik corporate office\r\nfor seat number.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">3)\r\nCentral/State Govt. employees, who wish to get GMVN/ITDC or other state tourism\r\ndevelopment corporation ticket will have to give 10 percent additional charges\r\non the GMVN/ITDC ticket for administrative costs.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">4)\r\nIf there are less seat booking in any ITDC journey, the Company will not give\r\nGMVN/ITDC ticket or certificate. &amp;&amp;&amp;However such passengers will\r\nget back the additional 10 percent charges, which were not taken and further\r\nthree times the 10 percent which means 30 percent of the total ticket fare of\r\nGMVN/ITDC ticket will be given to the passenger as compensation.\r\n&amp;&amp;&amp;<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">5)&nbsp; As MTDC belongs to Maharashtra Govt., Gadwal\r\nMandal Vikas Nigan Ltd. (A Tourism Corporation of Uttaranchal Govt.) of\r\nUttaranchal Govt., similarly ITDC belongs to the Bharat Sarkar. Hence if any\r\nLTC journey is undertaken through any Govt corporation, it is considered to be\r\njourney under Govt. scheme, which has been directed clearly by the Govt. of\r\nIndia personnel dept. <o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">Hence\r\nqueries arise like - Do LTC travel tickets and receipts for all Govt\r\ndepartments work in your office? Are there any difficulties in your office\r\naccepting our department\'s GMVN/ITDC travel ticket/receipt?&nbsp; To remove all such doubts or to get\r\nclarifications, the travellers should ask before applying. The company will\r\nconsider that all doubts have been clarified. No complaints will be entertained\r\nafter the journey is completed.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">&nbsp;</span><b style=\"font-size: 1rem;\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n115%\">K) Rules for passengers of train journeys.</span></b></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">1)\r\nThe Company\'s journeys through railways are always through non AC Second Class compartments.\r\nAs per the Railways Ministry regulations, the reservation bookings begin 120\r\ndays before or less or more days. Hence passengers wanting to travel should\r\nbook reservations early so that they will be able to easily get a confirmed\r\nberth. The Company gives confirmed berth tickets to its passengers in the per\r\nseat fare. Please take note that in special circumstances, journey may possibly\r\nhave to be completed on RAC/waiting ticket. Also as per railway reservation\r\nconfirmation, the railway journey may be late or early as per circumstances.\r\nOral notifications about this will be given a day earlier and all passengers\r\nwill have to comply with it.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">2)\r\nIf any passengers wishes to travel by AC coach or flight instead of Second\r\nClass Sleeper Coach, the information will have to be clearly mentioned in the\r\napplication and the difference in fare will have to be paid at the time of\r\nbooking. If the AC bogie or flight ticket is not available, the passenger will\r\nhave to travel by Second Class Sleeper Coach. If the passengers themselves take\r\nout AC railway/flight tickets to reach the first destination of the journey,\r\nthe non AC Second Class Sleeper Coach fare will be deducted from the journey\r\nfare per seat. However, if the passenger reach the first destination on time\r\nand is not able to complete the siteseeing/darshan, the Company will not be\r\nresponsible.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">3)\r\nThe railway travel on any journey from Mumbai/Aurangabad/Pune/Nashik\r\nRoad/Manmad/Bhusawal/Nagpur/Solapur/Baroda/Surat/Ahmedabad/Indore etc. begins\r\nfrom the railway station. The railway travel could be in a single train from\r\nthe first destination till the final destination or could be in stages through\r\ndifferent trains. If the railway travel in in two stages, the passengers will\r\nhave to bear the local cost of going/coming to reach from one station to\r\nanother. It will be mandatory for the passengers to travel by trains as per the\r\napplicable railway rules.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">4)\r\nThe Company does not arrange for tea, food or snacks during railway travel and\r\nthe passengers themselves have to bear the cost. Also if the concerned\r\ntrain/flight is late, the passengers will have to wait in the waiting room or a\r\nproper place. For this, the Company does not arrange accommodation or food, tea\r\nand snacks. If the railway travel is through two different trains, the company\r\nonly gives railway tickets to the passengers.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">6)\r\nThe Company\'s responsibility during train travel is limited to providing\r\ntickets. As the Company does not provide any other services during railway\r\ntravel, it is not necessary that the company person will accompany the\r\npassengers. The passengers will themselves have to bear the cost of\r\ncoolie/hamal during travel or at railway platforms.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">7)\r\nWhile going towards the destination the Company will give the railway ticket to\r\nthe passengers and the return ticket will be given before starting the return\r\njourney. However, it is incumbant upon the passengers to reach the railway\r\nstation in time and at their own cost. If the passengers fail to reach the\r\nrailway station in time or the train leaves the station, the Company will not\r\nrefund any ticket cancellation amount or the entire journey amount. The\r\nCompany\'s responsibility is only of giving railway tickets. While going on the\r\njourney and after reaching the destination, the passengers will have to bear\r\nthe cost of reaching the arranged accommodation from the railway station by any\r\nvehicle. Similarly, the passengers will have to bear the cost of going to their\r\nhomes by vehicles from the railway station after completing the journey.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">8)\r\nSometimes the train arrives at a different playform than the scheduled\r\nplatform. It will be the responsibility of the passengers to immediately rush\r\nto the another platform and arrange coolies/hamals at their own cost.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">9)\r\nIf the passengers sustain physical injuries or financial losses, it will be solely\r\ntheir responsibility and not that of the Company.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">10)\r\nBefore beginning any journey, especially railway journey, the passengers should\r\nenquire about about the journey date, timings, train number, railway station\r\nname etc during the time of booking or come to the booking office three days\r\nearlier and ask.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">11)\r\nThe Company makes arrangements for those passengers, who wish to take a flight\r\ninstead of train but they should give written intimation and pay the difference\r\nin fare at the time of booking. The passengers will have to bear the cost of\r\ntickets and cost of travelling to the airport and from the airport till the\r\narranged accommodation.<o:p></o:p></span></p><p class=\"MsoNormal\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">&nbsp;</span>L) Other General regulations and conditions of the Company</b></p><p class=\"MsoNormal\">1) The journey starts exactly as announced in the information booklet and the date announced by the Company. If any journey in India is cancelled due to low seats, the Company will compensate the booked passengers by refunding them five times their amount paid for the journey. So far the scheduled journeys have been rescheduled by one or two days but by the Grace of the Almighty, no Company journey has been cancelled yet. However, if there are less seats, the seat numbers change, vehicle type changes, seating arrangement changes. It is mandatory for the passengers to sit on changed seats in a less capacity vehicle. If any passenger refuses due to this reason, the passenger\'s journey is cancelled as per the cancellation policy of the Company. It is not necessarily that the Company\'s journey has cancelled, if a passenger cancels their journey.</p><p class=\"MsoNormal\"><span style=\"font-size: 1rem;\">2) If the railway berth is not confirmed or ITDC ticket is not possible and so if the passenger wishes to cancel the journey, they will not get any type of compensation and the cancellation will be as per the Cancellation Rules.</span><br></p><p class=\"MsoNormal\"><span style=\"font-size: 1rem;\">3) Rules Nos. 1 and 2 are not applicable to foreign tours. If there are less seats for a foreign tour and the scheduled journey is cancelled by the Company, the passengers will get refund of their booking amount with deductions of the Company\'s administrative expenses. They will not get five times their amount.</span><br></p><p class=\"MsoNormal\"><span style=\"font-size: 1rem;\">5) For a fun filled and peaceful journey, passengers should bring along only essential items uptill 15 kg prominently beedsheet, chhadar, carpet, water bag, torch, nylon rope, small lock, 9 inches bucket, daily wear dresses, necessary medicines etc. If the luggage weight is higher than this amount, extra luggage charges decided by the tour manager will have to be paid. Passengers should not bring along gold ornaments, valuable goods or large amount of cash. Passengers will have to look after their luggage themselves. It will not be the responsibility of the Company or journey management to care for the passengers\' luggage. If any luggage is stolen, the passengers themselves will be responsible, take note. It will be the responsibility of the passengers for losses to life or finances. If the passengers cause any damages to the Company buses or place of accommodation, the journey organisers will declare the compensation, and the passengers will have to pay the amount at that place at the rate decided.</span><br></p><p class=\"MsoNormal\"><span style=\"font-size: 1rem;\">6) The amount for reserving/booking the journey will be 35 percent of the total amount and will have to be paid only through cheque or DD on any nationalised bank payable to Choudhary Yatra Company Pvt. Ltd., Nashik. The remaining amount if in cash will have to be paid 11 days before the commencement of the journey or 21 days before the journey if by cheque after which the seat number will be confirmed. If less amount is given during booking, the railway ticket will be confirmed only after the total 35 percent amount is paid. While paying any amount in any authorised branch of the Company, the passengers should only accept receipts with numbers. The Company will not be responsible for any other amount other than given on the authorised receipt. Passengers should only pay through DD or cheque. The Company gives priority to cash/cheque/DD/RTGS/NFT/Paytm. Passengers should only accept documents if the SRA or receipt has the Corporate office (Nashik) computerised code. It will be mandatory for the passengers that the booking will be considered valid only after the computerised code. During the journey, it is necessary for the passengers to keep on their person journey seat reservation form, recepts for amounts paid and all original documents of booking or they will not be allowed to participate the journey. The passengers will have to mandatorily produce the documents during the journey, if asked by the Company official/employees.</span><br></p><p class=\"MsoNormal\"><span style=\"font-size: 1rem;\">7) It is necessary to produce the birth certificate of a child below 11 years at the time of seat booking. During the journey it is mandatory for passengers to keep self photos and original Govt. documents/identification with photos showing age because of compulsory checking during bus, railway or flights. The photo identification with age will be required while visiting Central and state Govt, railway, flight, local bodies sites or at the place of accommodation. If the photo identification is not made available, the passengers themselves will be responsible for the ensuing mental and physical harassment and resulting fines.</span><br></p><p class=\"MsoNormal\"><span style=\"font-size: 1rem;\">8) Other than railway/flight/ship journey, the per seat fare includes one time Maharashtrian food, Gujarati food and Rajasthani food, breakfast and tea from the first site till the last during bus travel and includes plate - glass, mattress and common accommodation. The Company arranges Upvas (fast) arrangements only on Thursday, Chaturthi, Ekadashi. If there are less seats, the passengers are provided food at local hotels. During the journey, the passengers have to make use of local water arrangements. If it causes any issues or affects the passengers, the Company will not be responsible. If the passengers do not like local water they should buy mineral water at their own cost. From the morning of the second day of the journey or from the first darshan site till the last site, the Company arranges lodging-boarding facilities. The Company does not arrange for food during railway/flight/ship and the passengers have to bear the cost.</span><br></p><p class=\"MsoNormal\"><span style=\"font-size: 1rem;\">9) The passengers should always enjoy their journey. For this the Company always strives that the journey should be happy but happiness and difficulties are two sides of the same coin. The passengers should bear this in mind, accept some small difficulties and cooperate the&nbsp; journey management.</span><br></p><p class=\"MsoNormal\"><span style=\"font-size: 1rem;\">10) If any planned journey is not possible due to natural/unnatural reasons, the amount is not refunded but the passengers are transferred in a similar journey later. Under special circumstances, if there are any changes in scheduled site or in fares, it will be mandatory for the passengers to accept it.</span><br></p><p class=\"MsoNormal\"><span style=\"font-size: 1rem;\">11) For passengers, who have booked as per the earlier information booklet, the clause 29B (dated 1 October 2022 to March 2022) pertaining to journey number, journey per seat fare, days, changes in sites, facilities will be mandatory.</span><br></p><div><span style=\"font-size: 12pt;\">(*All rules and conditions of the Company applicable)</span></div><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:115%\">***<o:p></o:p></span></p>','chaudhary_yatra1676388521NIYAM___CYC.pdf','no','yes','2023-01-20 01:25:05');
